INSERT INTO `examenfinal` VALUES (2,'1','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>FUTBOL O BALOMPIÉ</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><span style=\"letter-spacing: 0.2px;\">Fue Gran Bretaña, la cuna del fútbol moderno, derivado de prácticas que también se realizaban desde hacía varios siglos en Gales e Inglaterra.</span><br></p><p><span style=\"letter-spacing: 0.2px;\">En la Universidad de Cambridge se confeccionó el primer reglamento futbolístico en 1.843 y las primeras competiciones oficiales se celebraron en 1.871, tras haber alcanzado este deporte una rápida y gran difusión. En 1.882 se estableció el Código de Manchester, base del actual reglamento, que fue remodelado en 1.938. El Fútbol en el siglo XX se expandió por toda Europa y América, desde México a Argentina, hasta tal punto que los americanos llegaron a conseguir la hegemonía mundial durante largas fases.</span></p><p>La práctica del fútbol se basa en el siguiente esquema: dos equipos o escuadras de once jugadores cada uno operan sobre un campo o cancha, por la posesión y conducción de un balón hasta colocarlo en un receptáculo contrario o portería, de las dos que existen, (una por cada equipo).</p><p>El campo, terreno de juego o cancha, es un gran rectángulo de 90-120 mts de largo y 45-90 mts de anchura. Los campos para competiciones oficiales han de tener 100-110 mts de longitud por 64-75 mts de anchura. El suelo debe ser de hierba, en competiciones oficiales, pero en las prácticas populares se juega también sobre campo de tierra y sobre cemento, (fútbol de sala).</p><p>En el centro de cada lado menor del rectángulo, delimitado por una línea blanca, están las porterías, rectángulos cuya base es el césped y el resto de los tres lados, sendos postes redondos de madera. De los ángulos superiores parten hacia atrás dos barras curvadas de hierro que soportan una red de malla, de cuerda o fibra plástica. La portería tiene 7.32 mts de anchura por 2.44 mts de altura.</p><blockquote><span style=\"letter-spacing: 0.2px;\">El balón es un esférico de cuero con una vejiga interna de aire, o bien fabricado de un material cauchutado plastificado. Sus dimensiones son de 68-71cm. de circunferencia y su peso de 396-453 gramos.</span></blockquote><blockquote><br>Extractado de ENCICLOPEDIA OCÉANO COLOR, tomo 6, Océano Grupo Editorial S.A.</blockquote>',' La cuna del fútbol moderno es: ','Brasil','Francia','Italia','Gran Bretaña','Argentina',0,0,0,1,0,'La base del actual reglamento de fútbol es: ','El Código de Manchester','La ley de ventaja','El Código de Hamurabi','La Ley del Deporte','El Código del Deporte',1,0,0,0,0,'La portería de una cancha de una cancha de fútbol debe medir:','8.00 mts de ancho por 2.50 mts de alto','7.32 mts de ancho por 2.44 mts de alto','6.85 mts de ancho por 2.70 mts de alto','5.50 mts de ancho por 2.35 mts de alto','7.00 mts de ancho por 2.00 mts de alto',0,1,0,0,0,'El primer reglamento futbolístico se confeccionó en:','La Universidad de Harvard','La Universidad de Cambridge','La sede de la FIFA','La Universidad de la Sorbona','La Confederación de Fútbol',0,1,0,0,0,'Las primeras competiciones oficiales se celebraron en:','1871','1843','1845','1884','1950',1,0,0,0,0,'333','19980',''),(3,'1','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>FUTBOL O BALOMPIÉ</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><span style=\"letter-spacing: 0.2px;\">Fue Gran Bretaña, la cuna del fútbol moderno, derivado de prácticas que también se realizaban desde hacía varios siglos en Gales e Inglaterra.</span><br></p><p><span style=\"letter-spacing: 0.2px;\">En la Universidad de Cambridge se confeccionó el primer reglamento futbolístico en 1.843 y las primeras competiciones oficiales se celebraron en 1.871, tras haber alcanzado este deporte una rápida y gran difusión. En 1.882 se estableció el Código de Manchester, base del actual reglamento, que fue remodelado en 1.938. El Fútbol en el siglo XX se expandió por toda Europa y América, desde México a Argentina, hasta tal punto que los americanos llegaron a conseguir la hegemonía mundial durante largas fases.</span></p><p>La práctica del fútbol se basa en el siguiente esquema: dos equipos o escuadras de once jugadores cada uno operan sobre un campo o cancha, por la posesión y conducción de un balón hasta colocarlo en un receptáculo contrario o portería, de las dos que existen, (una por cada equipo).</p><p>El campo, terreno de juego o cancha, es un gran rectángulo de 90-120 mts de largo y 45-90 mts de anchura. Los campos para competiciones oficiales han de tener 100-110 mts de longitud por 64-75 mts de anchura. El suelo debe ser de hierba, en competiciones oficiales, pero en las prácticas populares se juega también sobre campo de tierra y sobre cemento, (fútbol de sala).</p><p>En el centro de cada lado menor del rectángulo, delimitado por una línea blanca, están las porterías, rectángulos cuya base es el césped y el resto de los tres lados, sendos postes redondos de madera. De los ángulos superiores parten hacia atrás dos barras curvadas de hierro que soportan una red de malla, de cuerda o fibra plástica. La portería tiene 7.32 mts de anchura por 2.44 mts de altura.</p><blockquote><span style=\"letter-spacing: 0.2px;\">El balón es un esférico de cuero con una vejiga interna de aire, o bien fabricado de un material cauchutado plastificado. Sus dimensiones son de 68-71cm. de circunferencia y su peso de 396-453 gramos.</span></blockquote><blockquote><br>Extractado de ENCICLOPEDIA OCÉANO COLOR, tomo 6, Océano Grupo Editorial S.A.</blockquote>','Fecha en que se estableció el Código de Manchester:','1884','1845','1843','1882','1871',0,0,0,1,0,'Medida oficial del terreno de juego:','100-110 mts de largo por 45-90 de ancho','100-120 mts de largo por 64-75 de ancho','100-110 mts de largo por 64-75 de ancho ','90-110 mts de largo por 45-90 de ancho','90-120 mts de largo por 64-75 de ancho',0,0,1,0,0,'Las primeras prácticas del fútbol se dieron en:','Gran Bretaña e Inglaterra','México y Argentina','Europa y América','Argentina y América','Inglaterra y Gales',0,0,0,0,0,'Fecha en que se confeccionó el primer     reglamento futbolístico:','1871','1843','1950','1992','1882',0,1,0,0,0,'Las dimensiones del balón deben ser:','68-71 cm. de circunferencia y su peso de 396-453 gramos','68-71 cm. de circunferencia y su peso de 394-456 gramos','68-85 cm. de circunferencia y su peso de 390-450 gramos','65-70 cm. de circunferencia y su peso de 390-450 gramos','65-70 cm. de circunferencia y su peso de 396-456 gramos',1,0,0,0,0,'333','19980',''),(4,'2','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>IDEAS DIRECTRICES</strong></h3>\r\n<p>Son muchos los estudiantes que no aprenden, por la sencilla razón de que ignoran qué es lo que\r\ndeben aprender. Cada uno de los conjuntos de los conocimientos que constituyen las asignaturas\r\nde una carrera, o el bagaje conceptual de una profesión, se divide y subdivide en sistemas de\r\ndatos y relaciones que forman capítulos, subcapítulos y párrafos en los libros que los exponen.\r\nA cada uno de esos sectores corresponde una o varias directrices, que a veces figuran en el\r\nacápite de la página o cómo título del párrafo, pero en muchos libros de texto -poco didácticosno se hallan suficientemente formulados.\r\nEn este caso, como en el de una explicación verbal ulteriormente reproducida, es esencial que el\r\nestudiante se preocupe en descubrir cuál es esa idea directriz hilo conductor del pensamiento del\r\nmaestro o expositor, pues sin esa ayuda uno de los puntos o frases tendrá mayor o menor relación\r\ncon su anterior y siguiente, pero carecerá de unidad de sentido la totalidad del sector.\r\nAsí, pues, como cada fábula tiene su moraleja, es decir su esencia significativa, cada serie de\r\npensamientos posee una directriz o concepto fundamental. Descubrirlo, cuando no está en\r\nbastardilla es conquistar uno de los factores esenciales de todo aprendizaje cultural.\r\nSi ustedes, amigos lectores, dedicasen una hora cada día a la tarea de descubrir, concretar y\r\nformular las ideas directrices de unos cuanto párrafos de diversos textos, se ejercitarán en una\r\ntécnica de abstracción y de síntesis que les permitirá sacar el máximo de provecho de cualquier\r\ntipo de lectura o estudio posterior.\r\nExtractado de “Cómo estudiar y cómo aprender” de Emilio Mira y López..<br></p>',' El autor afirma que son muchos los estudiantes  que no aprenden, por la sencilla razón:','que ignoran qué es lo que deben aprender',' que no prestan la debida atención','que mientras leen, piensan en otra cosa',' que no estudian en el horario adecuado','que no dedican el tiempo suficiente al estudio',1,0,0,0,0,'Las asignaturas de una carrera, se dividen y  subdividen en sistemas de datos y relaciones,  que forman:','Capítulos y párrafos','Subcapítulos, párrafos y subpárrafos','Capítulos, subcapítulos y párrafos','Subcapítulos y párrafos','Capítulos y subcapítulos',0,0,1,0,0,'Es esencial que el estudiante se preocupe de  descubrir cuál es:','La idea directriz','La idea principal y la complementaria para  detectar de esa forma la idea madre','La idea principal','La idea complementaria','El concepto general',1,0,0,0,0,'Descubrir una idea directriz, cuando no está en  bastardilla es como:','Conquistar uno de los factores esenciales de todo  aprendizaje cultural','Lograr la solución de todos los problemas de  aprendizaje','Alcanzar el máximo provecho de nuestras facultades  mentales','Encontrar la esencia significativa del texto','Lograr una técnica de abstracción y de síntesis',1,0,0,0,0,'El autor propone a la tarea de descubrir, concretar y formular las ideas directrices:','Una hora de práctica al día','Una hora de práctica a la semana','Dos horas de práctica a la semana','Una hora de práctica al mes','Cuatro horas de práctica a la semana',1,0,0,0,0,'262','15720',''),(5,'2','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>IDEAS DIRECTRICES</strong></h3>\r\n<p>Son muchos los estudiantes que no aprenden, por la sencilla razón de que ignoran qué es lo que\r\ndeben aprender. Cada uno de los conjuntos de los conocimientos que constituyen las asignaturas\r\nde una carrera, o el bagaje conceptual de una profesión, se divide y subdivide en sistemas de\r\ndatos y relaciones que forman capítulos, subcapítulos y párrafos en los libros que los exponen.\r\nA cada uno de esos sectores corresponde una o varias directrices, que a veces figuran en el\r\nacápite de la página o cómo título del párrafo, pero en muchos libros de texto -poco didácticosno se hallan suficientemente formulados.\r\nEn este caso, como en el de una explicación verbal ulteriormente reproducida, es esencial que el\r\nestudiante se preocupe en descubrir cuál es esa idea directriz hilo conductor del pensamiento del\r\nmaestro o expositor, pues sin esa ayuda uno de los puntos o frases tendrá mayor o menor relación\r\ncon su anterior y siguiente, pero carecerá de unidad de sentido la totalidad del sector.\r\nAsí, pues, como cada fábula tiene su moraleja, es decir su esencia significativa, cada serie de\r\npensamientos posee una directriz o concepto fundamental. Descubrirlo, cuando no está en\r\nbastardilla es conquistar uno de los factores esenciales de todo aprendizaje cultural.\r\nSi ustedes, amigos lectores, dedicasen una hora cada día a la tarea de descubrir, concretar y\r\nformular las ideas directrices de unos cuanto párrafos de diversos textos, se ejercitarán en una\r\ntécnica de abstracción y de síntesis que les permitirá sacar el máximo de provecho de cualquier\r\ntipo de lectura o estudio posterior.\r\nExtractado de “Cómo estudiar y cómo aprender” de Emilio Mira y López..<br></p>','El autor concibe como la idea directriz a:','La esencia del aprendizaje',' La cantidad de párrafos de un texto','El hilo conductor del pensamiento','El título del parágrafo','El aprendizaje cultural',0,0,1,0,0,' ¿Cuál es la técnica que plantea el autor para  sacar el máximo provecho a una lectura?','Retención de ideas',' Síntesis de capítulos','Abstracción de textos','Retención y abstracción',' Abstracción y síntesis',0,0,0,0,1,'En un texto la idea directriz puede figurar en:','El subcapítulo','El parágrafo','El párrafo','El título','El capítulo',0,0,1,0,1,'Nombre que se le da a un conjunto de  conocimientos:','Profesión','Carrera','Asignatura','Bagaje Conceptual','Sistema de Datos',0,0,0,1,0,'¿Cuál es el objetivo de una idea directriz?','Desconectar frases del párrafo','Codificar una oración','Analizar el texto','Conectar al maestro con el texto','Encontrar la esencia del texto',0,0,0,0,0,'262','15720',''),(6,'3','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>RELACIONES ENTRE NIÑOS Y NIÑAS</strong></h3><p><strong><br></strong></p><p>\r\n\r\nCuando el niño llega a la edad de establecer relaciones sociales con otros niños no es probable\r\nque al principio haga distinciones muy perceptibles entre ambos sexos. Niños y niñas juegan\r\njuntos e intervienen casi en las mismas actividades. Sin embargo, aún en la edad preescolar se\r\nponen de manifiesto algunas distinciones y diferencias. Los niños tienden a ser más activos en\r\nel juego, aunque las diferencias dentro de cada grupo mixto son mayores que las que se dan entre\r\nlos del sexo opuesto. A los tres y cuatro años, los niños intervienen en más conflictos que las\r\nniñas y es más probable que recurran a golpes. En un grupo mixto, los conflictos niño-niño,\r\nniña-niña son más frecuentes que entre niño y niña, aunque se dan grandes diferencias individuales. Del mismo modo, en el nivel preescolar, sobre todo después de los dos años de edad, es\r\nprobable que las amistades de niño y niño, y de niña y niña sean más numerosas que las de niño\r\ny niña. Sin embargo, a pesar de que los niños prefieren tener compañeros de juego de su mismo\r\nsexo, hay mucha acción recíproca y no es probable que en esa edad temprana un niño se sienta\r\nmolesto en un grupo donde los demás miembros son del sexo opuesto.&nbsp;</p><p>Algunas diferencias entre niños y niñas:&nbsp;</p><p>También pueden observarse otras diferencias que pueden influir directa o indirectamente en los\r\nhábitos sociales y el comportamiento de niños y niñas. Las niñas son algo superiores en cuanto\r\nal desarrollo temprano del lenguaje. Desde una edad temprana tienden a mostrar más interés que\r\nlos niños por otras personas y las relaciones sociales, en tanto que los varones tienden a mostrar\r\nmás interés por las cosas y los artefactos mecánicos. En muchos aspectos los varones integran el\r\nmás débil de los sexos, al menos durante los primeros años de vida. La mortalidad infantil entre\r\nellos es algo más elevada y el desarrollo de su esqueleto es algo más lento. Las niñas no plantean\r\nproblemas de comportamiento con tanta frecuencia ni en tanta cantidad como los varones, y el\r\nnúmero de niñas que tienen problemas de pronunciación o dificultades para la lectura es menor\r\nque el de los niños. Generalmente los varones superan mucho a las niñas en la cantidad de “niños\r\nproblema”, tanto en la escuela como en la población delincuente de fuera de la escuela. En algunos aspectos parece que durante el desarrollo es más difícil ser varón que niña (aunque también\r\nsería posible documentar la conclusión opuesta). La diferencia principal puede consistir, sin\r\nembargo, en que las esperanzas y las presiones sociales son tales que los niños tienen más libertad para manifestar sus sentimientos, para rebelarse francamente y para exhibir sus contratiempos e inquietudes de manera evidente.&nbsp;</p><p>Extractado del libro: Psicología del niño. Autor: Arthur T. Jersild.</p>','En los grupos mixtos de niños y niñas los  conflictos que se dan con menor frecuencia son  entre:','Niño-niña','Niña-niña','Niño-niño',' Niños-niños',' Niñas-niñas',1,0,0,0,0,'Según el autor durante los primeros años de  vida en muchos aspectos:','El varón constituye el sexo débil',' La mujer constituye el sexo débil',' No hay diferencia apreciable entre los sexos','No existe debilidad en ningún sexo',' Ambos sexos son débiles',1,0,0,0,0,'Una diferencia entre los niños y las niñas es  que los primeros:','Comen menos','Plantean más problemas','Plantean menos problemas','Pronuncian más correctamente','Se desarrollan más físicamente',0,1,0,0,0,'Otra diferencia es que la mortalidad infantil  es:','Mucho más elevada en los niños que en las niñas','Algo más elevada en las niñas que en los niños','Algo más elevada en los niños que en las niñas','Mucho más elevada en las niñas que en los niños','No existe diferencia',0,0,1,0,0,'La diferencia principal entre niños y niñas puede consistir:','En que los primeros son más fuertes','En que las niñas tienen menores problemas de  pronunciación y lectura','En que la sociedad considera superior al niño','En que los niños tienen mayor libertad para expresar sus  sentimientos','En que las niñas son más despiertas que los niños',0,0,0,1,0,'472','28320',''),(7,'3','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>RELACIONES ENTRE NIÑOS Y NIÑAS</strong></h3><p><strong><br></strong></p><p>\r\n\r\nCuando el niño llega a la edad de establecer relaciones sociales con otros niños no es probable\r\nque al principio haga distinciones muy perceptibles entre ambos sexos. Niños y niñas juegan\r\njuntos e intervienen casi en las mismas actividades. Sin embargo, aún en la edad preescolar se\r\nponen de manifiesto algunas distinciones y diferencias. Los niños tienden a ser más activos en\r\nel juego, aunque las diferencias dentro de cada grupo mixto son mayores que las que se dan entre\r\nlos del sexo opuesto. A los tres y cuatro años, los niños intervienen en más conflictos que las\r\nniñas y es más probable que recurran a golpes. En un grupo mixto, los conflictos niño-niño,\r\nniña-niña son más frecuentes que entre niño y niña, aunque se dan grandes diferencias individuales. Del mismo modo, en el nivel preescolar, sobre todo después de los dos años de edad, es\r\nprobable que las amistades de niño y niño, y de niña y niña sean más numerosas que las de niño\r\ny niña. Sin embargo, a pesar de que los niños prefieren tener compañeros de juego de su mismo\r\nsexo, hay mucha acción recíproca y no es probable que en esa edad temprana un niño se sienta\r\nmolesto en un grupo donde los demás miembros son del sexo opuesto.&nbsp;</p><p>Algunas diferencias entre niños y niñas:&nbsp;</p><p>También pueden observarse otras diferencias que pueden influir directa o indirectamente en los\r\nhábitos sociales y el comportamiento de niños y niñas. Las niñas son algo superiores en cuanto\r\nal desarrollo temprano del lenguaje. Desde una edad temprana tienden a mostrar más interés que\r\nlos niños por otras personas y las relaciones sociales, en tanto que los varones tienden a mostrar\r\nmás interés por las cosas y los artefactos mecánicos. En muchos aspectos los varones integran el\r\nmás débil de los sexos, al menos durante los primeros años de vida. La mortalidad infantil entre\r\nellos es algo más elevada y el desarrollo de su esqueleto es algo más lento. Las niñas no plantean\r\nproblemas de comportamiento con tanta frecuencia ni en tanta cantidad como los varones, y el\r\nnúmero de niñas que tienen problemas de pronunciación o dificultades para la lectura es menor\r\nque el de los niños. Generalmente los varones superan mucho a las niñas en la cantidad de “niños\r\nproblema”, tanto en la escuela como en la población delincuente de fuera de la escuela. En algunos aspectos parece que durante el desarrollo es más difícil ser varón que niña (aunque también\r\nsería posible documentar la conclusión opuesta). La diferencia principal puede consistir, sin\r\nembargo, en que las esperanzas y las presiones sociales son tales que los niños tienen más libertad para manifestar sus sentimientos, para rebelarse francamente y para exhibir sus contratiempos e inquietudes de manera evidente.&nbsp;</p><p>Extractado del libro: Psicología del niño. Autor: Arthur T. Jersild.</p>','Desde qué edad el niño hace distinciones de  sexos:','Desde los cinco años','Desde los dos años','Desde los siete años','Desde el primer año','Desde los seis años',0,1,0,0,0,'En la lectura se habla que en el nivel preescolar  son más numerosas las amistades entre:',' Niño-Niña; Niño-Niño','Niñas-Niños; Niña-Niña','Niño-Niño; Niños-Niñas','Niña-Niña; Niño-Niño','Todas las anteriores',0,0,0,1,0,'Dentro de las diferencias descritas, se  encuentra que las niñas tienen:','Mayor capacidad de comprensión','Menores habilidades para la lectura','Mayor capacidad para los trabajos mecánicos','Menores problemas de pronunciación y lectura','Mayor libertad para expresar sus sentimientos',0,0,0,1,0,'Una diferencia encontrada en los varones con  relación a las niñas es:','Su poca capacidad para desarrollar trabajos mecánicos','Su rápido desarrollo físico','Su alto interés por las relaciones sociales','Su dificultad para expresar sus sentimientos','Su desarrollo lento del lenguaje',0,0,0,0,0,'El autor dice que los niños prefieren tener por compañeros de juego a:','Niños mayores de dos años','Niños con buena conducta','Niños de su mismo sexo','Niños del sexo opuesto','-',0,0,1,0,0,'472','28320',''),(8,'4','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LA MÚSICA COMO EXPRESIÓN</strong></h3><p><strong><br></strong></p><p>Hemos visto que no hay motivos para creer que el carácter único supone el aislamiento. Las\r\nexperiencias poéticas son tan únicas como las experiencias musicales, pero nadie se imagina que\r\nconstituyen un mundo cerrado propio, que no guardan relación alguna con el resto de la\r\nnaturaleza del poeta y de su experiencia de la vida. Es verdad que, para la apreciación de una\r\nobra de arte en un medio cualquiera, hacen falta sensibilidades especiales, y que estas\r\nsensibilidades especiales pueden ser agradablemente ejercitadas con independencia casi\r\ncompleta de cualesquiera otros intereses. Así, buena parte de la poesía de Spencer puede tal vez\r\nser considerada como existente en un vacío moral y espiritual; tiene un contenido, por decirlo de\r\neste modo, punto menos que indescifrable. Aquí, las sesibilidades poéticas específicas son\r\nejercitadas “por ellas mismas”.\r\nLa música, en medida mucho mayor que la poesía, proporciona ejemplos de obras que llevan a\r\nesta existencia curiosamente independiente, pero esto no nos dice, en la música ni en la poesía,\r\nque se trate de una existencia esencialmente sin sentido. Por tanto, si descubrimos que algunas\r\ncomposiciones sugieren, de modo irresistible, cierto contenido espiritual, no debemos resistir\r\neste impulso por razones teóricas.\r\nNo necesitamos suponer que somos las víctimas de una cultura literaria y de una facultad\r\nmusical imperfectamente desarrollada. En realidad, todas las grandes composiciones del mundo\r\n– y también algunas de las peores- sugieren un contenido espiritual. Hacen algo más que sugerir;\r\ntoda su existencia está condicionada por este contenido y trata de expresarlo. Este contenido es\r\npercibido directamente incluso por aquellos que, por razones teóricas, no admiten\r\nexplícitamente su existencia. Por ejemplo, el más fervoroso defensor de la teoría del aislamiento\r\ncalifica una composición como más profunda que otra, describe una melodía como “noble” y\r\notra como “sentimental”. Tales juicios son incompatibles con la teoría del aislamiento, porque,\r\nconforme a ésta, solo puede decirse que una pieza de música proporciona un grado mayor o\r\nmenor de placer único y no comunicable. Una composición no puede ser más profunda, noble o\r\nsentimental que, por ejemplo, el vino. Sin embargo, tales juicios son completamente inevitables\r\nen el caso de muchas composiciones.\r\nSi admitimos esto, podemos, a los efectos en que nos ocupamos, dividir las composiciones\r\nmusicales en tres clases. Podemos admitir, en la medida de penetración de nuestro análisis\r\npresente, que hay composiciones que existen en el aislamiento. En segundo lugar, hay\r\ncomposiciones que brotan de un contenido espiritual y expresan experiencias espirituales. Y en\r\ntercer lugar, hay la clase de música generalmente llamada descriptiva. De estas tres clases, la\r\nsegunda es la más importante.&nbsp;</p><p>Extractado de “Beethoven”, por J.W.N<br></p>','Para poder apreciar una obra de arte es  preciso:','Ser un artista','Abandonarse al influjo de la obra','Tener sensibilidades especiales','Ser un músico','Nacer artista',0,0,1,0,0,'Existen obras musicales:','Sin contenido alguno','Sin contenido espiritual','Muy independientes pero con contenido  espiritual','Sin contenido artístico','De solo contenido artístico',0,0,1,0,0,'El fin de toda composición musical es:','Expresar contenido espiritual','Agradar al oyente por su perfección técnica','Describir una determinada imagen','Satisfacer al oyente','Obtener utilidades',1,0,0,0,0,'Los calificativos de “noble” o “sentimental”  son, con respecto a la teoría del aislamiento:','Incompatibles','Concordantes','Coherentes','Comunicables','Compatibles',1,0,0,0,0,'De las tres clases de composiciones musicales  las más importantes son:','Las que existen en el aislamiento','Las que expresan experiencias espirituales','Las que describen imágenes','Las que no existen en aislamiento','Las que no describen imágenes',0,1,0,0,0,'434','26040',''),(9,'4','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>LA MÚSICA COMO EXPRESIÓN</strong></h3><p><strong><br></strong></p><p>Hemos visto que no hay motivos para creer que el carácter único supone el aislamiento. Las\r\nexperiencias poéticas son tan únicas como las experiencias musicales, pero nadie se imagina que\r\nconstituyen un mundo cerrado propio, que no guardan relación alguna con el resto de la\r\nnaturaleza del poeta y de su experiencia de la vida. Es verdad que, para la apreciación de una\r\nobra de arte en un medio cualquiera, hacen falta sensibilidades especiales, y que estas\r\nsensibilidades especiales pueden ser agradablemente ejercitadas con independencia casi\r\ncompleta de cualesquiera otros intereses. Así, buena parte de la poesía de Spencer puede tal vez\r\nser considerada como existente en un vacío moral y espiritual; tiene un contenido, por decirlo de\r\neste modo, punto menos que indescifrable. Aquí, las sesibilidades poéticas específicas son\r\nejercitadas “por ellas mismas”.\r\nLa música, en medida mucho mayor que la poesía, proporciona ejemplos de obras que llevan a\r\nesta existencia curiosamente independiente, pero esto no nos dice, en la música ni en la poesía,\r\nque se trate de una existencia esencialmente sin sentido. Por tanto, si descubrimos que algunas\r\ncomposiciones sugieren, de modo irresistible, cierto contenido espiritual, no debemos resistir\r\neste impulso por razones teóricas.\r\nNo necesitamos suponer que somos las víctimas de una cultura literaria y de una facultad\r\nmusical imperfectamente desarrollada. En realidad, todas las grandes composiciones del mundo\r\n– y también algunas de las peores- sugieren un contenido espiritual. Hacen algo más que sugerir;\r\ntoda su existencia está condicionada por este contenido y trata de expresarlo. Este contenido es\r\npercibido directamente incluso por aquellos que, por razones teóricas, no admiten\r\nexplícitamente su existencia. Por ejemplo, el más fervoroso defensor de la teoría del aislamiento\r\ncalifica una composición como más profunda que otra, describe una melodía como “noble” y\r\notra como “sentimental”. Tales juicios son incompatibles con la teoría del aislamiento, porque,\r\nconforme a ésta, solo puede decirse que una pieza de música proporciona un grado mayor o\r\nmenor de placer único y no comunicable. Una composición no puede ser más profunda, noble o\r\nsentimental que, por ejemplo, el vino. Sin embargo, tales juicios son completamente inevitables\r\nen el caso de muchas composiciones.\r\nSi admitimos esto, podemos, a los efectos en que nos ocupamos, dividir las composiciones\r\nmusicales en tres clases. Podemos admitir, en la medida de penetración de nuestro análisis\r\npresente, que hay composiciones que existen en el aislamiento. En segundo lugar, hay\r\ncomposiciones que brotan de un contenido espiritual y expresan experiencias espirituales. Y en\r\ntercer lugar, hay la clase de música generalmente llamada descriptiva. De estas tres clases, la\r\nsegunda es la más importante.&nbsp;</p><p>Extractado de “Beethoven”, por J.W.N<br></p>',' Según el autor la poesía de Spencer tiene contenido:','Descifrable','Espiritual','Subliminal','Indescifrable','Moral',0,0,0,1,0,'La lectura se titula:','La expresión de la música','Experiencias musicales','Música y expresión','La expresión musical','La música como expresión',0,0,0,0,1,'La lectura nos habla de que todas las grandes composiciones del mundo y también algunas de las peores, sugieren un contenido:','Sentimental','Moral','Espiritual','Subliminal','Conceptual',0,0,1,0,0,'Se dice que hay composiciones que existen en:','El aislamiento','El ser propiamente dicho','La naturaleza de las cosas','La realidad','El diario vivir',1,0,0,0,0,'El autor divide las composiciones musicales en tres y dice que la más importante es:','Las que existen en el aislamiento','Las que brotan de un contenido espiritual','Las que tienen un contenido sentimental','Las llamadas descriptivas','Las que son basadas en una cultura',0,1,0,0,0,'434','26040',''),(10,'5','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>EL DIENTE ROTO</strong></h3><p><strong><br></strong></p><p>A los doce años, combatiendo Juan Peña con unos granujas, recibió un guijarro sobre un diente; la sangre\r\ncorrió lavándole el sucio de la cara, y el diente se partió en forma de sierra. Desde ese día principia la\r\nedad de oro de Juan Peña.\r\nCon la punta de la lengua, Juan tentaba sin cesar al diente roto; el cuerpo inmóvil, vaga la mirada-sin\r\npensar. Así de alborotador y pendenciero, tornóse en callado y tranquilo. Los padres de Juan, hartos de\r\nescuchar quejas de los vecinos y transeúntes víctimas de las perversidades del chico, y que habían\r\nagotado toda clase de reprimendas y castigos, estaban ahora estupefactos y angustiados con la súbita\r\ntransformación de Juan.\r\nJuan no chistaba y permanecía horas enteras en actitud hierática, como en éxtasis, mientras, allá adentro\r\nen la oscuridad de la boca cerrada, su lengua acariciaba el diente roto-sin pensar. -El niño no está bien,\r\nPablo- decía la madre al marido-; hay que llamar al médico. Llego el doctor grave y panzudo y procedió\r\nal diagnóstico: buen pulso, mofletes sanguíneos, excelente apetito, ningún síntoma de enfermedad.\r\n-Señora- terminó por decir el sabio después de un largo examen-, la santidad de mi profesión me impone\r\ndeclarar a usted…\r\n-¿Qué, señor doctor de mi alma?- interrumpió la angustiada madre.\r\n-Que su hijo está mejor que una manzana. Lo que sí es indiscutible –continuó con voz misteriosa-, es que\r\nestamos en presencia de un caso fenomenal: Su hijo de usted, mi estimable señora, sufre de lo que hoy\r\nllamamos el mal de pensar; en una palabra, su hijo es un filósofo precoz, un genio tal vez.\r\nEn la oscuridad de la boca, Juan acariciaba su diente roto-sin pensar.\r\nParientes y amigos hicieron eco de la opinión del doctor, acogida con júbilo indecible por los padres de\r\nJuan. Pronto en el pueblo todo, se citó el caso admirable del “niño prodigio” y su fama aumentó como\r\nuna bomba de papel hinchada de humo. Hasta el maestro de escuela, que lo había tenido por la más lerda\r\ncabeza del orbe, se sometió a la opinión general, por aquello de que voz del pueblo es voz del cielo.\r\nQuien más, quien menos, cada cual traía a colación un ejemplo: Demóstenes comía arena, Shakespeare\r\nera un pilluelo desarrapado, Edison, etcétera. Creció Juan Peña en medio de libros abiertos ante sus ojos,\r\npero que no leía, distraído por la tarea de su lengua ocupada en tocar la pequeña sierra del diente roto-sin\r\npensar. Y con su cuerpo, crecía la reputación de hombre juicioso, sabio y “profundo”, y nadie se cansaba\r\nde alabar el talento maravilloso de Juan. En plena juventud, las más hermosas mujeres trataban de\r\nseducir y conquistar aquel espíritu superior entregado a hondas meditaciones, para los demás, pero que\r\nen la oscuridad de su boca tentaba el diente roto-sin pensar.\r\nPasaron meses y años y Juan Peña fue diputado, académico, ministro y estaba a punto de ser coronado\r\npresidente de la república, cuando la apoplejía lo sorprendió acariciándose su diente roto con la punta de\r\nla lengua.\r\nY doblaron las campanas, y fue decretado un riguroso duelo nacional; un orador lloró en una fúnebre\r\noración a nombre de la patria, y cayeron rosas y lágrimas sobre la tumba del grande hombre que no había\r\ntenido tiempo de pensar.&nbsp;</p><p>PEDRO EMILIO COLL\r\n(Venezolano)<br></p>','¿El diente de Juan Peña se partió?','Por la mitad','En tres partes','En forma de sierra','En forma de triángulo','Desde la raíz y le corrió sangre',0,0,1,0,0,' ¿Juan tentaba sin cesar el diente roto?',' Con la punta de la lengua','Con la punta del dedo índice','Con un algodón','Con el labio superior','Con el labio inferior',1,0,0,0,0,'El médico diagnosticó: - Su hijo, mi estimada  Señora, sufre de:','Dolor por un diente roto',' Hemorragia por el diente roto','Hemofilia por la excesiva fluidez de la sangre','Lo que hoy llamamos el mal de pensar ','Tristeza por la pérdida del diente',0,0,0,1,0,'¿Quién era un pilluelo desarrapado?','Demóstenes','Edison','Juan Peña','Pedro Emilio Coll','Shakespeare',0,0,0,0,0,' ¿Quién es el autor del cuento “El diente roto”?','Edison','Pedro Emilio Coll','Demóstenes','Shakespeare','Rafael Pombo',0,1,0,0,0,'560','33600',''),(11,'5','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>EL DIENTE ROTO</