aestro de escuela, que lo había tenido por la más lerda\r\ncabeza del orbe, se sometió a la opinión general, por aquello de que voz del pueblo es voz del cielo.\r\nQuien más, quien menos, cada cual traía a colación un ejemplo: Demóstenes comía arena, Shakespeare\r\nera un pilluelo desarrapado, Edison, etcétera. Creció Juan Peña en medio de libros abiertos ante sus ojos,\r\npero que no leía, distraído por la tarea de su lengua ocupada en tocar la pequeña sierra del diente roto-sin\r\npensar. Y con su cuerpo, crecía la reputación de hombre juicioso, sabio y “profundo”, y nadie se cansaba\r\nde alabar el talento maravilloso de Juan. En plena juventud, las más hermosas mujeres trataban de\r\nseducir y conquistar aquel espíritu superior entregado a hondas meditaciones, para los demás, pero que\r\nen la oscuridad de su boca tentaba el diente roto-sin pensar.\r\nPasaron meses y años y Juan Peña fue diputado, académico, ministro y estaba a punto de ser coronado\r\npresidente de la república, cuando la apoplejía lo sorprendió acariciándose su diente roto con la punta de\r\nla lengua.\r\nY doblaron las campanas, y fue decretado un riguroso duelo nacional; un orador lloró en una fúnebre\r\noración a nombre de la patria, y cayeron rosas y lágrimas sobre la tumba del grande hombre que no había\r\ntenido tiempo de pensar.&nbsp;</p><p>PEDRO EMILIO COLL\r\n(Venezolano)<br></p>','Juan Peña perdió su diente por:','No lavarse los dientes','Una riña',' Comer mucho dulce','No ir al odontólogo','Ser glotón',0,1,0,0,0,' Los padres de Juan ante la súbita transformación estaban:','Alegres','Temerosos','Angustiados','Felices','Hartos',0,0,1,0,0,'El pueblo citó el caso admirable del:','Niño genio','Niño filósofo','Niño precoz','Niño diente roto','Niño prodigio',0,0,0,0,0,'¿Cuál era el cargo al cual iba a ser postulado Juan cuando lo sorprendió la apoplejía?','Ministro','Diputado','Presidente','Académico','Alcalde',0,0,1,0,0,'Para qué no tuvo tiempo Juan:','Para ser escritor','Para ser orador','Para llorar','Para pensar','Para tocarse su diente',0,0,0,1,0,'560','33600',''),(12,'6','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>EL CANAL DE PANAMA</strong></h3><p><strong><br></strong></p><p>Desde la apertura hasta nuestros días el Canal ha visto transitar a más de 700\r\nmil barcos, diversos en tamaño, carga y nacionalidad. Cada nave debe pagar\r\nun peaje calculado con base en el tonelaje neto. El peaje más alto pagado por\r\nembarcación alguna correspondió al Star Princess, que en Octubre de 1990\r\ndebió aportar una suma de US$ 120.439.20; el más bajo, en 1928, fue para\r\nRichard Halliburton, que pagó US$ 0.36, por pasar a nado de un océano a\r\notro. El tránsito promedio del Canal, que tiene una distancia total de 80\r\nkilómetros, toma alrededor de diez horas, tiempo récord obtenido gracias a la\r\nmodernización de diseño básico; el cauce ha sido ensanchado, enderezado y\r\nprofundizado, a la vez que se ha logrado recortar el tiempo de\r\nreacondicionamiento de las esclusas.&nbsp;</p><p>Los barcos que transitan por el Canal son elevados y descendidos 26 metros,\r\nde nivel del mar a nivel del mar, mediante tres juegos de\r\nesclusas. El desplazamiento se realiza a través de agua dulce proveniente de\r\nlos lagos Gatún y Miraflores. Para tal efecto las embarcaciones deben apagar\r\nsus motores o dejarlos en su mínima potencia con el fin de ser conducidos\r\npor una serie de grúas especializadas que se encuentran sobre rieles paralelos,\r\na lado y lado de la embarcación. El proceso, supervisado desde la cabina de\r\nmando de la nave, debe ser realizado estrictamente por personal perteneciente\r\nal Canal.&nbsp;</p><p>El paso por el corte Gaillard es tal vez la parte más interesante del viaje. Este\r\ntramo de 14.5 kilómetros de largo, excavado en su mayor parte\r\nen roca sólida, da al canal la impresión de ser una inmensa zanja. En este punto\r\nse observa el Cerro de Oro, el promontorio más alto de todo el canal (200\r\nmetros sobre el nivel del mar). El movimiento de las nave se realiza\r\ncombinando las direcciones horizontal y vertical, bajando o subiendo al pasar\r\nde esclusa en esclusa, atravesando un maravilloso puente acuático rodeado\r\nde selva tropical, mudo testigo del progreso del hombre.&nbsp;</p><p>Tomado de la revista: EL MUNDO AL VUELO<br></p>','El peaje más alto pagado por alguna  embarcación correspondió a:','Titanic','Buque Gloria','Star Princess','Queen Elizabeth','Alcatraz',0,0,1,0,0,'El Canal de Panamá tiene una distancia total  de:','180 kilómetros','60 kilómetros','90 kilómetros','80 kilómetros','128 kilómetros',0,0,0,1,0,'El desplazamiento se realiza a través de agua  dulce proveniente de los lagos:','Gatún y Miraflores','Titicaca y Lago Blanco','Erie y Ontario','San Martín y Lago Fontana','Villarica y Colica',1,0,0,0,0,'El promontorio más alto de todo el Canal de  Panamá es:','Cerro de Monserrate','Cerro Colorado','Cerro de Oro','Cerro de Pacandé','Cerro de Pan de Azúcar',0,0,1,0,0,'El paso por el Corte Guillard es la parte más  interesante del viaje y mide un total de:','15 kilómetros','14.5 kilómetros','8 kilómetros','120 kilómetros','6.9 kilómetros',0,1,0,0,0,'345','20700',''),(13,'6','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>EL CANAL DE PANAMA</strong></h3><p><strong><br></strong></p><p>Desde la apertura hasta nuestros días el Canal ha visto transitar a más de 700\r\nmil barcos, diversos en tamaño, carga y nacionalidad. Cada nave debe pagar\r\nun peaje calculado con base en el tonelaje neto. El peaje más alto pagado por\r\nembarcación alguna correspondió al Star Princess, que en Octubre de 1990\r\ndebió aportar una suma de US$ 120.439.20; el más bajo, en 1928, fue para\r\nRichard Halliburton, que pagó US$ 0.36, por pasar a nado de un océano a\r\notro. El tránsito promedio del Canal, que tiene una distancia total de 80\r\nkilómetros, toma alrededor de diez horas, tiempo récord obtenido gracias a la\r\nmodernización de diseño básico; el cauce ha sido ensanchado, enderezado y\r\nprofundizado, a la vez que se ha logrado recortar el tiempo de\r\nreacondicionamiento de las esclusas.&nbsp;</p><p>Los barcos que transitan por el Canal son elevados y descendidos 26 metros,\r\nde nivel del mar a nivel del mar, mediante tres juegos de\r\nesclusas. El desplazamiento se realiza a través de agua dulce proveniente de\r\nlos lagos Gatún y Miraflores. Para tal efecto las embarcaciones deben apagar\r\nsus motores o dejarlos en su mínima potencia con el fin de ser conducidos\r\npor una serie de grúas especializadas que se encuentran sobre rieles paralelos,\r\na lado y lado de la embarcación. El proceso, supervisado desde la cabina de\r\nmando de la nave, debe ser realizado estrictamente por personal perteneciente\r\nal Canal.&nbsp;</p><p>El paso por el corte Gaillard es tal vez la parte más interesante del viaje. Este\r\ntramo de 14.5 kilómetros de largo, excavado en su mayor parte\r\nen roca sólida, da al canal la impresión de ser una inmensa zanja. En este punto\r\nse observa el Cerro de Oro, el promontorio más alto de todo el canal (200\r\nmetros sobre el nivel del mar). El movimiento de las nave se realiza\r\ncombinando las direcciones horizontal y vertical, bajando o subiendo al pasar\r\nde esclusa en esclusa, atravesando un maravilloso puente acuático rodeado\r\nde selva tropical, mudo testigo del progreso del hombre.&nbsp;</p><p>Tomado de la revista: EL MUNDO AL VUELO<br></p>','Cuál fue el peaje más alto pagado por una embarcación:','US$ 100.459.20','US$ 120.439.20','US$ 120.429.20','US$ 110.439.20','US$ 120.359.10',0,1,0,0,0,'Los barcos que transitan por el Canal son elevados y descendidos a:','18 metros del nivel del mar a nivel del mar','10 metros del nivel del mar a nivel del mar','26 metros del nivel del mar a nivel del mar','16 metros del nivel del mar a nivel del mar','20 metros del nivel del mar a nivel del mar',0,0,1,0,0,'El tránsito por el Canal de Panamá toma alrededor de:','5 horas','12 horas','7 horas','8 horas','10 horas',0,0,0,0,0,'Fecha en que se pagó el peaje más bajo por transitar el Canal:','1992','1982','1990','1928','1918',0,0,0,1,0,'El promontorio más alto de todo el canal se encuentra a:','120 metros sobre el nivel del mar','200 metros sobre el nivel del mar','210 metros sobre el nivel del mar','180 metros sobre el nivel del mar','160 metros sobre el nivel del mar',0,1,0,0,0,'345','20700',''),(14,'7','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>EL AGUA</strong></h3><p><strong><br></strong></p><p>Desde el punto de vista químico, el agua es la combinación de dos átomos de Hidrógeno y uno\r\nde Oxígeno (H2O) y se define como un elemento inodoro, incoloro e insípido. Y así es como se\r\nencuentra en estado puro. Pero este estado sólo se encuentra en el laboratorio y además se trata\r\nentonces de un elemento tóxico. El agua, tal como el hombre la conoce, es el resultado de la\r\nsuma de diversos elementos a la fórmula básica de la probeta. Dichos elementos proceden de las\r\npartículas que se le agregan –dada su propiedad de gran disolvente- desde el momento en que se\r\nevapora y se almacena en la biosfera para caer luego en forma de lluvia, pasar por diferentes\r\nsuelos y depositarse en el lecho correspondiente (río, mar, lago, embalse, manto acuífero). Así,\r\ntodas las aguas son diferentes, si bien se agrupan en dos calidades diferentes. Las llamadas aguas\r\nduras, que contienen gran cantidad de sales, y las denominadas aguas blandas, cuando su\r\nproporción de carbonatos es menor.&nbsp;</p><p>Por otra parte, el agua tiene una gran capacidad térmica, es decir conserva muy bien el calor, lo\r\ncual contribuye a reducir las diferencias de temperatura en diversos lugares.&nbsp;</p><p>Además, su elevada tensión superficial facilita el fenómeno de la capilaridad, por el que las\r\nplantas absorben humedad y sales del suelo.&nbsp;</p><p>Por último, cabe mencionar que el cuerpo de los seres vivos está formado en su mayor proporción de agua, y, por ejemplo este elemento en el hombre constituye el 70 por ciento de su organismo.&nbsp;</p><p>El volumen de agua en la tierra es constante, si bien varía su localización. Se ha estimado que el\r\nagua contenida en la atmósfera no supera el 0.001 por ciento del total de planeta que asciende a\r\n1.337 millones de kilómetros cúbicos. Estos se encuentran repartidos en océanos, hielos\r\ncontinentales, valles glaciares, aguas subterráneas, ríos y lagos.&nbsp;</p><p>Tomado de la enciclopedia OCÉANO COLOR – TOMO 5<br></p>','El agua está compuesta por:','2 átomos de Oxígeno y 1 átomo de Hidrógeno','2 átomos de Hidrógeno y 1 átomo de Oxígeno','1 átomo de Nitrógeno y 1 átomo de Oxígeno','2 átomos de Oxígeno y 1 átomo de Nitrógeno.','2 átomos de Hidrógeno y 2 átomos de Oxígeno',0,1,0,0,0,'El agua es un elemento:',' Inodoro, incoloro e insípido.','Incoloro e insípido.','Insípido e inodoro','Inodoro e incoloro.','Insoluble, incoloro e inodoro',1,0,0,0,0,'Cuando el agua se evapora, se almacena en:','La atmósfera.','La estratosfera.','La biosfera.','El suelo.','El subsuelo',0,0,1,0,1,'Si bien todas las aguas son diferentes, se  agrupan en dos calidades:','Aguas duras y aguas blandas.','Aguas carbonadas y aguas saladas.','Aguas puras y aguas tóxicas.','Aguas térmicas y aguas lluvias.','Aguas duras y aguas térmicas',1,0,0,0,0,'En el hombre su organismo contiene:','60 por ciento de agua','50 por ciento de agua.','80 por ciento de agua.','30 por ciento de agua.','70 por ciento de agua.',0,0,0,0,0,'315','18900',''),(15,'7','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>EL AGUA</strong></h3><p><strong><br></strong></p><p>Desde el punto de vista químico, el agua es la combinación de dos átomos de Hidrógeno y uno\r\nde Oxígeno (H2O) y se define como un elemento inodoro, incoloro e insípido. Y así es como se\r\nencuentra en estado puro. Pero este estado sólo se encuentra en el laboratorio y además se trata\r\nentonces de un elemento tóxico. El agua, tal como el hombre la conoce, es el resultado de la\r\nsuma de diversos elementos a la fórmula básica de la probeta. Dichos elementos proceden de las\r\npartículas que se le agregan –dada su propiedad de gran disolvente- desde el momento en que se\r\nevapora y se almacena en la biosfera para caer luego en forma de lluvia, pasar por diferentes\r\nsuelos y depositarse en el lecho correspondiente (río, mar, lago, embalse, manto acuífero). Así,\r\ntodas las aguas son diferentes, si bien se agrupan en dos calidades diferentes. Las llamadas aguas\r\nduras, que contienen gran cantidad de sales, y las denominadas aguas blandas, cuando su\r\nproporción de carbonatos es menor.&nbsp;</p><p>Por otra parte, el agua tiene una gran capacidad térmica, es decir conserva muy bien el calor, lo\r\ncual contribuye a reducir las diferencias de temperatura en diversos lugares.&nbsp;</p><p>Además, su elevada tensión superficial facilita el fenómeno de la capilaridad, por el que las\r\nplantas absorben humedad y sales del suelo.&nbsp;</p><p>Por último, cabe mencionar que el cuerpo de los seres vivos está formado en su mayor proporción de agua, y, por ejemplo este elemento en el hombre constituye el 70 por ciento de su organismo.&nbsp;</p><p>El volumen de agua en la tierra es constante, si bien varía su localización. Se ha estimado que el\r\nagua contenida en la atmósfera no supera el 0.001 por ciento del total de planeta que asciende a\r\n1.337 millones de kilómetros cúbicos. Estos se encuentran repartidos en océanos, hielos\r\ncontinentales, valles glaciares, aguas subterráneas, ríos y lagos.&nbsp;</p><p>Tomado de la enciclopedia OCÉANO COLOR – TOMO 5<br></p>','Se denominan como aguas duras a las que:','Tienen menor cantidad de carbonatos','Tienen menos cantidad de oxígeno.','Tienen mayor cantidad de sales.','Tienen mayor cantidad de hidrógeno','Tienen mayor capacidad térmica.',0,0,1,0,0,'Cantidad de agua contenida en el planeta:','1.337 Millones de Kilómetros cúbicos','1.225 Millones de Kilómetros cúbicos.','1.237 Millones de Kilómetros cúbicos','1.137 Millones de Kilómetros cúbicos.','1.333 Millones de Kilómetros cúbicos',1,0,0,0,0,'El volumen de agua en la tierra es:','Proporcional','Equivalente','Variable','Constante','Paralelo',0,0,0,1,0,'Fenómeno por el cuál las plantas absorben  humedad y sales del suelo:','Fotosíntesis','Clorofila','Hidratación','Capilaridad','Infusión',0,0,0,1,0,'Propiedad del agua que permite convertirla de  elemento tóxico a elemento beneficioso:','Térmica','Incoloro','Tórrida','Disolvente','Diluyente',0,0,0,1,0,'315','18900',''),(16,'8','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>TENIS</strong></h3><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><span style=\"letter-spacing: 0.2px;\">Tal como se conoce en la actualidad, el tenis comenzó a practicarse en Gran Bretaña hacia 1.873,\r\ncon unas reglas establecidas por el comandante Wingfield, que después de potenciar el deporte\r\nen la India lo impulsó en su propio país. En 1.875 asumió el nombre de Lawn-tennis.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">El tenis consiste en impulsar una pelota golpeándola con una raqueta y hacerla pasar por encima\r\nde una red procurando que no rebase las líneas que delimitan la pista y naturalmente procurando\r\ndesorientar al adversario, impidiéndole que pueda devolverla o que la devuelva mal cometiendo\r\nfalta.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">La pista es un rectángulo completamente alisado, de 23.79 m. de longitud por 8.23 m. de anchura. En el centro de los lados mayores una red lo divide en dos mitades, cada una de las cuales es\r\nel ámbito de un jugador o de dos (partidos de dobles o parejas). La red está suspendida sobre el\r\nsuelo, separada de éste por 9.15 cm. de distancia y tensada por dos postes de 1.06 m. colocados\r\na 9.15 cm. de la línea lateral de la pista. El espacio entre la línea individual y la de dobles se\r\ndenomina pasillo.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">La pelota es de caucho recubierto de tela gruesa afelpada con un diámetro de 6.35-6.67 cm. y un\r\npeso de 56.70 gramos. La raqueta consiste en un arco ovalado con una rejilla de cordón de fibra\r\ndura tensada longitudinal y horizontalmente, componiendo una cuadricula que golpea la pelota.\r\nEn una de sus bases arranca un mango con un tramo final específico o empuñadura.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">El lanzamiento de un jugador es respondido por el contrario después de que la pelota rebote una\r\nsola vez en su campo o bien si esperar a ello, con un golpe llamado volea. Cuando la devolución\r\ntropieza en la red o rebasa las líneas del campo adversario, se comete una falta, y si toca la línea\r\nse considera buena.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">Cada juego se denomina set y finaliza cuando uno de los jugadores ha cometido seis faltas, salvo\r\nsi están empatados a 5, pues entonces el set se prolonga hasta siete faltas. Normalmente los partidos se componen de tres o cinco sets y los gana quien logre ganar, dos de tres o tres de cinco sets.\r\nTipos de golpes conocidos son: el drive, dado con la raqueta agarrada con la mano vuelta con la\r\npalma hacia arriba; el revés, dado desplazando la raqueta al lado contrario del brazo que golpea,\r\ny el smash, dado con la raqueta en vertical y picando hacia abajo.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">Tomado de ENCICLOPEDIA “OCÉANO COLOR TOMO VI\"</span><br></p>','El tenis como se conoce en la actualidad,  comenzó a practicarse en:','Gran Bretaña en 1873.','España en 1876.','Irlanda en 1958.','Japón en 1945.','Estados Unidos en 1837',1,0,0,0,0,'La pista es un rectángulo de las  siguientes dimensiones:','25.98 m por 9.76 m.','17.98 m por 9.23 m.','23.79 m por 8.23 m','24.70 m por 6.23 m.','16.67 m por 6.86 m.',0,0,1,0,0,'El espacio entre la línea de individual  y la de dobles se denomina:','Ámbito de jugador.','Pasillo','Empuñadura','Poste.','Línea lateral.',0,1,0,0,0,'Cada partido se compone de:','Dos sets.','Cuatro sets.','Dos y seis sets.','Uno y tres sets.','Tres o cinco sets.',0,0,0,0,0,'Tipos de golpe conocidos son:','Drive, lawn-tennis y sets.','Smash y drive','Drive, smash y revés.','Revés y falta','Revé, smash y out.',0,0,1,0,0,'417','25020',''),(17,'8','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>TENIS</strong></h3><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><span style=\"letter-spacing: 0.2px;\">Tal como se conoce en la actualidad, el tenis comenzó a practicarse en Gran Bretaña hacia 1.873,\r\ncon unas reglas establecidas por el comandante Wingfield, que después de potenciar el deporte\r\nen la India lo impulsó en su propio país. En 1.875 asumió el nombre de Lawn-tennis.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">El tenis consiste en impulsar una pelota golpeándola con una raqueta y hacerla pasar por encima\r\nde una red procurando que no rebase las líneas que delimitan la pista y naturalmente procurando\r\ndesorientar al adversario, impidiéndole que pueda devolverla o que la devuelva mal cometiendo\r\nfalta.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">La pista es un rectángulo completamente alisado, de 23.79 m. de longitud por 8.23 m. de anchura. En el centro de los lados mayores una red lo divide en dos mitades, cada una de las cuales es\r\nel ámbito de un jugador o de dos (partidos de dobles o parejas). La red está suspendida sobre el\r\nsuelo, separada de éste por 9.15 cm. de distancia y tensada por dos postes de 1.06 m. colocados\r\na 9.15 cm. de la línea lateral de la pista. El espacio entre la línea individual y la de dobles se\r\ndenomina pasillo.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">La pelota es de caucho recubierto de tela gruesa afelpada con un diámetro de 6.35-6.67 cm. y un\r\npeso de 56.70 gramos. La raqueta consiste en un arco ovalado con una rejilla de cordón de fibra\r\ndura tensada longitudinal y horizontalmente, componiendo una cuadricula que golpea la pelota.\r\nEn una de sus bases arranca un mango con un tramo final específico o empuñadura.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">El lanzamiento de un jugador es respondido por el contrario después de que la pelota rebote una\r\nsola vez en su campo o bien si esperar a ello, con un golpe llamado volea. Cuando la devolución\r\ntropieza en la red o rebasa las líneas del campo adversario, se comete una falta, y si toca la línea\r\nse considera buena.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">Cada juego se denomina set y finaliza cuando uno de los jugadores ha cometido seis faltas, salvo\r\nsi están empatados a 5, pues entonces el set se prolonga hasta siete faltas. Normalmente los partidos se componen de tres o cinco sets y los gana quien logre ganar, dos de tres o tres de cinco sets.\r\nTipos de golpes conocidos son: el drive, dado con la raqueta agarrada con la mano vuelta con la\r\npalma hacia arriba; el revés, dado desplazando la raqueta al lado contrario del brazo que golpea,\r\ny el smash, dado con la raqueta en vertical y picando hacia abajo.&nbsp;</span></p><p><span style=\"letter-spacing: 0.2px;\">Tomado de ENCICLOPEDIA “OCÉANO COLOR TOMO VI\"</span><br></p>','Nombre que se le dio al tenis en 1.875:','Wing-tennis.','Tennis de mesa.','Lawn-tennis.','Tennis de cancha.','Tennis de malla.',0,0,1,0,0,'La medida de los postes de la red es de:','9.15 cm.','6.05 cm.','6.07 cm.','1.05 m.','1.06 m.',0,0,0,0,1,'El peso de la pelota es de:','56.70 gramos','50.76 gramos','56.76 gramos','50.70 gramos','55.76 gramos',1,0,0,0,0,'Nombre que se le da a cada juego:','Drive','Golpe','Smash','Set','Saque',0,0,0,1,0,'Lo normal es que el juego termine cuando el  jugador ha cometido:','Cinco faltas','Siete faltas','Seis faltas','Cuatro faltas','Dos faltas',0,0,1,0,0,'417','25020',''),(18,'9','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LAS AMAZONAS: ¿HISTORIA O LEYENDA?</strong></h3><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>El 24 de Junio de 1.542, el misionero dominico Gaspar de Carvajal, que tuvo contacto con ellas en la\r\nactual Amazonía, que no se llamaba aun así, escribió: “… Estas mujeres son muy altas y muy blancas,\r\nllevan los cabellos largos y enrollados sobre la cabeza, y van casi desnudas. Con su arco y su flecha combate cada una como diez indios”. El padre Carvajal pertenecía a la Expedición de Francisco de Orellana.\r\nAgotados, los cincuenta aventureros se detuvieron en un poblado indio cuyo jefe los puso en guardia.\r\nDebían volver porque si continuaban se las tendrían que ver con las mujeres que reinaban en el territorio\r\nmás allá del gran río, con las que los guerreros más bravos no podían medirse. Los españoles hicieron\r\ncaso omiso y se adentraron hacia “el país del oro”. De repente empezaron a llover flechas, a las cuales\r\nlos expedicionarios contestaron con sus arcabuces. Pronto dominaron un poblado desierto, y al cabo de\r\nunos minutos, ante los ojos de los recién llegados aparecieron diez guerreras como las descritas. “Estas\r\nmedio diosas parecían inmortales -comenta el misionero en su escrito-. No toleraban ningún indio en sus\r\ncabañas, ni niños. Admitían a los de su raza nada más para procrear cuando llegaba una luna propicia.\r\nCarvajal sobrevivió y juró, a su regreso a España, que lo que decía en sus escritos era rigurosamente\r\ncierto. Fueron estas amazonas las que dieron el nombre al Río Amazonas y a la Amazonía. El griego\r\nDiodoro dio a las mujeres guerreras de su pueblo el nombre de amazos (privado del seno). Tal denominación, proviene de que cuando las mujeres guerreras daban a luz una hija le quemaban un seno para “desarrollar toda su fuerza con el brazo derecho y no tener un seno como estorbo” (Hipócrates). A los hijos\r\nvarones los rechazaban como no aptos para los combates. Los entregaban a sus padres como inútiles. En\r\n1506, un misionero de Etiopía describió una provincia “donde las mujeres, mucho más audaces que los\r\nhombres del país, van siempre armadas para la caza y para la guerra”. En Monomotapa (hoy Rodesia) un\r\nexplorador repetía la misma observación: “entre las tropas, el nervio de la fuerza armada del rey lo constituyen las legiones de mujeres”. A imagen de las guerreras de la Grecia Antigua en tiempos de Hipócrito, quemaban el seno derecho de las recién nacidas para poder apuntar mejor sus armas.&nbsp;</p><p>TOMADO DE: Revista Diners No. 295. No. XXX, Paul de Garat<br></p>','El misionero dominico Gaspar de Carvajal  tuvo contacto con las amazonas y escribió  sobre ellas el:','30 de Agosto de 1.642','20 de Mayo de 1.512','12 de Octubre de 1.492','24 de Junio de 1.542','17 de Febrero de 1.859',0,0,0,1,0,'El Padre Carvajal pertenecía a:','La Expedición Botánica','La Expedición del Sur','La Expedición de Francisco de Orellana','La Expedición de Mutis','La Expedición del Baron Humbolt',0,0,1,0,0,'Las Amazonas, dieron el nombre al río:','Atrato','Putumayo','Magdalena','Támesis','Amazonas',0,0,0,0,0,'Un misionero de Etiopía, describió una  provincia de amazonas en:','1.516','1.506','1.417','1.400','1.586',0,1,0,0,0,'El antiguo Monomotapa es hoy día el mismo:','Rodesia','Ceilán','Sri Lanka','India','Grecia',1,0,0,0,0,'403','24180',''),(19,'9','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>LAS AMAZONAS: ¿HISTORIA O LEYENDA?</strong></h3><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>El 24 de Junio de 1.542, el misionero dominico Gaspar de Carvajal, que tuvo contacto con ellas en la\r\nactual Amazonía, que no se llamaba aun así, escribió: “… Estas mujeres son muy altas y muy blancas,\r\nllevan los cabellos largos y enrollados sobre la cabeza, y van casi desnudas. Con su arco y su flecha combate cada una como diez indios”. El padre Carvajal pertenecía a la Expedición de Francisco de Orellana.\r\nAgotados, los cincuenta aventure