de Garat<br></p>','Nombre antiguo que se dio a la Amazonía:','Poblado del oro','Región del oro','Ciudad del oro','País del oro','Nación del oro',0,0,0,1,0,'El griego Diodoro dio a las mujeres guerreras  de su pueblo el nombre de:','Amazonas','Guerreras de luz','Amazos','Diosas','Guerreras de la luna',0,0,1,0,0,'Número de aventureros que acompañaban  la expedición de Francisco de Orellana:','Sesenta','Treinta','Setenta','Cuarenta','Cincuenta',0,0,0,0,0,'Las guerreras admitían a los indios  para procrear en:','Luna nueva','Luna llena','Luna propicia','Luna menguante','Luna creciente',0,0,1,0,0,'Cuando las guerreras daban a luz un  hijo varón lo:','Quemaban en la aldea','Botaban al río','Entregaban a sus padres','Mataban con arco y flecha','Sacrificaban para los dioses',0,0,1,0,0,'403','24180',''),(20,'10','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LOS COLOMBIANOS LEEN\r\n2,4 LIBROS AL AÑO</strong></h3><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>Este es uno de los peores promedios de lectura en América Latina. La alarmante cifra pertenece a la Encuesta Nacional de Hábitos de Lectura que se dio a conocer en la antesala de la 14\r\nFeria Internacional del Libro de Bogotá, realizada del 25 de abril al 7 de mayo del 2001.&nbsp;</p><p>La noticia es más desalentadora si se tiene en cuenta que, según datos de un estudio hecho por\r\nFundalectura en 1992, en nuestro país cada persona leía 3,48 libros al año.&nbsp;</p><p>En naciones de condiciones más o menos similares a las nuestras, como Argentina, el promedio es de 14 libros anuales por persona. En Europa, en regiones de alto desarrollo como Alemania, se leen entre 30 y 35 libros.</p><p>Este es el estudio de lectura más ambicioso que se ha hecho en Colombia y está incluido, por\r\nprimera vez, en la Encuesta Nacional de Hogares, que hace periódicamente el Departamento\r\nAdministrativo Nacional de Estadística (DANE).&nbsp;</p><p>El trabajo se realizó en 20.000 hogares de Bogotá, Cali, Medellín, Barranquilla, Bucaramanga,\r\nManizales, Pasto, Pereira, Ibagué, Cúcuta y Montería, entre personas en edad de trabajar, de 12\r\naños en adelante.&nbsp;</p><p>La encuesta se diseñó en abril de 2000 y se aplicó en junio del mismo año. Se combinaron\r\nesfuerzos del DANE, el Ministerio de Educación, de Cultura, Fundalectura, la Cámara Colombiana del Libro y el Centro Regional para el Fomento del Libro en América Latina y el Caribe.&nbsp;</p><p>El 45 por ciento de los lectores lo hacen por gusto y entretenimiento; el 37 por ciento lee por\r\nestudio; el 25 por ciento por desarrollo personal; el 22 por ciento, por cultura general; el 10 por\r\nciento por trabajo y el 4 por ciento por otros intereses.&nbsp;</p><p>Los colombianos que no leen libros lo hacen por falta de hábito e interés, en un 40.1 por\r\nciento; el 22.6 por ciento dice que no tiene tiempo; el 16.7 por ciento alega falta de dinero; el\r\n6.3 por ciento afirma que no lee por falta de empleo; el 3.5 por ciento prefiere los periódicos;\r\nel 2.7 por ciento, las revistas; el 1.3 por ciento escoge Internet y el 5,1 por ciento tiene otras\r\npreferencias.&nbsp;</p><p>Entre los hogares encuestados, el 61.8 por ciento tiene menos de 25 libros y el 9.2 por ciento\r\nno tiene ninguno.<br></p>','Promedio de libros que leía un colombiano por  año según encuesta realizada en 1992 por  Fundalectura:','2.45','3.48','5.21','4.28','3.45',0,1,0,0,0,'Entre 30 y 35 libros al año por persona se leen  en:','Argentina','Colombia','Alemania','España','Inglaterra',0,0,1,0,0,'Fecha en que se aplicó la encuesta Nacional de  Hábitos de Lectura:','Abril de 2000 y Mayo de 2000.','Junio de 2000 y Julio de 2000.','Abril de 2001 y Mayo de 2001','Junio de 2001 y Julio de 2001','Mayo de 2000 y Junio de 2000',0,0,1,0,0,'Los colombianos leen 2.4 libros al año, según  encuesta realizada por:','Departamento Administrativo Nacional de  Estadística.','Cámara Colombiana del Libro.','Centro Regional para el Fomento del Libro.','Encuesta Nacional de Hábitos de Lectura.','Encuesta Nacional de Hogares.',0,0,0,1,0,'Un 3.5 % de los colombianos no leen libros porque:','No tienen tiempo.','Falta de dinero','Prefieren leer periódicos','Prefieren leer revistas.','Escogen Internet.',0,0,1,0,0,'387','23280',''),(21,'10','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>LOS COLOMBIANOS LEEN\r\n2,4 LIBROS AL AÑO</strong></h3><p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>Este es uno de los peores promedios de lectura en América Latina. La alarmante cifra pertenece a la Encuesta Nacional de Hábitos de Lectura que se dio a conocer en la antesala de la 14\r\nFeria Internacional del Libro de Bogotá, realizada del 25 de abril al 7 de mayo del 2001.&nbsp;</p><p>La noticia es más desalentadora si se tiene en cuenta que, según datos de un estudio hecho por\r\nFundalectura en 1992, en nuestro país cada persona leía 3,48 libros al año.&nbsp;</p><p>En naciones de condiciones más o menos similares a las nuestras, como Argentina, el promedio es de 14 libros anuales por persona. En Europa, en regiones de alto desarrollo como Alemania, se leen entre 30 y 35 libros.</p><p>Este es el estudio de lectura más ambicioso que se ha hecho en Colombia y está incluido, por\r\nprimera vez, en la Encuesta Nacional de Hogares, que hace periódicamente el Departamento\r\nAdministrativo Nacional de Estadística (DANE).&nbsp;</p><p>El trabajo se realizó en 20.000 hogares de Bogotá, Cali, Medellín, Barranquilla, Bucaramanga,\r\nManizales, Pasto, Pereira, Ibagué, Cúcuta y Montería, entre personas en edad de trabajar, de 12\r\naños en adelante.&nbsp;</p><p>La encuesta se diseñó en abril de 2000 y se aplicó en junio del mismo año. Se combinaron\r\nesfuerzos del DANE, el Ministerio de Educación, de Cultura, Fundalectura, la Cámara Colombiana del Libro y el Centro Regional para el Fomento del Libro en América Latina y el Caribe.&nbsp;</p><p>El 45 por ciento de los lectores lo hacen por gusto y entretenimiento; el 37 