 foot of the Cristo Redentor,</span> <br>\r\nen plena cordillera<br>\r\n<span style=\"color:#b86125; text-align:center;\">right in the Range</span> <br>\r\nde los Andes, sobre la ladera Argentina y cerca del<br>\r\n<span style=\"color:#b86125; text-align:center;\">of the Andes, on the Argentine slope and near the</span> <br>\r\nlímite con Chile<br>\r\n<span style=\"color:#b86125; text-align:center;\">Chilean border.</span> <br><br>Llevaban palas, picos, escalas, sogas y<br>\r\n<span style=\"color:#b86125; text-align:center;\">They carried spades, picks, ladders, ropes and</span> <br>\r\ntodo el equipo requerido para<br>\r\n<span style=\"color:#b86125; text-align:center;\">all the necessary equipment to</span> <br>\r\nser un buen alpinista.<br>\r\n<span style=\"color:#b86125; text-align:center;\">be good muntaineers.</span> <br><br>Pero no había guía que les<br>\r\n<span style=\"color:#b86125; text-align:center;\">But there was no guide</span> <br>\r\nseñalara el camino…<br>\r\n<span style=\"color:#b86125; text-align:center;\">to show them the way…</span> <br><br>&nbsp;De todos modos, comenzeron a<br>\r\n<span style=\"color:#b86125; text-align:center;\">Anyway, they started</span> <br>\r\nsubir por una peligrosa pared,<br>\r\n<span style=\"color:#b86125; text-align:center;\">climbing up a dangerous rock face,</span> <br>\r\nsosteniéndose con picos<br>\r\n<span style=\"color:#b86125; text-align:center;\">holding on to the picks</span> <br>\r\ny atándose con las sogas,<br>\r\n<span style=\"color:#b86125; text-align:center;\">and fastening the ropes round their waists</span> <br>\r\npara no caer.<br>\r\n<span style=\"color:#b86125; text-align:center;\">not to fall down.</span> <br><br>&nbsp;Entonces se inició la terrible<br>\r\n<span style=\"color:#b86125; text-align:center;\">Then the terrible</span> <br>\r\ntormenta de nieve.<br>\r\n<span style=\"color:#b86125; text-align:center;\">snowstorm broke out.</span> <br><br>&nbsp;- ¡Descanseeeemos…!<br>\r\n<span style=\"colo