>But there was no guide</span> <br>\r\nseñalara el camino…<br>\r\n<span style=\"color:#b86125; text-align:center;\">to show them the way…</span> <br><br>&nbsp;De todos modos, comenzeron a<br>\r\n<span style=\"color:#b86125; text-align:center;\">Anyway, they started</span> <br>\r\nsubir por una peligrosa pared,<br>\r\n<span style=\"color:#b86125; text-align:center;\">climbing up a dangerous rock face,</span> <br>\r\nsosteniéndose con picos<br>\r\n<span style=\"color:#b86125; text-align:center;\">holding on to the picks</span> <br>\r\ny atándose con las sogas,<br>\r\n<span style=\"color:#b86125; text-align:center;\">and fastening the ropes round their waists</span> <br>\r\npara no caer.<br>\r\n<span style=\"color:#b86125; text-align:center;\">not to fall down.</span> <br><br>&nbsp;Entonces se inició la terrible<br>\r\n<span style=\"color:#b86125; text-align:center;\">Then the terrible</span> <br>\r\ntormenta de nieve.<br>\r\n<span style=\"color:#b86125; text-align:center;\">snowstorm broke out.</span> <br><br>&nbsp;- ¡Descanseeeemos…!<br>\r\n<span style=\"color:#b86125; text-align:center;\">- Let us take a rest…!</span> <br>\r\n¡Un ratito solamente…!<br>\r\n<span style=\"color:#b86125; text-align:center;\">Just for a little while…!</span> <br>\r\nrogó “Victor el Escalador”, que tenía un<br>\r\n<span style=\"color:#b86125; text-align:center;\">begged “Victor el Escalador”, who was</span> <br>\r\nsueño terrible.<br>\r\n<span style=\"color:#b86125; text-align:center;\">terribly sleepy.</span> <br><br>&nbsp;Y los demás le hicieron caso:<br>\r\n<span style=\"color:#b86125; text-align:center;\">And the others did as he said:</span> <br>\r\nignoraban que el sueño de la<br>\r\n<span style=\"color:#b86125; text-align:center;\">they didn’t know that to sleep on the</span> <br>\r\nnieve es fatal… Horas más<br>\r\n<span style=\"color:#b86125; text-align:center;\">snow is fatal… A few hours</span> <br>\r\n	</td>\r\n	<td>\r\n		\r\n		tarde, cubiertos por un colchón<br>\r\n<span style=\"color:#b86125; text-align:center;\">later, covered with a blanket</span> <br>\r\nde nieve, todos estaban<br>\r\n<span style=\"color:#b86125; text-align:center;\">of snow, they all lay</span> <br>\r\ninmóviles, casi a punto de<br>\r\n<span style=\"color:#b86125; text-align:center;\">motionless, nearly about to</span> <br>\r\ncongelarse<br>\r\n<span style=\"color:#b86125; text-align:center;\">become frozen.</span> <br><br>&nbsp;- ¡Hunch! ¡Hunch! ¡Hunch!<br>\r\n<span style=\"color:#b86125; text-align:center;\">- Pant! Pant!</span> <br>\r\nvenía diciendo el perro Bunker,<br>\r\n<span style=\"color:#b86125; text-align:center;\">was saying Bunker the dog,</span> <br>\r\nmientras ascendía la<br>\r\n<span style=\"color:#b86125; text-align:center;\">as he went up the</span> <br>\r\nmontaña con gran destreza,<br>\r\n<span style=\"color:#b86125; text-align:center;\">mountain with great skill</span> <br>\r\nhasta que llegó y… - Guaug! Guaug! Guaug!<br>\r\n<span style=\"color:#b86125; text-align:center;\">until he arrived and… - Bark! Bark! Bark!</span> <br>\r\nTaquito entreabrió apenas los ojos y exclamó, desfalleciente:<br>\r\n<span style=\"color:#b86125; text-align:center;\">Taquito half-opened his eyes and exclaimed faintly:</span> <br>\r\n- ¡Bunker! ¡Mi Viejo y querido Bunker…!<br>\r\n<span style=\"color:#b86125; text-align:center;\">- Bunker dear old Bunker!</span> <br><br>El fiel animal enviado por Tony Chaleco como única<br>\r\n<span style=\"color:#b86125; text-align:center;\">The faithful animal, sent over by Tony Chaleco as his only</span> <br>\r\ncondición para autorizar la aventura,<br>\r\n<span style=\"color:#b86125; text-align:center;\">condition to allow the undertaking,</span> <br>\r\nllevaba el clásico barrilito<br>\r\n<span style=\"color:#b86125; text-align:center;\">carried the traditional keg</span> <br>\r\nde coñac colgado<br>\r\n<span style=\"color:#b86125; text-align:center;\">of brandy hanging</span> <br>\r\ndel cuello y, al<br>\r\n<span style=\"color:#b86125; text-align:center;\">from his neck and in</span> <br>\r\ninstante, todos<br>\r\n<span style=\"color:#b86125; text-align:center;\">no time, they all</span> <br>\r\nestaban<br>\r\n<span style=\"color:#b86125; text-align:center;\">were</span> <br>\r\nreconfortándose<br>\r\n<span style=\"color:#b86125; text-align:center;\">fortifying themselves</span> <br>\r\ncon aquella<br>\r\n<span style=\"color:#b86125; text-align:center;\">with the</span> <br>\r\nbebida: el perro<br>\r\n<span style=\"color:#b86125; text-align:center;\">drink: the Boxer</span> <br>\r\nBóxer les<br>\r\n<span style=\"color:#b86125; text-align:center;\">dog had</span> <br>\r\nhabía salvado la vida<br>\r\n<span style=\"color:#b86125; text-align:center;\">saved their lives</span> <br>\r\nmilagrosamente.<br>\r\n<span style=\"color:#b86125; text-align:center;\">miraculously.</span> <br>\r\n\r\n	</td>\r\n</tr></tbody></table>','En la narración quién está autorizando la  aventura:','Víctor el Escalador','Bunker','Tony Chaleco','El guía','El narrador',0,0,1,0,0,'Raza del perro que salvó a los excursionistas:','Pastor Alemán','Pastor Colli','San Bernardo','Bóxer','Fila Brasilero',0,0,0,1,0,'Bebida que llevaba el perro dentro del  barrilito:','Vino','Coñac','Whisky','Ron','Ginebra',0,1,0,0,0,'Con qué país limita el Aconcagua:','Brasil','Perú','Argentina','Chile','Uruguay',0,0,0,1,0,'Qué hicieron los excursionistas para  reconfortarse:','Se calentaron con el Whisky','Hicieron una hoguera.','Se tomaron el Coñac','Se abrigaron con mantas','Se bebieron el vino',0,0,1,0,0,'431','25860',''),(24,'12','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>EL PODER DE LA IMPRENTA</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>El inventor Johann Gutenberg muere en la pobreza mientras la imprenta cambia al mundo.&nbsp;</p><p>La Europa del siglo XV ansiaba cambios. Durante más de 1.000 años estuvo bajo el dominio de\r\nla Iglesia y una sociedad que apreciaba el conocimiento tradicional. Ahora había nuevas ideas en\r\nel aire. Pero sólo con pluma y pergamino para difundir el mensaje, era allí donde probablemente\r\nse quedarían.&nbsp;</p><p>En la ciudad alemana de Estrasburgo, un joven joyero de nombre Johann Gutenberg actuaba de\r\nmanera muy extraña. Pidió dinero a sus amigos para comprar materiales que nada tenían que ver\r\ncon la joyería. No dijo por qué los necesitaba, ni por qué eran tan caros. Al final, sus amigos\r\nrehusaron prestarle más hasta que lo aclarase. Su secreto los sorprendió. Trabajaba en un inventó\r\nque permitiría que los libros se produjeran masivamente en vez de ser copiados a mano.&nbsp;</p><p>Los nuevos tipos movibles, la tinta basada en óleo y la prensa de Gutenberg parecían tener futuro\r\ny, en 1438, sus amigos formaron una sociedad. Pero las cosas comenzaron a ir mal. Un socio\r\nmurió y sus hijos quisieron su parte. Llevaron a Gutenberg a juicio. Perdieron, pero salió a la luz\r\nel secreto de la obra de Gutenberg, y se inició la disputa para imprimir libros.&nbsp;</p><p>Gutenberg volvió a su ciudad natal, Maguncia, para perfeccionar su invento. Desesperado aún\r\npor dinero, persuadió al comerciante Johann Fust de que le otorgara dos grandes préstamos. El\r\nprimer libro de Gutenberg estuvo listo en 1455. Lo presentó en la feria comercial en el cercano\r\nFrankfurt, donde los visitantes comentaban sobre la claridad del libro.&nbsp;</p><p>Fue entonces cuando Fust insinuó que ya era hora de que le devolviese su dinero. Pero Gutenberg no pudo o no quiso pagar. Una vez más se vio enfrentado a un juicio en la corte. Esta vez\r\nno ganó. Fust tomó el control de todo. Deteniéndose sólo para robar al mejor asistente de Gutenberg, se erigió como el primer impresor exitoso del mundo.</p><p>Pero no mantuvo su liderazgo por mucho. En 25 años ya había impresores por toda Europa. Para\r\n1500, habían impreso 30.000 libros, extendiendo nuevas ideas por todas partes y ayudando a\r\niniciar la era que llamamos Renacimiento.</p><p>¿Y Johann Gutenberg? Siguió imprimiendo, pero no ganó mucho. El Arzobispo de Maguncia le\r\nproporcionó comida y ropa, en 1468, Gutenberg había muerto. El futuro que había ayudado a\r\ncrear estaba en marcha sin él.<br></p>','Profesión que ejercía Johann Gutenberg:','Comerciante','Escritor','Impresor','Joyero','Juez',0,0,0,1,0,'Cómo se difundía el conocimiento tradicional  antes del siglo XV:','A través de la tradición','Oralmente de padres a hijos','Con pluma y pergamino','A través de la imprenta','Con tinta basada en óleo y prensada',0,0,1,0,0,'Número de veces que fue llevado a  juicio Gutenberg:','Cinco','Cuatro','Tres','Dos','Una',0,0,0,1,0,'En 1455 estuvo el primer libro de Gutenberg,  que lo llevó a la feria comercial realizada en:','Maguncia','Estrasburgo','Europa','Alemania','Frankfurt',0,0,0,0,0,'¿Cuál fue el motivo por el cual Gutenberg  se vio envuelto en el primer juicio?','La muerte de un socio','La estafa realizada por un comerciante','Por no querer pagar una deuda','La reclamación de derechos','Por no estar de acuerdo con la Iglesia',0,0,0,1,0,'388','23280',''),(25,'12','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>EL PODER DE LA IMPRENTA</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>El inventor Johann Gutenberg muere en la pobreza mientras la imprenta cambia al mundo.&nbsp;</p><p>La Europa del siglo XV ansiaba cambios. Durante más de 1.000 años estuvo bajo el dominio de\r\nla Iglesia y una sociedad que apreciaba el conocimiento tradicional. Ahora había nuevas ideas en\r\nel aire. Pero sólo con pluma y pergamino para difundir el mensaje, era allí donde probablemente\r\nse quedarían.&nbsp;</p><p>En la ciudad alemana de Estrasburgo, un joven joyero de nombre Johann Gutenberg actuaba de\r\nmanera muy extraña. Pidió dinero a sus amigos para comprar materiales que nada tenían que ver\r\ncon la joyería. No dijo por qué los necesitaba, ni por qué eran tan caros. Al final, sus amigos\r\nrehusaron prestarle más hasta que lo aclarase. Su secreto los sorprendió. Trabajaba en un inventó\r\nque permitiría que los libros se produjeran masivamente en vez de ser copiados a mano.&nbsp;</p><p>Los nuevos tipos movibles, la tinta basada en óleo y la prensa de Gutenberg parecían tener futuro\r\ny, en 1438, sus amigos formaron una sociedad. Pero las cosas comenzaron a ir mal. Un socio\r\nmurió y sus hijos quisieron su parte. Llevaron a Gutenberg a juicio. Perdieron, pero salió a la luz\r\nel secreto de la obra de Gutenberg, y se inició la disputa para imprimir libros.&nbsp;</p><p>Gutenberg volvió a su ciudad natal, Maguncia, para perfeccionar su invento. Desesperado aún\r\npor dinero, persuadió al comerciante Johann Fust de que le otorgara dos grandes préstamos. El\r\nprimer libro de Gutenberg estuvo listo en 1455. Lo presentó en la feria comercial en el cercano\r\nFrankfurt, donde los visitantes comentaban sobre la claridad del libro.&nbsp;</p><p>Fue entonces cuando Fust insinuó que ya era hora de que le devolviese su dinero. Pero Gutenberg no pudo o no quiso pagar. Una vez más se vio enfrentado a un juicio en la corte. Esta vez\r\nno ganó. Fust tomó el control de todo. Deteniéndose sólo para robar al mejor asistente de Gutenberg, se erigió como el primer impresor exitoso del mundo.</p><p>Pero no mantuvo su liderazgo por mucho. En 25 años ya había impresores por toda Europa. Para\r\n1500, habían impreso 30.000 libros, extendiendo nuevas ideas por todas partes y ayudando a\r\niniciar la era que llamamos Renacimiento.</p><p>¿Y Johann Gutenberg? Siguió imprimiendo, pero no ganó mucho. El Arzobispo de Maguncia le\r\nproporcionó comida y ropa, en 1468, Gutenberg había muerto. El futuro que había ayudado a\r\ncrear estaba en marcha sin él.<br></p>','Ciudad natal de Johann Gutenberg:','Estrasburgo','Frankfurt','Alemania','Maguncia','Europa',0,0,0,1,0,'Fecha en qué murió Gutenberg:','1428','1438','1448','1458','1468',0,0,0,0,1,'Número de libros impresos en 1500:','20.000','30.000','40.000','50.000','60.000',0,1,0,0,0,'Nombre del personaje que se erigió como  el primer impresor exitoso:','Johann Gutenberg','Gabriel Gutenberg','Javier Fust','Cristian Gutenberg','Johann Fust',0,0,0,0,0,'El invento en que trabajaba Gutenberg  permitiría:','Que los relojes no actuaran de manera extraña','Que la imprenta fotocopiara libros con rapidez','Que los nuevos tipos de tinta fueran móviles','Que los libros se produjeran masivamente en vez de ser copiados a mano','Que los relojes fueran exactos',0,0,0,1,0,'388','23280',''),(26,'13','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>JUGANDO A LA PELOTA</strong></h3>\r\n\r\n<p style=\"text-align: center;\"><span style=\"text-align: center;\"><br></span></p><p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">En el Club de Barrio Tejada había un campeonato de fútbol y Beto regalaba una\r\npelota No. 5, de cuero, al equipo ganador.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">The Barrio Tejada Club has organized a football championship and Beto would give a\r\nbig leather ball No. 5 to the wining team.</span> </p> <br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Nosotros tenemos que intervenir…! ¡Como sea! – dijo Julio y cuando llegó la fecha:</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We have to take a part in it! No matter now! – said Julio and when the day came:</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">-Logramos organizar un buen equipo… ¡Hasta tenemos al comisario Adán de arquero…!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We´ve managed to organized a good team… We even have Police Superintendent Adan\r\nas a goalkeeper!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Pero…¿Y tú Monito,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">But, what about you, Monito,</span><br>\r\n<span style=\"text-align: center;\">por qué no trajiste la ropa reglamentaria? Y bueno…miren…yo traje un pito quisiera…yo…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Why haven’t you brought your pertaining clothes? Well, look…I’ve brought a whistle\r\nand I…would like to…</span><br>\r\n<span style=\"text-align: center;\">murmuró Monito, con una timidez que no le permitía explicar las cosas.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">murmured Monito so timidly that he couldn’t explain things clearly.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡El quisiera ser el árbitro! ¿No se dan cuenta? – dijo Rubencho, que los había acompañado.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He’d like to be the referee! Can’t you see? – said _Rubencho who had gone with them.</span><br>\r\n<span style=\"text-align: center;\">- De acuerdo – aprobaron todos. Pero no sabían que Monito</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We all agree – they said. But they didn’t know that Monito</span><br>\r\n<span style=\"text-align: center;\">podía llegar a ser muy severo.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">could be a very strict referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Eh tú! ¡Flaco! ¡Tienes las medias caídas…! – decía el Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Eh You! Flaco! Pull up your socks! –said Monito.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Y tú Chiquito!¿Piensas jugar con guantes de box? Tendré que echarte…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And you, Chiquito! Do you think you will play wearing boxing gloves? I´ll have to send\r\nyou out…</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Y así con todos. Al fin empezó el partido. ¡Y a cumplir las reglas al dedillo!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And he did the same to everyone. Finally the match started –you must stick to the rules!</span><br>\r\n<span style=\"text-align: center;\">¿Me han oído? – agregó el árbitro.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Did you hear me? – added the referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Je! ¡Je! Pensó entonces Loco Darío, del equipo contrario,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He! He! Thought then Loco-Darío, a member of the other team,</span><br>\r\n<span style=\"text-align: center;\">fastidiado con tanta corrección. ¡Éste piensa que somos unos angelitos!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">annoyed because of so much properness. This man thinks we are little angels!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Loco, aprovechando una distracción de Julio, lo durmió de un golpe</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Loco, seeing that Julio wasn´t paying attention, knocked him out</span><br>\r\n<span style=\"text-align: center;\">y le sacó la pelota. Luego se dispuso a tirar para hacer un gol, pero…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">and got hold of the ball. He got ready to kick it to score a goal, but…</span><br>\r\n<span style=\"text-align: center;\">¡Hurra! La pelota fue a parar a la platea y le arrancó el sombrero a Pepe…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Hurray! The ball went right up into the grandstand and knocked off Pepe’s hat…</span><br>\r\n<span style=\"text-align: center;\">¡Fuera! ¡Estás inhabilitado! – gritó Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Out you’re out! – shouted Monito.</span><br>\r\n<span style=\"text-align: center;\">¡Muy bien, pequeño! ¡Has estado brillante! –dijeron todos.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Well done, Little one! That was brilliant - everybody said.</span><br></p>','Cuál era el premio para el equipo ganador:','Un balón de fútbol','Una pelota de cuero','Un balón No. 5','Una pelota No. 5, de cuero','Una pelota de fútbol',0,0,0,1,0,'Quién no era parte del equipo, pero los  acompañaba:','El comisario Adán','Rubencho','Loco-Darío','Flaco','Beto',0,1,0,0,0,'Por qué el Monito no llevaba la ropa  reglamentaria:','No iba a jugar en el primer tiempo','Estaba cansado','No quería ser parte de ese equipo','Tenía miedo que lo golpearan','Quería ser el árbitro',0,0,0,0,0,'Por qué iban a sacar a Chiquito:','Llevaba las medias sucias','Llevaba pantalones muy largos','No tenía zapatos necesarios','No tenía los guantes apropiados','Tenía las medias caídas',0,0,0,1,0,'¿Quién estaba fastidiado con tanta corrección  por parte del árbitro?:','Julio','Flaco','Chiquito','Loco','Beto',0,0,0,1,0,'498','29880',''),(27,'13','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>JUGANDO A LA PELOTA</strong></h3>\r\n\r\n<p style=\"text-align: center;\"><span style=\"text-align: center;\"><br></span></p><p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">En el Club de Barrio Tejada había un campeonato de fútbol y Beto regalaba una\r\npelota No. 5, de cuero, al equipo ganador.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">The Barrio Tejada Club has organized a football championship and Beto would give a\r\nbig leather ball No. 5 to the wining team.</span> </p> <br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Nosotros tenemos que intervenir…! ¡Como sea! – dijo Julio y cuando llegó la fecha:</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We have to take a part in it! No matter now! – said Julio and when the day came:</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">-Logramos organizar un buen equipo… ¡Hasta tenemos al comisario Adán de arquero…!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We´ve managed to organized a good team… We even have Police Superintendent Adan\r\nas a goalkeeper!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Pero…¿Y tú Monito,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">But, what about you, Monito,</span><br>\r\n<span style=\"text-align: center;\">por qué no trajiste la ropa reglamentaria? Y bueno…miren…yo traje un pito quisiera…yo…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Why haven’t you brought your pertaining clothes? Well, look…I’ve brought a whistle\r\nand I…would like to…</span><br>\r\n<span style=\"text-align: center;\">murmuró Monito, con una timidez que no le permitía explicar las cosas.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">murmured Monito so timidly that he couldn’t explain things clearly.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡El quisiera ser el árbitro! ¿No se dan cuenta? – dijo Rubencho, que los había acompañado.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He’d like to be the referee! Can’t you see? – said _Rubencho who had gone with them.</span><br>\r\n<span style=\"text-align: center;\">- De acuerdo – aprobaron todos. Pero no sabían que Monito</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We all agree – they said. But they didn’t know that Monito</span><br>\r\n<span style=\"text-align: center;\">podía llegar a ser muy severo.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">could be a very strict referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Eh tú! ¡Flaco! ¡Tienes las medias caídas…! – decía el Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Eh You! Flaco! Pull up your socks! –said Monito.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Y tú Chiquito!¿Piensas jugar con guantes de box? Tendré que echarte…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And you, Chiquito! Do you think you will play wearing boxing gloves? I´ll have to send\r\nyou out…</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Y así con todos. Al fin empezó el partido. ¡Y a cumplir las reglas al dedillo!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And he did the same to everyone. Finally the match started –you must stick to the rules!</span><br>\r\n<span style=\"text-align: center;\">¿Me han oído? – agregó el árbitro.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Did you hear me? – added the referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Je! ¡Je! Pensó entonces Loco Darío, del equipo contrario,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He! He! Thought then Loco-Darío, a member of the other team,</span><br>\r\n<span style=\"text-align: center;\">fastidiado con tanta corrección. ¡Éste piensa que somos unos angelitos!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">annoyed because of so much properness. This man thinks we are little angels!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Loco, aprovechando una distracción de Julio, lo durmió de un golpe</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Loco, seeing that Julio wasn´t paying attention, knocked him out</span><br>\r\n<span style=\"text-align: center;\">y le sacó la pelota. Luego se dispuso a tirar para hacer un gol, pero…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">and got hold of the ball. He got ready to kick it to score a goal, but…</span><br>\r\n<span style=\"text-align: center;\">¡Hurra! La pelota fue a parar a la platea y le arrancó el sombrero a Pepe…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Hurray! The ball went right up into the grandstand and knocked off Pepe’s hat…</span><br>\r\n<span style=\"text-align: center;\">¡Fuera! ¡Estás inhabilitado! – gritó Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Out you’re out! – shouted Monito.</span><br>\r\n<span style=\"text-align: center;\">¡Muy bien, pequeño! ¡Has estado brillante! –dijeron todos.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Well done, Little one! That was brilliant - everybody said.</span><br></p>',' Por qué casi le hacen un gol al equipo de  Chiquito: ','Porque Beto estaba fuera de lugar','Porque Pepe no marcaba bien','Porque Flaco se estaba acomodando','Porque Julio se distrajo','Porque Chiquito no estaba tapando bien',0,0,0,1,0,'Quién era el arquero del equipo:','El comisario Adán','Pepe','Beto','Flaco','Chiquito',1,0,0,0,0,' Qué le pasó a Pepe:','Le quitaron las plumas','Le dieron un golpe','Le sacaron tarjeta roja','Le arrancaron el sombrero','Le dañaron el uniforme',0,0,0,1,0,'Qué recibió el árbitro por cumplir  con las reglas al dedillo:','Un uniforme nuevo','Insultos por parte de los jugadores','Una medalla de honor','Un trofeo','Felicitaciones',0,0,0,0,0,'Por qué sacaron a Loco del partido:','Por ser mal arquero','Por no cumplir las normas','Por cometer una falta','Porque le sacaron tarjeta amarilla','Porque estaba fastidiado',0,0,1,0,0,'498','29880',''),(28,'14','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LA FUNCIÓN DE TÍTERES</strong></h3>\r\n<h4 style=\"text-align: center; color:#ffcd00; text-align:center;\"><strong>A Puppet Show</strong></h4>\r\n\r\n<p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\">\r\n¡Toma! ¡Toma! -le decía el malvado a un joyero que acababa de<br>\r\n<span style=\"color:#ffcd00\">Take that! And that! -said the villain to a jeweler who had just</span><br>\r\nsalir del banco-. ¡la bolsa o la vida! ¡Toma!<br>\r\n<span style=\"color:#ffcd00\">come out of the bank-. Your money or your life! Take that!</span><br>\r\n¡Je! ¡Je! ¡Je! –reía ahora el facineroso- ¡Con este oro podré<br>\r\n<span style=\"color:#ffcd00\">Ha! Ha! Ha! now laughed the criminal. With this gold I shall be able to</span><br>\r\ncumplir mis planes y casarme con la hija del rey…!<br>\r\n<span style=\"color:#ffcd00\">carry out my plans and marry the king’s daughter!</span>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\nLa hija del rey aparecía en escena justamente en ese momento,<br>\r\n<span style=\"color:#ffcd00\">Precisely at that moment the king’s daughter came on the scene,</span><br>\r\ndelante del telón decorado que representaba un palacio.<br>\r\n<span style=\"color:#ffcd00\">in front of the curtain set which stood for a palace.</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n¿Te gusta el oro, princesita? -dijo el maleante.<br>\r\n<span style=\"color:#ffcd00\">How do you like gold, little princess? -Asked the rascal.</span><br>\r\n¡Socorro! ¡Socorro! ¡Estoy atrapada! ¡Sálvenme!<br>\r\n<span style=\"color:#ffcd00\">Help! Help! I’m caught¡ Help me!</span><br>\r\n-chilló la princesa al ver al malvado personaje.<br>\r\n<span style=\"color:#ffcd00\">-screamed the princess on seeing the villainous character.</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\nLos gritos eran tan fuertes que... ¡pum! ¡pum! ¡pum!, unos<br>\r\n<span style=\"color:#ffcd00\">She screamed so loud that bang! bang! bang!</span><br>\r\ngritos terribles y verdaderos derribaron la puerta de la casa de<br>\r\n<span style=\"color:#ffcd00\">truly frightful knocks battered down the door of</span><br>\r\nTaquito y Medialuna y...<br>\r\n<span style=\"color:#ffcd00\">Taquito´s y Medialuna´s house and...</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n¿Qué pasa aquí? ¿Quién pide ayuda? -gritó valientemente el<br>\r\n<span style=\"color:#ffcd00\">What’s going on here? Who’s asking for help? -bravely demanded</span><br>\r\ncomisario Piñón, entrando en la casa revolver en mano…<br>\r\n<span style=\"color:#ffcd00\">superintendent Piñón, going into the house with his gun in his hand…</span><br>\r\n¡Ja! ¡Ja! ¡Ja! –se rió Taquito-.<br>\r\n<span style=\"color:#ffcd00\">Ha! Ha! Ha!- laughed Taquito-.</span><br>\r\n¿No ves que esto es una función de títeres?<br>\r\n<span style=\"color:#ffcd00\">Can’t you see this is a puppet show?</span><br>\r\ny Pájaro Pinto, el titiritero,<br>\r\n<span style=\"color:#ffcd00\">and Pájaro Pinto, the puppeteer,</span><br>\r\nsaliendo de atrás del pequeño telón<br>\r\n<span style=\"color:#ffcd00\">coming out front behind the small curtain</span><br>\r\ncon el muñeco del ladrón en la mano, explicó:<br>\r\n<span style=\"color:#ffcd00\">with the puppet thief in his hand, explained:</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n-Perdón, señor… Yo… en<br>\r\n<span style=\"color:#ffcd00\">-I’m sorry, sir… I… in</span><br>\r\nrealidad lo que estaba haciendo con las marionetas<br>\r\n<span style=\"color:#ffcd00\">fact what I was doing with the puppets</span><br>\r\nera… ¡Todo esto de mentiritas…!<br>\r\n<span style=\"color:#ffcd00\">was… all this is make-believe!</span><br>\r\n¿Se da cuenta?<br>\r\n<span style=\"color:#ffcd00\">You see?</span><br>\r\n</p><br>','Cuáles eran los planes que iba a cumplir el  ladrón al robarse el oro:','Casarse y tener muchos hijos','Casarse con la hija','Casarse con la hija del rey','Casarse con la hija del banquero','Casarse con su novia',0,0,1,0,0,'A quién robó el facineroso:','Al banco','Al cajero','Al comisario','Al tendero','Al joyero',0,0,0,0,1,'Cuáles fueron las palabras utilizadas por el  ladrón:','Manos arriba','El dinero o la vida','Esto es un asalto','La bolsa o la vida','Cállese no grite',0,0,0,1,1