e!<br>\r\n<span style=\"color:#ffcd00\">Help! Help! I’m caught¡ Help me!</span><br>\r\n-chilló la princesa al ver al malvado personaje.<br>\r\n<span style=\"color:#ffcd00\">-screamed the princess on seeing the villainous character.</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\nLos gritos eran tan fuertes que... ¡pum! ¡pum! ¡pum!, unos<br>\r\n<span style=\"color:#ffcd00\">She screamed so loud that bang! bang! bang!</span><br>\r\ngritos terribles y verdaderos derribaron la puerta de la casa de<br>\r\n<span style=\"color:#ffcd00\">truly frightful knocks battered down the door of</span><br>\r\nTaquito y Medialuna y...<br>\r\n<span style=\"color:#ffcd00\">Taquito´s y Medialuna´s house and...</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n¿Qué pasa aquí? ¿Quién pide ayuda? -gritó valientemente el<br>\r\n<span style=\"color:#ffcd00\">What’s going on here? Who’s asking for help? -bravely demanded</span><br>\r\ncomisario Piñón, entrando en la casa revolver en mano…<br>\r\n<span style=\"color:#ffcd00\">superintendent Piñón, going into the house with his gun in his hand…</span><br>\r\n¡Ja! ¡Ja! ¡Ja! –se rió Taquito-.<br>\r\n<span style=\"color:#ffcd00\">Ha! Ha! Ha!- laughed Taquito-.</span><br>\r\n¿No ves que esto es una función de títeres?<br>\r\n<span style=\"color:#ffcd00\">Can’t you see this is a puppet show?</span><br>\r\ny Pájaro Pinto, el titiritero,<br>\r\n<span style=\"color:#ffcd00\">and Pájaro Pinto, the puppeteer,</span><br>\r\nsaliendo de atrás del pequeño telón<br>\r\n<span style=\"color:#ffcd00\">coming out front behind the small curtain</span><br>\r\ncon el muñeco del ladrón en la mano, explicó:<br>\r\n<span style=\"color:#ffcd00\">with the puppet thief in his hand, explained:</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n-Perdón, señor… Yo… en<br>\r\n<span style=\"color:#ffcd00\">-I’m sorry, sir… I… in</span><br>\r\nrealidad lo que estaba haciendo con las marionetas<br>\r\n<span style=\"color:#ffcd00\">fact what I was doing with the puppets</span><br>\r\nera… ¡Todo esto de mentiritas…!<br>\r\n<span style=\"color:#ffcd00\">was… all this is make-believe!</span><br>\r\n¿Se da cuenta?<br>\r\n<span style=\"color:#ffcd00\">You see?</span><br>\r\n</p><br>','Quién logró rescatar a la princesa:','El príncipe','El rey, su padre','El Comisario','El policía','Nadie',0,0,0,0,1,'Con qué arma entro el comisario para prestar  ayuda:','Con un bolillo','Con las esposas','Con un revólver','Con una espada','Con un rifle',0,0,1,0,0,'Quién le explicó al comisario lo que estaba  pasando:','Taquito','Medialuna','Pelusa','Pájaro Pinto','El ladrón',0,0,0,1,0,'Qué era lo que realmente estaba pasando:','Que la princesa estaba actuando','Que el rey estaba contando la historia','Que estaban viendo una película','Que estaban jugando con marionetas','Que Taquito estaba soñando',0,0,0,1,0,'Qué derribó la puerta de la casa de Taquito y  Medialuna:','Los gritos de la princesa','Los golpes del comisario','Los disparos del ladrón','Los golpes del rey','Los golpes del titiritero',0,1,0,0,0,'377','22620',''),(30,'15','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LAS GEMELAS: MUERE UN SÍMBOLO</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><strong>El objetivo de los terroristas fue contundente: las torres gemelas de Nueva\r\nYork y el Pentágono de Washington, las construcciones más espectaculares\r\nde E.U.&nbsp;</strong></p><p>Las Torres Gemelas de 110 pisos del World Trade Center estaban ubicadas, en el\r\nsur de la isla de Manhattan, corazón del barrio de negocios de Nueva York. Este\r\ncomplejo financiero alberga a 450 empresas y a 50.000 trabajadores, incluidas las\r\noficinas de los servicios de aduanas de los estados de Nueva York y Nueva Jersey.&nbsp;</p><p>El enorme peso de cada edificio era sostenido por una malla metálica interior, que\r\nprivaba a los trabajadores del World Trade Center de grandes ventanas. Sólo desde\r\nlo alto de cada edificio, de 410 metros de altura, se contemplaba una espectacular\r\nvista. El ascensor tardaba 58 segundos en alcanzar el piso 107.&nbsp;</p><p>Diseñadas por el arquitecto japonés Minuro Yamasaki, las “Twins” (Gemelas),\r\ncomo familiarmente las llamaban los neoyorquinos, fueron construidas entre 1966\r\ny 1977.\r\nEl complejo atacado constaba de cinco edificios de oficinas y un hotel,\r\ncomunicados por una enorme red subterránea de tiendas y restaurantes.&nbsp;</p><p><strong>El pentágono&nbsp;</strong></p><p>Es allí donde, desde Washington, funciona la cabeza del departamento de Defensa\r\nde Estados Unidos. Este complejo militar es una ciudad en sí mismo. Trabajan\r\naproximadamente 23.000 empleados entre militares y civiles.\r\nEl Pentágono es uno de los edificios más grandes de oficinas de ese país. En su área\r\nde construcción cabría cinco veces el Capitolio Nacional de Estados Unidos.\r\nSe construyó durante los primeros años de la Segunda Guerra Mundial y todavía\r\nhoy se considera uno de los edificios de oficinas más eficientes del mundo.&nbsp;</p><p>Muy poca es la gente de Estados Unidos que conoce de la existencia de estas\r\ninstalaciones, desde donde se planean y ejecutan las actividades de defensa\r\nestadounidenses, pero también es muy poca la gente que ha tenido la oportunidad\r\nde acceder a este complejo.<br></p>','¿Dónde se encontraban ubicadas las Torres  Gemelas?','En Nueva Jersey','En la Isla de Manhattan','En Washington','En Miami','En Hollywood',0,1,0,0,0,'¿Desde dónde se planean y ejecutan las  actividades de defensa estadounidenses?','Desde la Casa Blanca','Desde el Ministerio de Defensa','Desde el Capitolio Nacional de Estados Unidos','Desde el Pentágono','Desde el World Trade Center',0,0,0,1,0,'¿De qué no gozaba el World Trade Center?','De restaurante','De salas de cine','De pequeñas puertas','De escaleras eléctricas','De grandes ventanas',0,0,0,0,0,'El Pentágono fue construido durante:','Los primeros años de la Primera Guerra Mundial','Los últimos años de la Primera Guerra Mundial','Los primeros años de la Segunda Guerra Mundial','1966 y 1967','Los últimos años de la Segunda Guerra Mundial',0,0,1,0,0,'Nacionalidad del arquitecto que diseñó las  Torres:','Europeo','Alemán','Japonés','Chino','Americano',0,0,1,0,0,'315','18900',''),(31,'15','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>LAS GEMELAS: MUERE UN SÍMBOLO</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p><strong>El objetivo de los terroristas fue contundente: las torres gemelas de Nueva\r\nYork y el Pentágono de Washington, las construcciones más espectaculares\r\nde E.U.&nbsp;</strong></p><p>Las Torres Gemelas de 110 pisos del World Trade Center estaban ubicadas, en el\r\nsur de la isla de Manhattan, corazón del barrio de negocios de Nueva York. Este\r\ncomplejo financiero alberga a 450 empresas y a 50.000 trabajadores, incluidas las\r\noficinas de los servicios de aduanas de los estados de Nueva York y Nueva Jersey.&nbsp;</p><p>El enorme peso de cada edificio era sostenido por una malla metálica interior, que\r\nprivaba a los trabajadores del World Trade Center de grandes ventanas. Sólo desde\r\nlo alto de cada edificio, de 410 metros de altura, se contemplaba una espectacular\r\nvista. El ascensor tardaba 58 segundos en alcanzar el piso 107.&nbsp;</p><p>Diseñadas por el arquitecto japonés Minuro Yamasaki, las “Twins” (Gemelas),\r\ncomo familiarmente las llamaban los neoyorquinos, fueron construidas entre 1966\r\ny 1977.\r\nEl complejo atacado constaba de cinco edificios de oficinas y un hotel,\r\ncomunicados por una enorme red subterránea de tiendas y restaurantes.&nbsp;</p><p><strong>El pentágono&nbsp;</strong></p><p>Es allí donde, desde Washington, funciona la cabeza del departamento de Defensa\r\nde Estados Unidos. Este complejo militar es una ciudad en sí mismo. Trabajan\r\naproximadamente 23.000 empleados entre militares y civiles.\r\nEl Pentágono es uno de los edificios más grandes de oficinas de ese país. En su área\r\nde construcción cabría cinco veces el Capitolio Nacional de Estados Unidos.\r\nSe construyó durante los primeros años de la Segunda Guerra Mundial y todavía\r\nhoy se considera uno de los edificios de oficinas más eficientes del mundo.&nbsp;</p><p>Muy poca es la gente de Estados Unidos que conoce de la existencia de estas\r\ninstalaciones, desde donde se planean y ejecutan las actividades de defensa\r\nestadounidenses, pero también es muy poca la gente que ha tenido la oportunidad\r\nde acceder a este complejo.<br></p>','Este complejo financiero “Torres Gemelas”  albergaba a:','110 empresas y 23.000 Trabajadores','450 empresas y 23.000 Trabajadores','110 empresas y 50.000 Trabajadores','410 empresas y 40.000 Trabajadores','450 empresas y 50.000 Trabajadores',0,0,0,0,1,'¿En dónde se encuentra ubicado el Pentágono?','En Nueva York',' En Nueva Jersey','En Manhattan','En Miami','En Washington',0,0,0,0,1,'Se considera que es uno de los edificios de oficinas más eficientes del mundo:','El World Trade Center','El Pentágono','El Capitolio Nacional','Las Torres Gemelas','El Mall',0,1,0,0,0,'¿Cuál era la altura de cada edificio del  complejo atacado?','415 Metros','401 Metros','435 Metros','410 Metros','420 Metros',0,0,0,1,0,'En el Pentágono trabajan aproximadamente:','23.000 Empleados','45.000 Empleados','53.000 Empleados','50.000 Empleados','40.000 Empleados',1,0,0,0,0,'315','18900',''),(32,'16','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>KEPLER, JOHANNES -1571-1630</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>Uno de los más grandes astrónomos observadores fue Tycho Brahe (1540-1601), un danés. En\r\n1599 tuvo una disputa con el rey de Dinamarca y se trasladó a Praga, donde estableció un observatorio. Allí tomó como asistente a un joven alemán, Johannes Kepler. Cuando Brahe murió,\r\ndejó a su asistente los registros de las observaciones que había hecho durante toda su vida.&nbsp;</p><p>Tomando en consideración esas observaciones, Kepler llegó a convencerse que la teoría de\r\nCopérnico sobre el movimiento de la tierra y los planetas alrededor del sol era correcta. Pero se\r\nencontró con que no podía hacer sus observaciones si consideraba el antiguo criterio que los\r\ncuerpos celestes giraban en círculos perfectos o en combinaciones de círculos.&nbsp;</p><p>Así entonces concluyó que los planetas se movían trazando una órbita ovalada. Comprobó su\r\nteoría realizando observaciones sobre el planeta Marte, de acuerdo al criterio que trazaba la más\r\nsimple de las órbitas ovaladas –una elipse-, y encontró que era correcta.&nbsp;</p><p>Partiendo del hecho que las órbitas planetarias son elípticas, estimó que cada cierto tiempo los\r\nplanetas debían encontrarse más cerca del sol. Kepler demostró que los planetas se desplazaban\r\nmás rápidamente al estar más cerca del sol que cuando se encontraban alejados. Diez años más\r\ntarde descubrió la relación que existe entre el tiempo que demoran los planetas en dar la vuelta\r\ncompleta alrededor del sol y la distancia a la que se encuentran de éste. Estas reglas se conocen\r\ncomo leyes del movimiento de Kepler.&nbsp;</p><p>Kepler fue el primero en trazar las órbitas de los planetas. Los estudios de Kepler hicieron\r\ndescartar definitivamente la teoría de la tierra como centro del universo.<br></p>',' Se considera uno de los más grandes  astrónomos observadores:','Ptolomeo','Copérnico Nicolás','Kepler Johannes','Newton Isaac','Tycho Brahe',0,0,0,0,1,'Kepler comprobó su teoría realizando  observaciones sobre el planeta:','Tierra','Venus','Marte','Júpiter','Mercurio',0,0,1,0,0,'Los estudios de Kepler hicieron descartar  la teoría de que:','Los cuerpos celestes no giraban en círculos','Que la tierra gira alrededor del sol','Que las órbitas planetarias son elípticas','La tierra es el centro del universo','Que el sol y las estrellas se mueven',0,0,0,1,0,'Fue el primero en trazar las órbitas  de los planetas:','Galilei Galileo','Newton Sir Isaac','Tycho Brahe','Kepler Johannes','Copérnico Nicolás',0,0,0,1,0,'Partiendo del hecho que las órbitas planetarias son elípticas, Kepler estimó que:','Los planetas cada cierto tiempo debían encontrarse más cerca del sol','Los planetas se demoraban un día en dar la vuelta al sol','Los cuerpos celestes giraban en círculos perfectos','Los cuerpos celestes giraban en combinaciones de círculos','Los planetas se desplazan más rápidamente al estar más cerca de la luna',1,0,0,0,0,'275','16524',''),(33,'16','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>KEPLER, JOHANNES -1571-1630</strong></h3>\r\n<p><span style=\"letter-spacing: 0.2px;\"><br></span></p><p>Uno de los más grandes astrónomos observadores fue Tycho Brahe (1540-1601), un danés. En\r\n1599 tuvo una disputa con el rey de Dinamarca y se trasladó a Praga, donde estableció un observatorio. Allí tomó como asistente a un joven alemán, Johannes Kepler. Cuando Brahe murió,\r\ndejó a su asistente los registros de las observaciones que había hecho durante toda su vida.&nbsp;</p><p>Tomando en consideración esas observaciones, Kepler llegó a convencerse que la teoría de\r\nCopérnico sobre el movimiento de la tierra y los planetas alrededor del sol era correcta. Pero se\r\nencontró con que no podía hacer sus observaciones si consideraba el antiguo criterio que los\r\ncuerpos celestes giraban en círculos perfectos o en combinaciones de círculos.&nbsp;</p><p>Así entonces concluyó que los planetas se movían trazando una órbita ovalada. Comprobó su\r\nteoría realizando observaciones sobre el planeta Marte, de acuerdo al criterio que trazaba la más\r\nsimple de las órbitas ovaladas –una elipse-, y encontró que era correcta.&nbsp;</p><p>Partiendo del hecho que las órbitas planetarias son elípticas, estimó que cada cierto tiempo los\r\nplanetas debían encontrarse más cerca del sol. Kepler demostró que los planetas se desplazaban\r\nmás rápidamente al estar más cerca del sol que cuando se encontraban alejados. Diez años más\r\ntarde descubrió la relación que existe entre el tiempo que demoran los planetas en dar la vuelta\r\ncompleta alrededor del sol y la distancia a la que se encuentran de éste. Estas reglas se conocen\r\ncomo leyes del movimiento de Kepler.&nbsp;</p><p>Kepler fue el primero en trazar las órbitas de los planetas. Los estudios de Kepler hicieron\r\ndescartar definitivamente la teoría de la tierra como centro del universo.<br></p>','Kepler demostró que: ','Copérnico estaba equivocado al decir que la tierra  se mueve alrededor del sol','Galileo se equivocó al decir que la luna, no tiene  luz propia','Los planetas se desplazan más rápidamente al  estar más cerca del sol','Newton, acertó al decir que la luna gira en torno a  la tierra','Tycho acertó al decir que los planetas giran alrededor del sol',0,0,1,0,0,'Nacionalidad de Tycho Brahe:','Alemán','Irlandés','Danés','Italiano','Griego',0,0,1,0,0,'Cuál es la principal enseñanza que dejó  Kepler:','La tierra gira alrededor del sol','Que los planetas no giran en torno a la luna','Que la tierra no es el centro del universo','Que los planetas tienen movimiento','Que los planetas se movían trazando una  órbita ovalada',0,0,0,0,0,'Las reglas básicas del sistema solar  se conocen como:','Las leyes de gravedad','Las leyes de movimiento planetario','Las leyes de la caída libre','Las leyes del movimiento solar','Las leyes del movimiento gravitacional',0,1,0,0,0,'Kepler llegó a convencerse de la teoría de Copérnico gracias a:','Sus estudios realizados en la universidad','Los descubrimientos de Newton','Los avances hechos por Galileo','Las observaciones hechas por Tycho','Las investigaciones hechas por Ptolomeo',0,0,0,1,0,'275','16500',''),(34,'17','PRUEBA DE COMPRENSIÓN A','<br><br><br><center><img src=\"https://mindstothe2.com/media/examenes/17.png\"></center>','Colección de estructuras que intervienen en la  conducta emotiva, la memoria a largo plazo y  otras funciones:','El sistema límbico','La corteza motora','La corteza somatosensorial','La vía óptica','La corteza cortical',1,0,0,0,0,'Se encarga de coordinar movimientos:','La corteza','La neocorteza','La médula',' El cerebelo','El cerebro',0,0,0,1,0,'Casi todos los fenómenos de pensamiento y  percepción se traducen en impulsos eléctricos  nervioso, llamados:','Acciones de potenciación','Potenciales de acción','Regiones neuronales','Potenciales de reacción','Acciones de reacción',0,1,0,0,0,'Se dice que la corteza tiene un área total de:','1.3 metros cuadrados','1.5 metros cuadrados','1.6 metros cuadrados','1.2 metros cuadrados','1.4 metros cuadrados',0,1,0,0,0,'El cerebro humano, consta de alrededor de un  billón de células de las cuales unos cien mil  millones son:','Dendritas','Neuronas','Células receptoras','Axones','Somas',0,1,0,0,0,'255','15300',NULL),(35,'17','PRUEBA DE COMPRENSIÓN B','<br><br><br><center><img src=\"https://mindstothe2.com/media/examenes/17.png\"></center>','Se le conoce como la sede de la inteligencia, la creatividad y la memoria:','Núcleo','Cerebelo','Médula','Neurona','Cerebro',0,0,0,0,1,'Es lo que regula las funciones autónomas:','Neurona','Célula','Hemisferio Izquierdo','Hemisferio Derecho','Médula',0,0,0,0,1,'La neocorteza, más joven, está dividida en  lóbulo frontal, temporal, parietal y occipital,  separados por:','Cuerpos callosos','Surcos o pliegues profundos','Puentes axonales','Los hemisferios','Regiones cerebrales',0,1,0,0,0,'Se llama corteza a:','La capa exterior de los lóbulos','La capa interna de la médula','La capa superficial de los hemisferios','La capa dura que protege al cerebelo','La capa elemental del cerebro',0,0,1,0,0,'Se encuentran conectados por el cuerpo calloso  y otros pueden axonales:','Los lóbulos',' Las neuronas','Los hemisferios','La médula y el cerebelo','El cerebelo y las neuronas',0,0,1,0,0,'255','15300',NULL),(42,'21','EL DIENTE ROTO','<p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">A los doce años, combatiendo Juan\r\nPeña con unos granujas, recibió un guijarro sobre un diente; la sangre corrió\r\nlavándole el sucio de la cara, y el diente se partió en forma de sierra. Desde\r\nese día principia la edad de oro de Juan Peña. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">Con la punta de la lengua, Juan\r\ntentaba sin cesar al diente roto; el cuerpo inmóvil, vaga la mirada-sin pensar.\r\nAsí de alborotador y pendenciero, tornóse en callado y tranquilo. Los padres de\r\nJuan, hartos de escuchar quejas de los vecinos y transeúntes víctimas de las perversidades\r\ndel chico, y que habían agotado toda clase de reprimendas y castigos, estaban\r\nahora estupefactos y angustiados con la súbita transformación de Juan. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">Juan no chistaba y permanecía horas\r\nenteras en actitud hierática, como en éxtasis, mientras, allá adentro en la\r\noscuridad de la boca cerrada, su lengua acariciaba el diente roto-sin pensar.\r\n-El niño no está bien, Pablo- decía la madre al marido-; hay que llamar al\r\nmédico. Llego el doctor grave y panzudo y procedió al diagnóstico: buen pulso,\r\nmofletes sanguíneos, excelente apetito, ningún síntoma de enfermedad. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">-Señora- terminó por decir el sabio\r\ndespués de un largo examen-, la santidad de mi profesión me impone declarar a\r\nusted… <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">-¿Qué, señor doctor de mi alma?-\r\ninterrumpió la angustiada madre. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">-Que su hijo está mejor que una\r\nmanzana. Lo que sí es indiscutible –continuó con voz misteriosa-, es que\r\nestamos en presencia de un caso fenomenal: Su hijo de usted, mi estimable\r\nseñora, sufre de lo que hoy llamamos el mal de pensar; en una palabra, su hijo es\r\nun filósofo precoz, un genio tal vez. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">En la oscuridad de la boca, Juan\r\nacariciaba su diente roto-sin pensar. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">Parientes y amigos hicieron eco de\r\nla opinión del doctor, acogida con júbilo indecible por los padres de Juan.\r\nPronto en el pueblo todo, se citó el caso admirable del “niño prodigio” y su\r\nfama aumentó como una bomba de papel hinchada de humo. Hasta el maestro de\r\nescuela, que lo había tenido por la más lerda cabeza del orbe, se sometió a la\r\nopinión general, por aquello de que voz del pueblo es voz del cielo. Quien más,\r\nquien menos, cada cual traía a colación un ejemplo: Demóstenes comía arena,\r\nShakespeare era un pilluelo desarrapado, Edison, etcétera.<o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">Creció Juan Peña en medio de libros\r\nabiertos ante sus ojos, pero que no leía, distraído por la tarea de su lengua\r\nocupada en tocar la pequeña sierra del diente roto-sin pensar. Y con su cuerpo,\r\ncrecía la reputación de hombre juicioso, sabio y “profundo”, y nadie se cansaba\r\nde alabar el talento maravilloso de Juan. En plena juventud, las más hermosas mujeres\r\ntrataban de seducir y conquistar aquel espíritu superior entregado a hondas\r\nmeditaciones, para los demás, pero que en la oscuridad de su boca tentaba el\r\ndiente roto-sin pensar. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">Pasaron meses y años y Juan Peña\r\nfue diputado, académico, ministro y estaba a punto de ser coronado presidente\r\nde la república, cuando la apoplejía lo sorprendió acariciándose su diente roto\r\ncon la punta de la lengua. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\">Y doblaron las campanas, y fue\r\ndecretado un riguroso duelo nacional; un orador lloró en una fúnebre oración a nombre\r\nde la patria, y cayeron rosas y lágrimas sobre la tumba del grande hombre que\r\nno había tenido tiempo de pensar. <o:p></o:p></span></p><p style=\"text-align:justify\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;color:black\"><o:p>&nbsp;</o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p align=\"center\" style=\"text-align: right;\"><span lang=\"ES-CO\" style=\"font-size:\r\n11.0pt;font-family:&quot;Arial&quot;,sans-serif;color:black\">PEDRO EMILIO COLL\r\n(Venezolano)<o:p></o:p></span></p>','¿El diente de Juan Peña se partió?','Por la mitad','En tres partes','En forma de sierra','En forma de triángulo','Desde la raíz y le corrió sangre',0,0,1,0,0,'¿Juan tentaba sin cesar el diente roto?','Con la punta de la lengua','Con la punta del dedo índice','Con un algodón','Con el labio superior','Con el labio inferior',1,0,0,0,0,'El médico diagnosticó: - Su hijo, mi estimada Señora, sufre de:','Dolor por un diente roto','Hemorragia por el diente roto','Hemofilia por la excesiva fluidez de la sangre','Lo que hoy llamamos el mal de pensar','Tristeza por la pérdida del diente',0,0,0,1,0,'¿Quién era un pilluelo desarrapado?','Demóstenes','Edison','Juan Peña','Pedro Emilio Coll','Shakespeare',0,0,0,0,1,'¿Quién es el autor del cuento “El diente roto”?','Edison','Pedro Emilio Coll','Demóstenes','Shakespeare','Rafael',0,1,0,0,0,'550','33000',NULL),(36,'18','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LA COMUNICACIÓN<br>\r\nENTRE NEURONAS</strong></h3><p><strong><br></strong></p><p>Una neurona excitada (turquesa) aporta información a otras neuronas (violeta) generando\r\npotenciales de acción. Estas señales se propagan a lo largo del único axón de la célula, a modo\r\nde olas, y son convertidas n señales químicas en la sinapsis.\r\nCuando una neurona se halla en reposo, su membrana externa mantiene una diferencia de\r\npotencial de unos -70 milivolts (la superficie interior es negativa con respeto a la superficie\r\nexterior). La membrana de reposo es más permeable a los iones potasio que a los iones sodio,\r\ncomo indican las longitudes de las flechas negras del inserto del ángulo superior derecho.\r\nAl estimular la célula aumenta la permeabilidad al sodio, lo que provoca el paso de cargas\r\npositivas al interior (a).\r\nEste ingreso de carga dispara un impulso, esto es, una momentánea inversión del potencial de la\r\nmembrana (b). El impulso es iniciado en la unión del cuerpo celular con el axón y se desplaza\r\nalejándose del soma celular (flechas rojas).\r\nCuando el impulso alcanza los terminales axónicos de la neurona presináptica induce la\r\nliberación de neurotransmisores (abajo, a la izquierda), que se difunden a través de un estrecho\r\nintersticio y se enlazan en los receptores de la membrana postsináptica.\r\nProvocan con ello la apertura de canales iónicos y, con frecuencia, también la generación de\r\npotenciales de acción en la neurona postsináptica.\r\nPara mayor claridad, el tamaño de varios elementos no corresponde a su verdadera escala.<br></p>\r\n\r\n','Una neurona excitada aporta información a:','Iones de potasio','Iones de sodio','Otras neuronas','Otros nervios','Otros iones',0,0,1,0,0,' Los potenciales de acción son señales que se  propagan en forma de:','Ondas','Olas','Partículas','Corrientazos','Uniones',0,1,0,0,0,'Cuando una neurona se halla en reposo la  superficie interior de la membrana con  respecto a la exterior es:','Positiva','Neutra','Indiferente','Negativa','Ianal',0,0,0,1,0,' El ingreso de cargas positivas dispara un impulso que induce a:','La liberación de Neurotransmisores','El reposo de Neurotransmisores','La eliminación de Neurotransmisores','La contaminación de Neurotransmisores','El rechazo de Neurotransmisores',1,0,0,0,0,'La liberación de Neurotransmisores se difunden y enlazan los receptores de la membrana  postsináptica provocando:','La apertura de los canales iónicos y con frecuencia la generación de potenciales de acción','El cierre de los canales iónicos y de los potenciales de acción','El agotamiento de la membrana presináptica','El fortalecimiento de la membrana presináptica','Nada de lo anterior',1,0,0,0,0,'239','11423',NULL),(37,'18','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>LA COMUNICACIÓN<br>\r\nENTRE NEURONAS</strong></h3><p><strong><br></strong></p><p>Una neurona excitada (turquesa) aporta información a otras neuronas (violeta) generando\r\npotenciales de acción. Estas señales se propagan a lo largo del único axón de la célula, a modo\r\nde olas, y son convertidas n señales químicas en la sinapsis.\r\nCuando una neurona se halla en reposo, su membrana externa mantiene una diferencia de\r\npotencial de unos -70 milivolts (la superficie interior es negativa con respeto a la superficie\r\nexterior). La membrana de reposo es más permeable a los iones potasio que a los iones sodio,\r\ncomo indican las longitudes de las flechas negras del inserto del ángulo superior derecho.\r\nAl estimular la célula aumenta la permeabilidad al sodio, lo que provoca el paso de cargas\r\npositivas al interior (a).\r\nEste ingreso de carga dispara un impulso, esto es, una momentánea inversión del potencial de la\r\nmembrana (b). El impulso es iniciado en la unión del cuerpo celular con el axón y se desplaza\r\nalejándose del soma celular (flechas rojas).\r\nCuando el impulso alcanza los terminales axónicos de la neurona presináptica induce la\r\nliberación de neurotransmisores (abajo, a la izquierda), que se difunden a través de un estrecho\r\nintersticio y se enlazan en los receptores de la membrana postsináptica.\r\nProvocan con ello la apertura de canales iónicos y, con frecuencia, también la generación de\r\npotenciales de acción en la neurona postsináptica.\r\nPara mayor claridad, el tamaño de varios elementos no corresponde a su verdadera escala.<br></p>\r\n\r\n','Una neurona excitada aporta información  a otras neuronas generando:','Potenciales de acción','Potenciales de reacción','Reposo de acción','Reacción de reposo','Acciones de potencia',1,0,0,0,0,'Los potenciales de acción se propagan  en forma de olas y son convertidas en la  sinapsis en:','Señales eléctricas','Señales alternas','Señales continuas','Señales físicas',' Señales químicas',0,0,0,0,1,'La membrana en reposo es más permeable  a los iones de:','Potasio que a los de sodio','Sodio que a los de potasio','Es igual de permeable','No es permeable','Rechaza los iones',1,0,0,0,0,'Al ser estimulada la célula en reposo, aumenta  la permeabilidad al sodio y provoca el paso:','Cargas negativas al interior','Cargas negativas al exterior','Cargas positivas al exterior','Cargas positivas al interior','No provoca paso de carga alguna',0,0,0,1,0,'El ingreso de cargas positivas produce un impulso  que induce:',' La liberación de neurotransmisores','El reposo de neurotransmisores','La eliminación de neurotransmisores','La contaminación de neurotransmisores','El rechazo de neurotransmisores',1,0,0,0,0,'239','15141',NULL),(38,'19','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>LA CREATIVIDAD</strong></h3>\r\n\r\n<p>La creatividad es una de las funciones psíquicas de orden superior, es una de las que más\r\ndiferencian al hombre del resto de los seres vivos. Crear significa elaborar algo nuevo, distinto\r\ny de cierto valor. Hay personas más creativas que otras, de algunas decimos incluso que son\r\ngeniales, debido al gran valor de lo que crean dentro del campo artístico, científico, etc. A veces\r\nda la impresión de que algunos procesos creativos tuviesen algo de incomprensible, de mágico\r\nde sobrenatural. Resulta difícil comprender cómo es posible que algunos hombres sean capaces\r\nde crear cosas tan extraordinarias.</p><p>\r\nLos griegos atribuían la capacidad de crear grandes obras a la inspiración de las musas o de los\r\nmismos dioses. Durante mucho tiempo se relacionó la creación con la inspiración divina o con\r\nun don de Dios. Durante el Romanticismo se desarrolló plenamente el concepto de “genio”; los\r\ngrandes artistas eran seres superiores “geniales”, dotados de un don especial. Más tarde, y a la\r\nluz de los conocimientos de la moderna psicología, se fueron desarrollando diversas teorías que\r\nintentaron explicar desde otros puntos de vista los fenómenos creativos, alejándose de ese\r\nambiente mítico que rodeaba la creatividad.</p><p>\r\nCon la introducción del concepto del inconsciente, es decir, de la convivencia dentro de la vida\r\npsíquica individual de procesos que escapan a la conciencia de quien los posee, se desarrollaron\r\nteorías que entendían que en el proceso creativo intervenían mecanismos inconscientes mediante\r\nlos cuales, una persona acumulaba dentro de sí una serie de experiencias y conocimientos que,\r\nen un momento dado, se asociaban de forma adecuada, dando lugar a la creación, de forma más\r\no menos súbita, como en los llamados “fenómenos eureka” en que una especie de iluminación\r\nsurge como solución a un problema sin descifrar. Muchas veces estas soluciones surgen tras un\r\nperíodo de descanso, o tras un tiempo de pensar en el problema; en otras ocasiones se tiene la\r\nimpresión de que se ha resuelto tras el sueño o incluso durante el sueño. Por ejemplo, F. A. Von\r\nKekulé dijo haber descubierto mientras soñaba la estructura anular del benceno. Los ejemplos\r\nreferidos a la creatividad en el mundo del arte son muy numerosos. Esta actividad creativa\r\ndurante el sueño reforzaría el papel de los procesos inconscientes dentro de los creativos.</p><p>\r\nLa psicología conductista, desarrollada fundamentalmente por J. Watson, se ha interesado poco\r\npor la creatividad. Desde su punto de vista, las respuestas presuntamente creativas que se\r\nofrecen ante soluciones nuevas vienen a ser una réplica de otras similares que se vivieron con\r\nanterioridad; y cuando son realmente nuevas en todos sus componentes, se solucionan por\r\ncombinaciones aleatorias, es decir, combinando de diversas formas todas las posibles respuestas.</p><p>\r\nLa psicología cognitiva, por último, está intentando explicar los fenómenos creativos desde una\r\nnueva perspectiva. Weisberg, por ejemplo, defiende que el concepto del “genio creativo” es algo\r\npuramente mítico. Según su teoría, la creatividad no pasa de ser una actividad resultante de\r\nprocesos de pensamiento ordinarios de individuos absolutamente normales, que surgirían de\r\nforma progresiva (“incremental”) a partir de los intentos iniciales de resolver el problema. Por\r\ntanto, la creatividad surgiría en relación con una serie de conocimientos que esa persona tiene\r\ndel problema que trata de resolver, de modo que progresivamente se acercaría a la solución.</p><p>\r\n¿Cuál de todas estas teorías es la más acertada? Posiblemente todas tengan parte de razón. Tal\r\nvez no existan “genios”, entendidos como tales, pero no cabe duda de que existen personas más\r\ndotadas que otras desde el punto de vista de la creatividad. A veces, intervienen procesos\r\ninconscientes a la hora de crear, aunque también resulta necesaria una cierta preparación previa\r\nen la que cuentan experiencias similares vividas o resueltas con anterioridad y el mismo azar.\r\nCon todo, la creatividad sigue contando con cierto carácter sobrenatural y son los que continúan\r\ncreyendo en la fuerza de la inspiración.<br></p>','Según el autor crear significa:','Elaborar algo nuevo y de cierto valor','Elaborar algo nuevo y distinto','Elaborar algo nuevo, distinto y de cierto valor','Elaborar algo de gran valor dentro del campo  científico, artístico, etc.','Elaborar algo nuevo del campo artístico, científico  etc.',0,0,1,0,0,'¿Quiénes le atribuían a las musas o a los mismos  dioses la capacidad de crear grandes cosas?','Los romanos',' Los griegos','Los sabios','Los egipcios','Los genios',0,1,0,0,0,'Los llamados “fenómenos eureka” son:','Procesos creativos que solo se les vienen a los genios','Expresiones de los genios y sabios','Procesos desarrollados durante el romanticismo','Manifestaciones geniales de los sabios','Una especie de iluminación que surge como una  solución a un problema sin descifrar',0,0,0,0,0,'Weisberg defiende que el concepto de “Genio  Creativo” es algo:','Puramente místico','Puramente mítico','Puramente divino','Puramente humano','Puramente sabio',0,1,0,0,0,'Las respuestas creativas ante soluciones nuevas, son una  réplica de otras o combinaciones aleatorias de diversas  formas; es una teoría de la:','Psicología cognitiva','Psicología costumbrista','Psicología conductista','Psicología romántica','Psicología moderna',0,0,1,0,0,'647','38820',NULL),(39,'19','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>LA CREATIVIDAD</strong></h3>\r\n\r\n<p>La creatividad es una de las funciones psíquicas de orden superior, es una de las que más\r\ndiferencian al hombre del resto de los seres vivos. Crear significa elaborar algo nuevo, distinto\r\ny de cierto valor. Hay personas más creativas que otras, de algunas decimos incluso que son\r\ngeniales, debido al gran valor de lo que crean dentro del campo artístico, científico, etc. A veces\r\nda la impresión de que algunos procesos creativos tuviesen algo de incomprensible, de mágico\r\nde sobrenatural. Resulta difícil comprender cómo es posible que algunos hombres sean capaces\r\nde crear cosas tan extraordinarias.</p><p>\r\nLos griegos atribuían la capacidad de crear grandes obras a la inspiración de las musas o de los\r\nmismos dioses. Durante mucho tiempo se relacionó la creación con la inspiración divina o con\r\nun don de Dios. Durante el Romanticismo se desarrolló plenamente el concepto de “genio”; los\r\ngrandes artistas eran seres superiores “geniales”, dotados de un don especial. Más tarde, y a la\r\nluz de los conocimientos de la moderna psicología, se fueron desarrollando diversas teorías que\r\nintentaron explicar desde otros puntos de vista los fenómenos creativos, alejándose de ese\r\nambiente mítico que rodeaba la creatividad.</p><p>\r\nCon la introducción del concepto del inconsciente, es decir, de la convivencia dentro de la vida\r\npsíquica individual de procesos que escapan a la conciencia de quien los posee, se desarrollaron\r\nteorías que entendían que en el proceso creativo intervenían mecanismos inconscientes mediante\r\nlos cuales, una persona acumulaba dentro de sí una serie de experiencias y conocimientos que,\r\nen un momento dado, se asociaban de forma adecuada, dando lugar a la creación, de forma más\r\no menos súbita, como en los llamados “fenómenos eureka” en que una especie de iluminación\r\nsurge como solución a un problema sin descifrar. Muchas veces estas soluciones surgen tras un\r\nperíodo de descanso, o tras un tiempo de pensar en el problema; en otras ocasiones se tiene la\r\nimpresión de que se ha resuelto tras el sueño o incluso durante el sueño. Por ejemplo, F. A. Von\r\nKekulé dijo haber descubierto mientras soñaba la estructura anular del benceno. Los ejemplos\r\nreferidos a la creatividad en el mundo del arte son muy numerosos. Esta actividad creativa\r\ndurante el sueño reforzaría el papel de los procesos inconscientes dentro de los creativos.</p><p>\r\nLa psicología conductista, desarrollada fundamentalmente por J. Watson, se ha interesado poco\r\npor la creatividad. Desde su punto de vista, las respuestas presuntamente creativas que se\r\nofrecen ante soluciones nuevas vienen a ser una réplica de otras similares que se vivieron con\r\nanterioridad; y cuando son realmente nuevas en todos sus componentes, se solucionan por\r\ncombinaciones aleatorias, es decir, combinando de diversas formas todas las posibles respuestas.</p><p>\r\nLa psicología cognitiva, por último, está intentando explicar los fenómenos creativos desde una\r\nnueva perspectiva. Weisberg, por ejemplo, defiende que el concepto del “genio creativo” es algo\r\npuramente mítico. Según su teoría, la creatividad no pasa de ser una actividad resultante de\r\nprocesos de pensamiento ordinarios de individuos absolutamente normales, que surgirían de\r\nforma progresiva (“incremental”) a partir de los intentos iniciales de resolver el problema. Por\r\ntanto, la creatividad surgiría en relación con una serie de conocimientos que esa persona tiene\r\ndel problema que trata de resolver, de modo que progresivamente se acercaría a la solución.</p><p>\r\n¿Cuál de todas estas teorías es la más acertada? Posiblemente todas tengan parte de razón. Tal\r\nvez no existan “genios”, entendidos como tales, pero no cabe duda de que existen personas más\r\ndotadas que otras desde el punto de vista de la creatividad. A veces, intervienen procesos\r\ninconscientes a la hora de crear, aunque también resulta necesaria una cierta preparación previa\r\nen la que cuentan experiencias similares vividas o resueltas con anterioridad y el mismo azar.\r\nCon todo, la creatividad sigue contando con cierto carácter sobrenatural y son los que continúan\r\ncreyendo en la fuerza de la inspiración.<br></p>','Según el autor la creatividad es una de las  funciones:','Del cerebro','Psíquicas de todos los seres vivos',' Psíquicas de orden inferior','Psíquicas de orden superior','Del cerebelo',0,0,0,1,0,' ¿Cuándo se desarrolló plenamente el concepto  de Genio?:','En la época antigua','Durante la edad Media','Durante el Romanticismo','Durante el Renacimiento','Durante el Modernismo',0,0,1,0,0,'La creatividad como resultado de una serie de  experiencias y conocimientos asociados de  forma adecuada que escapan a la conciencia de  quien las posee, es una teoría:','De la psicología conductista',' De la psicología costumbrista','De la psicología cognitiva','De la psicología del inconsciente','De la psicología del consciente',0,0,0,1,0,'Según el autor. ¿Cuál de todas las teorías de la  creatividad es la más acertada?: ','Posiblemente la conductista','Posiblemente la costumbrista','Posiblemente la cognitiva','Posiblemente la consciente','Posiblemente todas tengan parte de razón',0,0,0,0,0,'¿Cómo se titula la lectura?:','Teoría de la creatividad','La creatividad… función psíquica','Psicología de la creatividad','La creatividad','Creatividad',0,0,0,1,0,'647','28820',NULL),(40,'20','PRUEBA DE COMPRENSIÓN A','<h3 style=\"text-align: center;\"><strong>USOS HABITUALES DEL<br>\r\nCORREO ELECTRÓNICO</strong></h3>\r\n\r\n<p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">Algunos recursos ayudan a ganar rapidez en los usos más\r\nfrecuentes del e-mail. En la utilización del correo, siempre hay personas con\r\nlas que el intercambio de mensajes es frecuente. Para evitar teclear la\r\ndirección entera en cada momento, podemos emplear un seudónimo. <o:p></o:p></p><p class=\"MsoNormal\">Para la asignación del seudónimo, hay que procurar seguir\r\nuna regla de forma que sea fácil recordar el que se ha asignado a una persona\r\nen cualquier ocasión. El seudónimo también puede ser empleado para enviar un\r\nmismo correo a una lista de direcciones. <o:p></o:p></p><p class=\"MsoNormal\">Para hacer esto, sólo tenemos que crear un seudónimo que\r\nhaga referencia a todas las direcciones que queramos. Si utiliza el correo\r\nelectrónico cotidianamente, puede ser que un usuario reciba varios mensajes\r\ndiarios. Para facilitar el manejo de los mensajes recibidos, existe la\r\nposibilidad de agrupar dichos mails en carpetas diferentes. <o:p></o:p></p><p class=\"MsoNormal\">Los programas de correo electrónico suelen dividir los\r\nmensajes entre grupos: enviados, recibidos y borrados. Sin embargo, el usuario\r\npuede definir tantas carpetas o subcarpetas como desee. De este modo,\r\nconseguirá disponer de los mensajes según el tema, el remitente, la fecha, etc.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><em>Filtros de Mensajes. <o:p></o:p></em></p><p class=\"MsoNormal\">Para evitar el bombardeo de mensajes publicitarios fenómeno\r\nconocido como -spam- y para no recibir mensajes de personas de las que no\r\nqueremos saber nada, en la mayoría de programas de correo electrónico podemos\r\nutilizar los filtros de mensajes. Esta herramienta no es más que un tamiz, por\r\nel que sólo pasan mensajes que realmente nos interesan.<o:p></o:p></p><p class=\"MsoNormal\">De esta manera, podemos borrar directamente de nuestro\r\nservidor aquellos e-mails que provengan de una determinada dirección, o bien\r\nlos que contengan ciertas palabras dentro del cuerpo del propio mensaje.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><em>La Respuesta.<o:p></o:p></em></p><p class=\"MsoNormal\">&nbsp;La manera más rápida\r\ny cómoda de responder a un mensaje, después de haberlo leído, es hacer clic en\r\nel botón Responder o Replan. El programa crea un nuevo mensaje con la dirección\r\ndel remitente y con el mismo tema, precedido habitualmente de la indicación Re:\r\nEsta opción también suele incluir el texto del mensaje recibido en el de\r\nrespuesta. <o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\">Esto le permite conocer al usuario destinatario exactamente\r\nqué texto hace referencia la respuesta, su origen y fecha. El mensaje\r\nrespondido también puede emplearse para intercalar entre sus líneas la\r\nrespuesta deseada. Así contestaremos al interlocutor por partes.<o:p></o:p></p>','Para evitar teclear la dirección entera en cada  momento al enviar un e-mail es necesario crear:','Un correo específico','Un correo de voz','Una dirección única','Una copia del correo','Un seudónimo',0,0,0,0,1,'Para facilitar el manejo de los mensajes recibidos existe la posibilidad de:','Agrupar los mails en una sola carpeta','Convertir los mails en documento de texto','Borrar los mails una vez leídos','Agrupar los e-mails en carpetas diferentes','Eliminar a diario los mails recibidos',0,0,0,1,0,'Para enviar un mismo mail a diferentes  direcciones debemos crear un seudónimo que:','Sea conocido por todas las direcciones','Continuamente esté manejando todas las direcciones','Haga referencia a todas las direcciones que queremos','Esté dentro de una red de cibernautas','Al enviar el mensaje, nos confirme el recibido del mismo',0,0,1,0,1,'Los programas de correo electrónico comúnmente  se dividen en:','Eliminados, borrados, recibidos','Borrados, enviados, guardados','Enviados, guardados, eliminados','Recibidos, enviados, borrados','Enviados, eliminados, borrados',0,0,0,1,0,'El usuario está limitado a definir:','Una sola carpeta','Tres carpetas','Cinco carpetas','Dos carpetas','Tantas, como desee',0,0,0,0,0,'377','22620',NULL),(41,'20','PRUEBA DE COMPRENSIÓN B','<h3 style=\"text-align: center;\"><strong>USOS HABITUALES DEL<br>\r\nCORREO ELECTRÓNICO</strong></h3>\r\n\r\n<p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">Algunos recursos ayudan a ganar rapidez en los usos más\r\nfrecuentes del e-mail. En la utilización del correo, siempre hay personas con\r\nlas que el intercambio de mensajes es frecuente. Para evitar teclear la\r\ndirección entera en cada momento, podemos emplear un seudónimo. <o:p></o:p></p><p class=\"MsoNormal\">Para la asignación del seudónimo, hay que procurar seguir\r\nuna regla de forma que sea fácil recordar el que se ha asignado a una persona\r\nen cualquier ocasión. El seudónimo también puede ser empleado para enviar un\r\nmismo correo a una lista de direcciones. <o:p></o:p></p><p class=\"MsoNormal\">Para hacer esto, sólo tenemos que crear un seudónimo que\r\nhaga referencia a todas las direcciones que queramos. Si utiliza el correo\r\nelectrónico cotidianamente, puede ser que un usuario reciba varios mensajes\r\ndiarios. Para facilitar el manejo de los mensajes recibidos, existe la\r\nposibilidad de agrupar dichos mails en carpetas diferentes. <o:p></o:p></p><p class=\"MsoNormal\">Los programas de correo electrónico suelen dividir los\r\nmensajes entre grupos: enviados, recibidos y borrados. Sin embargo, el usuario\r\npuede definir tantas carpetas o subcarpetas como desee. De este modo,\r\nconseguirá disponer de los mensajes según el tema, el remitente, la fecha, etc.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><em>Filtros de Mensajes. <o:p></o:p></em></p><p class=\"MsoNormal\">Para evitar el bombardeo de mensajes publicitarios fenómeno\r\nconocido como -spam- y para no recibir mensajes de personas de las que no\r\nqueremos saber nada, en la mayoría de programas de correo electrónico podemos\r\nutilizar los filtros de mensajes. Esta herramienta no es más que un tamiz, por\r\nel que sólo pasan mensajes que realmente nos interesan.<o:p></o:p></p><p class=\"MsoNormal\">De esta manera, podemos borrar directamente de nuestro\r\nservidor aquellos e-mails que provengan de una determinada dirección, o bien\r\nlos que contengan ciertas palabras dentro del cuerpo del propio mensaje.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><em>La Respuesta.<o:p></o:p></em></p><p class=\"MsoNormal\">&nbsp;La manera más rápida\r\ny cómoda de responder a un mensaje, después de haberlo leído, es hacer clic en\r\nel botón Responder o Replan. El programa crea un nuevo mensaje con la dirección\r\ndel remitente y con el mismo tema, precedido habitualmente de la indicación Re:\r\nEsta opción también suele incluir el texto del mensaje recibido en el de\r\nrespuesta. <o:p></o:p></p><p>\r\n</p><p class=\"MsoNormal\">Esto le permite conocer al usuario destinatario exactamente\r\nqué texto hace referencia la respuesta, su origen y fecha. El mensaje\r\nrespondido también puede emplearse para intercalar entre sus líneas la\r\nrespuesta deseada. Así contestaremos al interlocutor por partes.<o:p></o:p></p>','Para evitar el fenómeno –spam- es necesario  utilizar:','Un conector de Internet','Una contraseña','Una clave secreta','Un filtro de mensajes','Un navegador',0,0,0,1,0,'Los filtros de mensaje son:','Un grupo de cibernautas','Una ayuda para la búsqueda de información','Un mecanismo de defensa para los virus en Internet','Un medio de comunicación creado en la red','Una herramienta que nos muestra la información que realmente nos interesa',0,0,0,0,1,'La manera más rápida de responder un mensaje después de haberlo leído es:','Haciendo clic y editando el mensaje','Haciendo clic en el icono crear nuevo mensaje','Dándole clic al botón Replan','Dándole clic al botón enviar','Dar clic en el botón envío automático',0,0,1,0,0,'Al utilizar la opción de Respuesta o Replan, encontramos que este suele incluir:','Una nueva dirección de correo electrónico','Un mensaje con seudónimo','El texto de mensaje recibido','Una opción de respuesta si o no ','Un juego para aplicar a la red',0,0,1,0,0,'El sistema de Respuesta permite que el usuario destinatario conozca:','A qué hace referencia el texto','El usuario de origen','Fecha en que fue enviado','Todas las anteriores','Ninguna de las anteriores',0,0,0,1,0,'377','22620',NULL),(43,'22','THE BROKEN TOOTH','<p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">At the age of twelve, Juan Peña fighting against some rogues, received a\r\npebble over his teeth; the blood ran through his face washing the dirty of it\r\nand his tooth broke into a saw shape. From that day the golden age of Juan Peña\r\nbegins.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; letter-spacing: 0.2px;\">With the tip of his tongue, Juan teased the broken tooth; the motionless\r\nbody, with a wander, look- without thinking. Like troublemaker and quarrelsome,\r\nturned tranquil and quiet. Juan\'s parents, tired of hearing their neighbors and\r\npedestrian winnings, victims of the boy perversities, and they have been\r\nalready used all types of scolding and punishments, were now worried and\r\ndumbfounded for the sudden change of attitude of Juan.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; letter-spacing: 0.2px;\">Juan didn’t joke and remained for hours in a hieratic attitude, like in\r\nextasis, while there, inside of the darkness of his closed mouth, his tongue\r\nstroked the broken tooth -without thinking.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; letter-spacing: 0.2px;\">-The boy isn’t well, Pablo - said the husband’s wife-; we have to call\r\nthe doctor.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">The doctor arrived serious and plump and proceeded the diagnosis: Good\r\npulse, blood muffins, excellent appetite, no sickness symptoms. <o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">-Miss - said the wise one after a long diagnosis- the sanctity of my\r\nprofession imposes on me to declare before you…<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">- What, doctor of my soul? - interrupted the mother</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span style=\"font-family: Arial, sans-serif; font-size: 11pt; letter-spacing: 0.2px;\">-That your boy is healthier than an apple. What is arguable - continue\r\nwith a mysterious voice-, is that we are in front of the phenomenal case: Your\r\nson, my dearest lady, suffers from what we call it today the sickness of\r\nthinking; in short words, your son is an early sharp, a genius maybe.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">In the darkness of his mouth, Juan stroked the broken tooth - without\r\nthinking<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">Relatives and friends made running the voice of the doctor\'s opinion,\r\nwelcomed with unspeakable jubilee by Juan\'s parents. Soon in the town\r\neverything, the admirable case of the \"prodigy child\" was cited and\r\nhis fame increased like a paper swollen smoke bomb, Until the teacher from\r\nschool, that have considered him the hardest head of the world, submitted\r\nhimself to the general opinion because of the belief people\'s voice heavens voice.\r\nNonetheless, each one of them had an example: Demosthenes ate sand, Shakespeare\r\nwas a raggedy little runt, Edison… etc- <o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">Juan Peña grows up in the middle of open books before his eyes but he\r\ndidn’t read them, distracted to the task of his tongue touching his little saw\r\ntooth shape of the broken- without thinking.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">And with his body, his reputation of responsible man started to grow up,\r\nwise and “deep”, and nobody got tired of praising the wonderful talented Juan.\r\nIn his youth, the most beautiful women tried to flirt and seduce that superior\r\nsoul delivered to deep meditations, to the others; but in reality, deep in the\r\ndark of his mouth, he stroked the broken tooth - without thinking. <o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">Months and years passed and Juan Peña became deputy, academic, minister,\r\nand almost got crowned president of the republic, when the stroke surprised him\r\nwhen he stroking his broken tooth with the tip of his tongue.</span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: justify; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">And the bells tolled, and a rigorous national mourning was decreed; an\r\norator wept at a funeral prayer in the name of the country, and roses and tears\r\nfell on the grave of the great man who had had no time to think.</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: right; border: none;\"><span lang=\"ES-CO\" style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\">PEDRO EMILIO COLL (VENEZUELAN)<o:p></o:p></span></p>','Juan Peñas tooth broke?','In half','In three parts','Saw-shaped','In the form of a triangle','From the root and blood flowed',0,0,1,0,0,'Was Juan constantly tempting the broken tooth?','With the tip of his tongue','With the tip of the index finger','With a cotton','With the upper lip','With the lower lip',1,0,0,0,0,'The doctor diagnosed: - Your son, my dear Lady, is suffering from:','Pain from a broken tooth','Bleeding from broken teeth','Hemophilia due to excessive blood flow','What nowadays is called the sickness of thinking','Sadness over tooth loss',0,0,0,1,0,'Who was a raggedy little runt?','Demosthenes','Edison','Juan Peña','Pedro Emilio Coll','Shakespeare',0,0,0,0,1,'Who is the author of the story \"The Broken Tooth\"?','Edison','Pedro Emilio Coll','Demosthenes','Shakespeare','Rafael Pombo',0,1,0,0,0,'550','33000',NULL),(44,'1','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;text-align: center;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">FOOTBALL</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Great Britain was the cradle of modern football, derived from practices that were carried out for several centuries in Wales and England.</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In Cambridge University, the first football regulation was made in 1843 and the first official competitions were held in 1871, having reached this sport a rapid and great widespread. In 1882 the Manchester code was established, the basis of the current regulation, which was remodeled in 1938. Football in the twentieth century expanded throughout Europe and America, from Mexico to Argentina, to such an extent that Americans came to achieve world hegemony during long phases.</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The practice of soccer is based on the following scheme: two teams per squads of eleven players each operate on a field or pitch, for the possession and driving of a ball until it is placed in the opposite receptacle or goal of the two that exist, (one for each team).</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The field, playground or pitch, is a large rectangle 90-120 meters long per 45-90 meters wide. The fields for official competitions must be 100-110 meters long per 64-75 meters wide. The ground must be grass in official competitions, but in popular practices it is also played on land field and concrete, ()</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the center of each smaller side of the rectangle, delimited by a white line, are the goals, rectangles whose base is the grass and the rest of the three sides,&nbsp; both round wooden posts. from the upper angles back sides two curved iron bars that support</span><span style=\"font-size:2.25pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"> </span><span style=\"font-size:11pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">&nbsp;a mesh net, rope net, or plastic fiber. The goal has 7.32 meters of width per 2.44 meters of height.</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The ball is a spherical leather with an internal bladder filled with air or made of a plasticized rubberized material. Its dimensions are 68-71 centimeters in circumference and its weight of 396-453 grams.</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p><span id=\"docs-internal-guid-1f270e5b-7fff-5f06-26b3-1842e82e19d6\"></span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from ENCICLOPEDIA OCÉANO COLOR, issue 6th, Océano Grupo Editorial S. A</span></p>','Th