 the first football regulation was made in:','1871','1843','1950','1992','1882',0,1,0,0,0,'The dimensions of the ball must be:','68-71 cm of circumference and its weight of 396 - 453 grams','68-71 cm of circumference and its weight of 394-456 grams','68-85 cm of circumference and its weight if 390-450 grams','65-70 cm of circumference and its weight of 390-450 grams','65-70 cm of circumference and its weight of 396-456 grams',1,0,0,0,0,'312','18720',NULL),(46,'2','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">GUIDELINE IDEAS</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Many students do not learn, for the simple reason that they ignore what they should learn. Each of the sets of knowledge that constitute the subjects of a career or the conceptual background of a profession are divided and subdivided into data systems and relationships that form chapters.subchapters and paragraphs in the books that are exposed from.&nbsp; Each one of those sectors corresponds to one or more guidelines, that sometimes they appear in the section of the page or as the title of the paragraph, but in many textbooks - few didactics - are not sufficiently formulated.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In this case, as in ulteriorly reduced verbal explanation, the student must be concerned on discovering the idea of ​​the guiding thread of the teacher or exhibitor\'s thought, since, without that help, each of the points or phrases will have a higher or lesser relationship with the previous one and next one, but the whole sector will be meaningless.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Thus, as each fable has its moral, that is to say, its significant essence, each series of thought has a fundamental guideline or concept. Discovering it, when it is not in italics is conquering one of the essential factors of all cultural learning</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">If you, my fellow readers, dedicate on an hour of your day to the task of discovering, specify and formulating the guiding ideas of a few paragraphs of various texts, you will be exercised in a technique of abstraction and synthesis that will allow taking full advantage of any type of reading or subsequent study.</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Excerpted from “How to stay and learn” from Emilio Mira López.</span></p>','The author states that there are many students that do not learn by the simple reason of:','They ignored what they should learn','They do not pay the necessary attention','While they read they think in other things','They don\'t study at the right time','They do not spend they right amount of time to studying',1,0,0,0,0,'The subjects of a career, are divided and subdivided on the data system y relationships that form:','Chapters and paragraphs','Subchapters, paragraphs and subparagraphs','Chapters , subchapters and paragraphs','Subchapters and paragraphs','Chapters and subchapters',0,0,1,0,0,'It is essential that the student concerns about discovering the:','The idea of ​​the guiding thread','The main idea and and which would complement it in order to discover the mother idea','The  main idea','The complementary idea','The general concept',1,0,0,0,0,'Discovering a guideline, when it is not in italics is like:','conquering one of the essential factors of all cultural learning','achieve the solution of all learning problems','Reach the maximum level of out mental faculties','Finding the significative essense of the text','Achieve a technique of abstraction and synthesis',1,0,0,0,0,'The author propose a task of finding , specify and formulate the guidelines ideas:','Un hour of practice per day','Una hour of practice per week','Two hours of practice each day','Four hours of practice per week','-',1,0,0,0,0,'265','15900',NULL),(47,'2','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">GUIDELINE IDEAS</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Many students do not learn, for the simple reason that they ignore what they should learn. Each of the sets of knowledge that constitute the subjects of a career or the conceptual background of a profession are divided and subdivided into data systems and relationships that form chapters.subchapters and paragraphs in the books that are exposed from.&nbsp; Each one of those sectors corresponds to one or more guidelines, that sometimes they appear in the section of the page or as the title of the paragraph, but in many textbooks - few didactics - are not sufficiently formulated.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In this case, as in ulteriorly reduced verbal explanation, the student must be concerned on discovering the idea of ​​the guiding thread of the teacher or exhibitor\'s thought, since, without that help, each of the points or phrases will have a higher or lesser relationship with the previous one and next one, but the whole sector will be meaningless.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Thus, as each fable has its moral, that is to say, its significant essence, each series of thought has a fundamental guideline or concept. Discovering it, when it is not in italics is conquering one of the essential factors of all cultural learning</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">If you, my fellow readers, dedicate on an hour of your day to the task of discovering, specify and formulating the guiding ideas of a few paragraphs of various texts, you will be exercised in a technique of abstraction and synthesis that will allow taking full advantage of any type of reading or subsequent study.</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Excerpted from “How to stay and learn” from Emilio Mira López.</span></p>','The author conceives as a guiding idea:','The essence of learning','The quantity of paragraphs in a text','The thread of thought','The title of a paragraph','The cultural learning',0,0,1,0,0,'Which is the technique that the author poses in order to make the most out of a reading?:','The retention of ideas','Chapter synthesis','Text abstraction','Retention and abstraction','Synthesis and abstraction',0,0,0,0,1,'In a text the guideline idea may figured in a:','Subchapter','A paragraph','A paragraph','The title','The chapter',0,0,1,0,1,'Name that is given to a knowledge base:','Profession','Career','Subject','Conceptual baggage','Data system',0,0,0,1,0,'Which is the objective of a guideline idea?:','Disconnect sentences from the paragraph','Encode a sentence','Analyze the text','To connect the teacher with the text','Find the essence of the text',0,0,0,0,0,'265','15900',NULL),(48,'3','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;margin-right: -12pt;text-align: center;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">RELATIONSHIP BETWEEN BOYS AND GIRLS</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When the child is old enough to enter into social relations with other children, a distinction between boys and girls are not likely to appear. Boys and girls play together and enjoy much the same activities. Even at the preschool level, however, some distinctions and differences appear. Boys tend on the average to be somewhat more active in their play, although differences within each sex group are larger than the differences between the two sexes. At the ages of three and four boys enter into a larger number of conflicts than do girls and are more likely to resort to hitting. In a mixed group, it also appears that boy-boy and girl-girl conflicts are likely to be more numerous than friendships between a boy and a girl. However, even though children prefer playmates of their own sex, there is a good deal of interplay, and at this clear age, the child is not likely to be disturbed if he is in a group in which all members are of the opposite sex.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Some other differences between boys and girls:&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Other differences can also be observed that can directly or indirectly influence the social habits and behavior of children. Girls are somewhat superior in terms of early language development. From an early age, they tend to show more interest than children for other people and social relationships, while boys tend to show more interest in things and mechanical artifacts.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In many ways, men integrate the weakest of the sexes, at least during the first years of life. Child mortality among them is somewhat higher and the development of their skeleton is somewhat slower. Girls do not pose behavioral problems as often or as much as boys, and the number of girls who have pronunciation problems or reading difficulties is less than boys. Boys generally outnumber girls a lot in the amount \"troubled children\", both at school and in the out-of-school criminal population.</span></p><p><strong><br></strong></p>