re stronger','That girls have less problems of pronunciation and reading','That society considers the boy superior','That boys have greater freedom to express their feelings','Girls are more awake than boys',0,0,0,1,0,'393','23580',NULL),(49,'3','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;margin-right: -12pt;text-align: center;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:#f8f9fa;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">RELATIONSHIP BETWEEN BOYS AND GIRLS</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When the child is old enough to enter into social relations with other children, a distinction between boys and girls are not likely to appear. Boys and girls play together and enjoy much the same activities. Even at the preschool level, however, some distinctions and differences appear. Boys tend on the average to be somewhat more active in their play, although differences within each sex group are larger than the differences between the two sexes. At the ages of three and four boys enter into a larger number of conflicts than do girls and are more likely to resort to hitting. In a mixed group, it also appears that boy-boy and girl-girl conflicts are likely to be more numerous than friendships between a boy and a girl. However, even though children prefer playmates of their own sex, there is a good deal of interplay, and at this clear age, the child is not likely to be disturbed if he is in a group in which all members are of the opposite sex.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Some other differences between boys and girls:&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Other differences can also be observed that can directly or indirectly influence the social habits and behavior of children. Girls are somewhat superior in terms of early language development. From an early age, they tend to show more interest than children for other people and social relationships, while boys tend to show more interest in things and mechanical artifacts.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In many ways, men integrate the weakest of the sexes, at least during the first years of life. Child mortality among them is somewhat higher and the development of their skeleton is somewhat slower. Girls do not pose behavioral problems as often or as much as boys, and the number of girls who have pronunciation problems or reading difficulties is less than boys. Boys generally outnumber girls a lot in the amount \"troubled children\", both at school and in the out-of-school criminal population.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In some aspects, it seems during development it is more difficult to be a boy than a girl (although it would also be possible to document the opposite conclusion). The main difference may be, however, that hopes and social pressures are such that boys have more freedom to express their feelings, and to rebel frankly and clearly show their setbacks and concerns.</span></p><p><br><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Extracted from the book: Child Psychology. Author Arthur T. Jersild</span></p>','From what age do children make sex distinctions:','From five years old','From two years old','From seven years old','Since the first year old','From six years old',0,1,0,0,0,'In the text it is mentioned that at preschool are more friendships between:','Boy-Girl; Boy-Boy','Girls-Boys; Girl-Girl','Boy-Boy; Boys-Girls','Girl-Girl;Boy-Boy','All of the above',0,0,0,1,0,'In the describe differences it is find that girls have:','Greater understanding','Less skill for reading','Higher capacity for mechanical work','Lesser problems with pronunciation and reading','Greater freedom to express their feelings',0,0,0,1,0,'A difference find between boys relationships and girls relationships are:','Their lower skills to develop mechanical works','Their quickly physical development','Their higher interest for social relationships','Their difficulty in order to express their feelings','Their slower language development',0,0,0,0,0,'The author says that children prefer having playmates to:','Children two years older than them','Children with good behaviour','Children with they same sex','Children from the opposite sex','-',0,0,1,0,0,'393','23580',NULL),(50,'4','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">MUSIC AS EXPRESSION</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">We have seen that there is no reason to believe that uniqueness implies isolation. Poetic experiences are quite as unique as musical experiences, but nobody imagines that they form a closed world of their own, that they are wholly dissociated from the rest of the poet’s nature and form his experience of life. It is true that , for the appreciation of a work of art in any medium, special sensibilities are required, and such sensibilities can be pleasurably exercised in almost complete independence of any other interests. Thus much as existing in a moral and spiritual vacuum; it has, so to say, almost no discoverable context. Here the specific poetic sensibilities are being \"for their own sakes\". Music, much more than poetry, affords specimens of works which lead this curiosity independent existence, but it need be no more true of music than of poetry that it must be essentially meaningless. If, therefore, we find that some compositions irresistibly suggest to us some spiritual context we need not resist this impulse on theoretical grounds. We don\'t need to suppose that we are the victims of a literary culture and an imperfectly developed music in the world, and some of the worst , does suggest a spiritual context, It does more than suggest ; its whole being is conditioned by this context, and it lives to express it. This context is directly perceived even by those who, for theoretical reasons, do not explicit admit its existence. The most ardent advocate of the isolation theory will, for example, describe one composition as more \"profound\" than another, will describe one melody as \"noble\" and another as \"sentimental\". Such judgments are incompatible with isolation theory, for on that theory&nbsp; nothing could be said except that apiece of music afforded a greater or less degree of a unique and incommunicable pleasure. A composition could be no more profound or noble or sentimental than a wine. Yet such judgment, in the case of many compositions, are quite unavoidable.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">If this be admitted we may, for our present purposes, divide musical compositions into three classes. We may admit that, so far as our present analysis penetrated, there are compositions which exist isolation. Secondly , there are composition which spring from a spiritual context and express spiritual experiences. And, thirdly, there is the class of music ordinarily called programme music. Of these classes the second is the most important.</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Extracted from “Beethoven” by J.W.N</span></p>','In order to appreciate art it is precisely to: ','Be an artist','Let yourself lose to the art','Have special sensibility','Be a musician','Be born an artist',0,0,1,0,0,'Some musical compositions have:','No context at all','Don’t have spiritual content','Very independent but with spiritual context','Without artistic content','Only artistic content',0,0,1,0,0,'The goal of every musical composition is:','To express spiritual content','Please the listener for the technical perfection','To satisfy the listener','To obtain utility','-',1,0,0,0,0,'The qualifiers as “noble” and “sentimental” are related with the isolation theory:','Incompatible','Concordant','Coherent','Communicable','Compatible',1,0,0,0,0,'From the three musical compositions classes the most important are:','The ones that exist in isolation','The ones that express spiritual experiences','The ones that describe images','The ones that do not exist on isolation','The ones that do not describe images',0,1,0,0,0,'434','26040',NULL),(51,'4','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">MUSIC AS EXPRESSION</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">We have seen that there is no reason to believe that uniqueness implies isolation. Poetic experiences are quite as unique as musical experiences, but nobody imagines that they form a closed world of their own,