;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">If this be admitted we may, for our present purposes, divide musical compositions into three classes. We may admit that, so far as our present analysis penetrated, there are compositions which exist isolation. Secondly , there are composition which spring from a spiritual context and express spiritual experiences. And, thirdly, there is the class of music ordinarily called programme music. Of these classes the second is the most important.</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Extracted from “Beethoven” by J.W.N</span></p>','According to the author the poetry of Spencer has a content:','Decipherable','Spiritual','Subliminal','Indecipherable','Moral',0,0,0,1,0,'The reading title is:','The expression of the music','Musical experiences','Music and expression','The musical expression','Music as expression',0,0,0,0,1,'The reading speaks about every big composition of the world, and also some of the worst, it suggest a content:','Sentimental','Moral','Spiritual','Subliminal','Conceptual',0,0,1,0,0,'It is say that there are compositions that exists in:','The isolation','The being itself','The nature of things','The reality','The daily life',1,0,0,0,0,'The author divides the musical compositions in three and he says that the most important are:','The ones that exists in isolation','The ones that sprout from a spiritual content','The ones that have a sentimental content','The so call descriptived','The ones that are based on a culture',0,1,0,0,0,'434','26040',NULL),(52,'5','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE BROKEN TOOTH</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">At the age of twelve, Juan Peña fighting against some rogues, received a pebble over his teeth; the blood ran through his face washing the dirty of it and his tooth broke into a saw shape. From that day the golden age of Juan Peña begins.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">With the tip of his tongue, Juan teased the broken tooth; the motionless body, with a wander, look- without thinking. Like troublemaker and quarrelsome, turned tranquil and quiet. Juan\'s parents, tired of hearing their neighbors and pedestrian winnings, victims of the boy perversities, and they have been already used all types of scolding and punishments, were now worried and dumbfounded for the sudden change of attitude of Juan.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Juan didn’t joke and remained for hours in a hieratic attitude, like in extasis, while there, inside of the darkness of his closed mouth, his tongue stroked the broken tooth -without thinking.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">-The boy isn’t well, Pablo - said the husband’s wife-; we have to call the doctor.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The doctor arrived serious and plump and proceeded the diagnosis: Good pulse, blood muffins, excellent appetite, no sickness symptoms.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">-Miss - said the wise one after a long diagnosis- the sanctity of my profession imposes on me to declare before you…</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- What, doctor of my soul? - interrupted the mother</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">-That your boy is healthier than an apple. What is arguable - continue with a mysterious voice-, is that we are in front of the phenomenal case: Your son, my dearest lady, suffers from what we call it today the sickness of thinking; in short words, your son is an early sharp, a genius maybe.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the darkness of his mouth, Juan stroked the broken tooth - without thinking</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Relatives and friends made running the voice of the doctor\'s opinion, welcomed with unspeakable jubilee by Juan\'s parents. Soon in the town everything, the admirable case of the \"prodigy child\" was cited and his fame increased like a paper swollen smoke bomb, Until the teacher from school, that have considered him the hardest head of the world, submitted himself to the general opinion because of the belief people\'s voice heavens voice. Nonetheless, each one of them had an example: Demosthenes ate sand, Shakespeare was a raggedy little runt, Edison… etc-&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Juan Peña grows up in the middle of open books before his eyes but he didn’t read them, distracted to the task of his tongue touching his little saw tooth shape of the broken- without thinking.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">And with his body, his reputation of responsible man started to grow up, wise and “deep”, and nobody got tired of praising the wonderful talented Juan. In his youth, the most beautiful women tried to flirt and seduce that superior soul delivered to deep meditations, to the others; but in reality, deep in the dark of his mouth, he stroked the broken tooth - without thinking.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Months and years passed and Juan Peña became deputy, academic, minister, and almost got crowned president of the republic, when the stroke surprised him when he stroking his broken tooth with the tip of his tongue.</span></p><p><span style=\"background-color: transparent; color: rgb(14, 16, 26); font-family: Arial; font-size: 12pt; white-space: pre-wrap; letter-spacing: 0.2px;\"><br></span></p><p><span style=\"background-color: transparent; color: rgb(14, 16, 26); font-family: Arial; font-size: 12pt; white-space: pre-wrap; letter-spacing: 0.2px;\">And the bells tolled, and a rigorous national mourning was decreed; an orator wept at a funeral prayer in the name of the country, and roses and tears fell on the grave of the great man who had had no time to think.&nbsp;</span><br></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 12pt; white-space: pre-wrap; letter-spacing: 0.2px;\"><br></span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 12pt; white-space: pre-wrap; letter-spacing: 0.2px;\">PEDRO EMILIO COLL (VENEZUELAN)</span><br></p>','Juan Peña’s tooth broke:','In a half','In three parts','In saw shape','In a Triangle shape','From his nose and blood came out',0,0,1,0,0,'Juan Peña endlessly teased the broken tooth:','With the tip of his tongue','With the tip of his finger','With some cotton','With the upper lip','With the lower lip',1,0,0,0,0,'The medic diagnosed : - your son , my dearest lady, suffers of:','Pain from a broken tooth','Bleed from the broken tooth','Hemophilia due to excessive blood flow','What nowadays is called the sickness of thinking','Sadness due to the loss of his tooth',0,0,0,1,0,'Who was a raggedy little runt?','Demostenes','Edison','Juan Peña','Pedro Emilio Coll','Shakespeare',0,0,0,0,0,'Who is the author of “the broken tooth”?','Edison','Pedro Emilio Coll','Demostenes','Shakespeare','Rafael Pombo',0,1,0,0,0,'557','33420',NULL),(53,'5','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE BROKEN TOOTH</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;