n-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">PEDRO EMILIO COLL (VENEZUELAN)</span></p>','Juan Pena lost his tooth for:','Not brushing his teeth','A fight','Eating a lot of candy','Not going to the Dentist','Being a glutton',0,1,0,0,0,'Juan Peña\'s parents were there before the sudden transformation: ','Cheerful','Fearful','Distressed','Happy','Tired',0,0,1,0,0,'The people cited the admirable case of the:','Child Genius','Philosophical child','Premature child','Early Childhood','Child prodigy',0,0,0,0,0,'What was the position to which John was to be nominated when he was struck by the stroke:','Minister','Representative','President','Academic','Mayor',0,0,1,0,0,'Why didn\'t Juan have time?:','To be a writer','To become a speaker','To cry','To think','To touch your tooth ',0,0,0,1,0,'557','33420',NULL),(54,'6','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">PANAMA CANAL</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Since its opening until nowadays the Canal has seen circulate more than 700 ships, with differents sizes, charges and nationalities. Each ship must pay a toll according to the net tonnage . The highest toll paid for any vessel corresponded to the Star Princess, which in October 1990 had to contribute a total of $ 120,439. 20. The lowest, in 1928, went to Richard Halliburton, who paid $ 0.63, for swimming from one ocean to another. The average traffic of the Canal, which has a total distance of 80km, takes about ten hours, record time obtained thanks to the modernization of the basic design, the channel has been widened, straightened and deepened, while it has managed to cut the reconditioning time of the locks.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The ships that pass through the Canal are raised and descended 26 meters, from sea level to sea level, by means through a system of three sets of locks. The movement is made through fresh water from the Gatun and Miraflores lakes. To do this, the vessels must shut down their engines or leave them at minimum power to be driven by a series of specialized cranes that are on parallel rails, on the side and side of the boat.</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The process, is supervised from the ship\'s control cabin, it must be strictly carried out by staff belonging to the Canal.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The passage through the Gaillard cut is perhaps the most interesting part of the trip. This 14.5km long stretch, mostly excavated in solid rock, gives the Canal the impression of being a huge ditch. At this point you can see the Cerro de Oro, the highest promontory of the entire Canal (200 meters above sea level). The movement of the ships is done by combining the horizontal and vertical directions, going down or going up from a sluice into a sluice, crossing a wonderful water bridge surrounded by tropical rainforest, silent witness to the progress of man.</span></p><p><br><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">Taken from magazine : EL MUNDO AL VUELO</span><br></p>','The higher toll paid by any vessel corresponds to: ','Titanic','Gloria ship','Star Princess','Queen Elizabeth','Alcatraz',0,0,1,0,0,'The Panama Canal has a total distance of:','180 Kilometers','60 Kilometers','90 Kilometers','80 Kilometers','128 Kilometers',0,0,0,1,0,'The movement is made through fresh water from the lakes:','Gatun and Miraflores','Ttiticaca and Blanco lake','Erie and Ontario','San Martin and Fontana lake','Villarica and Colica',1,0,0,0,0,'The highest promontory of the entire Panama Canal is: ','Cerro de Monserrate','Cerro de Colorado','Cerro del Oro','Cerro de Pacande','Cerro Pan de Azucar',0,0,1,0,0,'The passage through the Gaillard cut is perhaps the most interesting part of the trip and has','15 kilometers','14.5 kilometers','8 kilometers','120 kilometers','6.9 kilometers',0,1,0,0,0,'330','19800',NULL),(55,'6','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">PANAMA CANAL</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Since its opening until nowadays the Canal has seen circulate more than 700 ships, with differents sizes, charges and nationalities. Each ship must pay a toll according to the net tonnage . The highest toll paid for any vessel corresponded to the Star Princess, which in October 1990 had to contribute a total of $ 120,439. 20. The lowest, in 1928, went to Richard Halliburton, who paid $ 0.63, for swimming from one ocean to another. The average traffic of the Canal, which has a total distance of 80km, takes about ten hours, record time obtained thanks to the modernization of the basic design, the channel has been widened, straightened and deepened, while it has managed to cut the reconditioning time of the locks.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The ships that pass through the Canal are raised and descended 26 meters, from sea level to sea level, by means through a system of three sets of locks. The movement is made through fresh water from the Gatun and Miraflores lakes. To do this, the vessels must shut down their engines or leave them at minimum power to be driven by a series of specialized cranes that are on parallel rails, on the side and side of the boat.</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The process, is supervised from the ship\'s control cabin, it must be strictly carried out by staff belonging to the Canal.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The passage through the Gaillard cut is perhaps the most interesting part of the trip. This 14.5km long stretch, mostly excavated in solid rock, gives the Canal the impression of being a huge ditch. At this point you can see the Cerro de Oro, the highest promontory of the entire Canal (200 meters above sea level). The movement of the ships is done by combining the horizontal and vertical directions, going down or going up from a sluice into a sluice, crossing a wonderful water bridge surrounded by tropical rainforest, silent witness to the progress of man.</span></p><p><br><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">Taken from magazine : EL MUNDO AL VUELO</span><br></p>','Which was one the toll most paid for vessel:','Us. $100. 459. 20','Us $ 120. 439. 20','Us $120. 429 . 20','Us $ 110. 439. 20','Us $ 120. 359. 10',0,1,0,0,0,'The ships that pass through the Canal are raised and descended in:','18 meters from sea level to sea level','10 meters from sea level to sea level','26 meters from sea level to sea level','16 meters from sea level to sea level','20 meter from sea level to sea level',0,0,1,0,0,'The average traffic of the Canal takes about:','5 hours','12 hours','7 hours','8 hours','10 hours',0,0,0,0,0,'Date when the lowest toll was paid:','1992','1982','1990','1928','1918',0,0,0,1,0,'The highest promontory of the entire Canal can be find in: ','120 meters above sea level','200 meters above sea level','210 meter above sea level','180 meters above sea level','160 meters above sea level',0,1,0,0,0,'330','19800',NULL),(56,'7','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE WATER</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">From a chemical point of view, water is the combination of two atoms of hydrogen and one of oxygen (H2O) and is defined as an odorless, colorless and tasteless element. And this is how it is in its purest form. But this state is only found in the laboratory and it is also a toxic element. Water, as man knows it, is the result of the sum of various elements to the basic formula of the specimen. These elements come from the particles that are added to it - given its property as a large solvent - from the moment it evaporates it is stored in the biosphere to then fall in the form of rain, pass through different soils and deposit in the corresponding place ( river, sea, lake, reservoir, aquifer).All water are indeed different , while they grouped in two different qualities.The so called hard water that contain large amount of salts, and the so call soft water, which its carbonation ratio is minor&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the other hand, water has a great thermal capacity, that is, it preserves the color very well, which contributes to reducing the differences in temperature in different places.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Besides, its high surface tension facilitates the phenomenon of capillarity, whereby plants absorb moisture and salts from the soil.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Finally, it is worth mentioning that the body of living beings is formed in its highest proportion of water, and, for example, this element in man constitutes 70 percent of its organism.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The amount of water on the earth is constant, although its location varies. It has been estimated that the water contained in the atmosphere does not exceed 0.001 percent of the total planet that amounts to 1,337 million cubic kilometers. These are spread over oceans, continental ice, glacial valleys, groundwater, rivers and lakes</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from Encyclopedia OCEANO COLOR . ISSUE 5</span></p>','The water is made of:','2 Oxygen atoms and 1 Hydrogen atom','2 Hydrogen atoms and 1 Oxygen atom','1 Nitrogen atoms and 1 Oxygen atom','2 Oxygen atoms and 1 Nitrogen atom','2 Hydrogen atoms and 2 Oxygen atoms',0,1,0,0,0,'The water is an element: ','Odorless, colorless and tasteless','Colorless and tasteless','Tasteless and odorless','Odorless and colorless','Insoluble, colorless and odorless',1,0,0,0,0,'When the water evaporates it is stored in:','The Atmosphere','The Stratosphere','Biosphere','The Soil','The Subsoil',0,0,1,0,1,'It is true that all waters are different, while they grouped in two different qualities: ','Hard water and soft water','Carbonated water and salt water','Pure water and toxic water','Thermal water and rainwater','Hard water and thermal water',1,0,0,0,0,'This element in man constitutes:','60 percent of water','50 percent of water','80 percent of water','30 percent of water','70 percent of water',0,0,0,0,0,'307','18420',NULL),(57,'7','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE WATER</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">From a chemical point of view, water is the combination of two atoms of hydrogen and one of oxygen (H2O) and is defined as an odorless, colorless and tasteless element. And this is how it is in its purest form. But this state is only found in the laboratory and it is also a toxic element. Water, as man knows it, is the result of the sum of various elements to the basic formula of the specimen. These elements come from the particles that are added to it - given its property as a large solvent - from the moment it evaporates it is stored in the biosphere to then fall in the form of rain, pass through different soils and deposit in the corresponding place ( river, sea, lake, reservoir, aquifer).All water are indeed different , while they grouped in two different qualities.The so called hard water that contain large amount of salts, and the so call soft water, which its carbonation ratio is minor&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the other hand, water has a great thermal capacity, that is, it preserves the color very well, which contributes to reducing the differences in temperature in different places.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Besides, its high surface tension facilitates the phenomenon of capillarity, whereby plants absorb moisture and salts from the soil.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Finally, it is worth mentioning that the body of living beings is formed in its highest proportion of water, and, for example, this element in man constitutes 70 percent of its organism.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The amount of water on the earth is constant, although its location varies. It has been estimated that the water contained in the atmosphere does not exceed 0.001 percent of the total planet that amounts to 1,337 million cubic kilometers. These are spread over oceans, continental ice, glacial valleys, groundwater, rivers and lakes</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from Encyclopedia OCEANO COLOR . ISSUE 5</span></p>','There are called har waters the ones that:','Have minor carbonation ratio','Have lower amount of oxygen','Have higher ratio of salt','They have more hydrogen','They have greater thermal capacity',0,0,1,0,0,'Amount of water contained on the planet:','1.3337 millions cubic kilometers','1.225 millions cubic kilometers','1.237 millions cubic kilometers','1.137 million cubic kilometers','1.333 million cubic kilometers',1,0,0,0,0,'The volume of water on earth is: ','Proportional','Equivalent','Variable','Constant','Parallel',0,0,0,1,0,'Phenomenon by which plants absorb moisture and salts from the soil:','Photosynthesis','Chlorophyll','Hydration','Capillarity','Infussion',0,0,0,1,0,'Water property that allows covert it from toxic element to beneficial element:','Thermic','Colorless','Steamy','Solvent','Diluent',0,0,0,1,0,'307','18420',NULL),(58,'8','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">TENNIS</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">As it is known today, tennis began to be practiced in Great Britain around 1873, with some stability established by Commander Wingfield, who, after boosting the sport in India, promoted it in his own country. In 1875 he assumed the name Lawn-tennis.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Tennis consists of driving a ball by hitting it with a racket and passing it over a net trying not to exceed the lines that delimit the track and naturally trying to disorient the opponent, preventing him from returning it or returning it wrongly committing it.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The field is a completely smoothed rectangle 23.79 m long and 8.23 ​​m wide. In the center of the major sides a network divides it into two halves, each of which is the scope of a player or two (doubles or pairs). The net is suspended on the ground, separated from it by 9.15 cm away and tensioned by two 1.06 m posts placed 9.15 cm from the sideline of the field. The space between the single line and the double line is called the corridor.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The ball is made of rubber covered with thick plush fabric with a diameter of 6.35 - 6.67cm and a weight of 56.70 grams. The racket consists of an oval arch with a grid of hard fiber cord tensioned longitudinally and horizontally, composing an inaccurate grid that hits the ball. In one of its bases a handle with a specific final section or handle starts.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The throwing of a player is answered on the contrary after the ball bounces only once in his field or without waiting for it, with a blow called volley.</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When the return stumbles on the net or exceeds the lines of the opposing field, a foul is committed, and if it touches the line it is considered good.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Each game is named set and ends when one of the players has made six faults, except if they are tied up to 5 , then the set is extended until seven faults. Normally the match are made up of three or five sets and are earned by who manages to win, two out of three or three out of five sets. The types of known shots are: Drive, hit the racket on the opposite side of the hitting arm; backhand, given by moving the racket to the opposite side of the hitting arm; and the smash, hit with the racket lifted vertically and chopped down.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from ENCICLOPEDIA “OCEANO COLO TOMO VI”</span></p>','The tennis as is known today started to being practiced in:','Great Britain in 1873','Spain in 1876','Ireland in 1958','Japan in 1945','United States in 1837',1,0,0,0,0,'The fields is a rectangle of the following dimensions:','25.98 m per 9.76 m','17.98 m per 8.23 m','23.79 m per 8.23 m','24.70 m per 6.23 m','16.67 m per 6.86 m',0,0,1,0,0,'The space between the single line and the double line is called:','Player scopre','Corridor','Handle','Post','Lateral line',0,1,0,0,0,'Each match is made up of:','Two sets','Four sets','Two and six sets','One and three sets','Three or five sets',0,0,0,0,0,'The types of shots known are:','Drive, lawn-tennis and sets','Smash and drive','Drive, smash and backhand','Backhand and fault','Backhand, smash and out',0,0,1,0,0,'410','24600',NULL),(59,'8','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">TENNIS</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">As it is known today, tennis began to be practiced in Great Britain around 1873, with some stability established by Commander Wingfield, who, after boosting the sport in India, promoted it in his own country. In 1875 he assumed the name Lawn-tennis.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Tennis consists of driving a ball by hitting it with a racket and passing it over a net trying not to exceed the lines that delimit the track and naturally trying to disorient the opponent, preventing him from returning it or returning it wrongly committing it.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The field is a completely smoothed rectangle 23.79 m long and 8.23 ​​m wide. In the center of the major sides a network divides it into two halves, each of which is the scope of a player or two (doubles or pairs). The net is suspended on the ground, separated from it by 9.15 cm away and tensioned by two 1.06 m posts placed 9.15 cm from the sideline of the field. The space between the single line and the double line is called the corridor.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The ball is made of rubber covered with thick plush fabric with a diameter of 6.35 - 6.67cm and a weight of 56.70 grams. The racket consists of an oval arch with a grid of hard fiber cord tensioned longitudinally and horizontally, composing an inaccurate grid that hits the ball. In one of its bases a handle with a specific final section or handle starts.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The throwing of a player is answered on the contrary after the ball bounces only once in his field or without waiting for it, with a blow called volley.</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When the return stumbles on the net or exceeds the lines of the opposing field, a foul is committed, and if it touches the line it is considered good.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Each game is named set and ends when one of the players has made six faults, except if they are tied up to 5 , then the set is extended until seven faults. Normally the match are made up of three or five sets and are earned by who manages to win, two out of three or three out of five sets. The types of known shots are: Drive, hit the racket on the opposite side of the hitting arm; backhand, given by moving the racket to the opposite side of the hitting arm; and the smash, hit with the racket lifted vertically and chopped down.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from ENCICLOPEDIA “OCEANO COLO TOMO VI”</span></p>','Name that was given in 1875:','Wing-Tennis','Table Tennis','Lawn-Tennis','Court Tennis','Net Tennis',0,0,1,0,0,'The measure of the net posts is:','9.15 cm','6.05 cm','6.07 cm','1.05 m','1.06 m',0,0,0,0,1,'The weight of the ball is: ','56.70 gramms','50.76 gramms','56.76 gramms','50.70 gramms','55.76 gramms',1,0,0,0,0,'Name that is given to each game is:','Drive','Shot','Smash','Set','Out',0,0,0,1,0,'The regular is that the game finished when the player has begun:','Five faults','Seven faults','Six faults','Four faults','Two faults',0,0,1,0,0,'410','24600',NULL),(60,'9','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE AMAZONS: HISTORY OR LEGEND?</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">On June 24, 1542, the Dominican missionary Gaspar de Carvajal, who had contact with them in what is now the Amazon, which was not yet called Amazonia, wrote: \"These women are very tall and very white, they have long hair rolled up above their heads, and they are almost naked. With their bow and arrow they fight each other like ten Indians\". Father Carvajal belonged to the Expedition of Francisco de Orellana. Exhausted, the fifty adventurers stopped at an Indian village whose chief put them on guard. They had to return because if they continued they would have to deal with the women who reigned in the territory beyond the great river, with whom the bravest warriors could not measure up. The Spaniards ignored them and went into \"the land of gold\". Suddenly it began to rain arrows, to which the expeditionaries answered with their arquebuses. Soon they dominated a deserted village, and after a few minutes, before the eyes of the new arrivals appeared ten warriors like the ones described. \"These half goddesses seemed immortal,\" says the missionary in his writing. They did not tolerate any Indians in their huts, nor children. They admitted their own kind only to procreate when an auspicious moon came. Carvajal survived and swore, on his return to Spain, that what he said in his writings was strictly true.&nbsp; It was these Amazons who gave the name to the Amazon River and the Amazon. The Greek Diodorus gave the warrior women of his people the name amazos (deprived of the breast). This name comes from the fact that when the warrior women gave birth to a daughter, they burned a breast in order to \"develop all their strength with their right arm and not have a breast as a hindrance\" (Hippocrates). Male children were rejected as unfit for combat. They gave them to their parents as useless. In 1506, a missionary from Ethiopia described a province \"where women, much more daring than the men of the country, are always armed for hunting and war\". In Monomotapa (today\'s Rhodesia) an explorer repeated the same observation: \"among the troops, the nerve of the king\'s armed force is in the legions of women\". In the image of the warriors of Ancient Greece in the time of Hippocrates, they burned the right breast of newborn girls in order to better aim their weapons.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from: Diners Magazine No 295. Year XXX, Paul de Garat</span></p>','The Dominican missionary Gaspar de Carvajal had contact with the Amazons and wrote about them in:','August 30th , 1642','May 20th , 1512','October 12th, 1492','June 24th, 1542','February 17th, 1859',0,0,0,1,0,'Father Carvajal belonged to:','Botanical Expedition','South Expedition','Francisco de Orellana Expedition','Mutis Expedition','Humboldt Baron\'s Expedition',0,0,1,0,0,'The Amazons gave the name to the river:','Atrato','Putumayo','Magdalena','Támesis','Amazonas',0,0,0,0,0,'An Ethiopian missioner  described the amazon province in:','1516','1506','1417','1400','1586',0,1,0,0,0,'Ancient Monomotapa is nowadays: ','Rodesia','Ceilán','Sri Lanka','India','Gracia',1,0,0,0,0,'406','24360',NULL),(61,'9','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE AMAZONS: HISTORY OR LEGEND?</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">On June 24, 1542, the Dominican missionary Gaspar de Carvajal, who had contact with them in what is now the Amazon, which was not yet called Amazonia, wrote: \"These women are very tall and very white, they have long hair rolled up above their heads, and they are almost naked. With their bow and arrow they fight each other like ten Indians\". Father Carvajal belonged to the Expedition of Francisco de Orellana. Exhausted, the fifty adventurers stopped at an Indian village whose chief put them on guard. They had to return because if they continued they would have to deal with the women who reigned in the territory beyond the great river, with whom the bravest warriors could not measure up. The Spaniards ignored them and went into \"the land of gold\". Suddenly it began to rain arrows, to which the expeditionaries answered with their arquebuses. Soon they dominated a deserted village, and after a few minutes, before the eyes of the new arrivals appeared ten warriors like the ones described. \"These half goddesses seemed immortal,\" says the missionary in his writing. They did not tolerate any Indians in their huts, nor children. They admitted their own kind only to procreate when an auspicious moon came. Carvajal survived and swore, on his return to Spain, that what he said in his writings was strictly true.&nbsp; It was these Amazons who gave the name to the Amazon River and the Amazon. The Greek Diodorus gave the warrior women of his people the name amazos (deprived of the breast). This name comes from the fact that when the warrior women gave birth to a daughter, they burned a breast in order to \"develop all their strength with their right arm and not have a breast as a hindrance\" (Hippocrates). Male children were rejected as unfit for combat. They gave them to their parents as useless. In 1506, a missionary from Ethiopia described a province \"where women, much more daring than the men of the country, are always armed for hunting and war\". In Monomotapa (today\'s Rhodesia) an explorer repeated the same observation: \"among the troops, the nerve of the king\'s armed force is in the legions of women\". In the image of the warriors of Ancient Greece in the time of Hippocrates, they burned the right breast of newborn girls in order to better aim their weapons.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taken from: Diners Magazine No 295. Year XXX, Paul de Garat</span></p>','Ancient name that was given to the Amazons:','The land of the gold','The region of gold','City of gold','Country of gold','Nation of gold',0,0,0,1,0,'Greek Diodorus gave the warrior women from their town the name of:','Amazons','Light warriors','Amazos','Goddesses','Moon warriors',0,0,1,0,0,'Number of adventurers who accompanied Francisco de Orellana\'s expedition:','Sixty','Thirty','Seventy','Forty','Fifty',0,0,0,0,0,'The warriors received the indians to procreate in:','New Moon','Full Moon','Propitios Moon','Wanning Moon','Crescent Moon',0,0,1,0,0,'When the warriors gave birth to male child they:','Burned the village','Throw him at the river','Give him to the fathers','Kill him with arch and arrow','Sacrifice him to the Gods',0,0,1,0,0,'406','24360',NULL),(62,'10','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">COLOMBIANS READ 2.4 BOOKS PER YEAR</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This is the worst reading average in Latin America. The worrying number belongs to the National Reading Habits Survey that was get to known in the 14th international fair room of Bogota in the anteroom, performed from April 7 to May 25 of 2001.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The news is more discouraging considering that according to data from a study conducted by Fundalectura in 1992, in our country each person read 3.48 books a year.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In nations of similar conditions to ours , like Argentina, the average is 14 books per year per person. In Europe , in high development regions like Germany , are read between 30 and 35 books.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This the most ambitious reading study that has ever been made in Colombia and it\'s included, by the first time, in the National Home Survey , that is made periodically the National Administrative Department of Statistics (NADS)</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The work was carried out in 20,000 homes in Bogotá, Cali, Medellín, Barranquilla, Bucaramanga, Manizales, Pasto, Pereira, Ibagué, Cúcuta and Montería, among people of working age, 12 years old and older.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The survey was designed in April 2000 and implemented in June 2000. It combined the efforts of NADS, the Ministry of Education, Culture, Fundalectura, the Colombian Book Chamber and the Regional Centre for Book Promotion in Latin America and the Caribbean.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The 45 percent of readers do it because they like it and enjoy it, the 37 percent read for study, the 25 percent for personal development the 22 percent read for general culture; 10 percent for work and 4 percent for other interests.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Colombians that don\'t read books do it because they are not get use to it or for lack of interest, in a 40.1 percent , a 22.6 percent says that they don\'t have time, the 16.7 percent claim lack of money; 6.3 percent say they do not read due to lack of employment; 3.5 percent prefer newspapers; 2, 7 percent, the magazines; 1.3 percent choose the Internet and 5.1 percent have other preferences.</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the surveyed homes , the 6.18 percent had less of 25 book and 9.2 percent don\'t have.</span></p>','Average number of books read in Colombia per year according to a survey conducted in 1992 by Fundalectura: ','2.54','3.48','5.21','4.28','3.45',0,1,0,0,0,'Between 30 and 35 books per year by person are read in: ','Argentina','Colombia','Germany','Spain','England',0,0,1,0,0,'Date the National Reading Habit Survey was conducted:','April 2000 and May 2000','June 2000 and July 2000','April 2001 and May 2001','June 2001 and July 2001','May 2000 and June 2000',0,0,1,0,0,'Colombian people read 2.4 books a year, according to the survey conducted by: ','National Administrative Department of Statistics','Colombian Book Chamber','Regional Centre for Book Development ','Encuesta Nacional de Hábitos de Lectura','National Household Survey',0,0,0,1,0,'A 3.5 % of Colombians don’t read book because:','They don’t have time','Lack of money','They rather the news papers','They rather read magazines','They choose Internet',0,0,1,0,0,'351','21060',NULL),(63,'10','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">COLOMBIANS READ 2.4 BOOKS PER YEAR</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This is the worst reading average in Latin America. The worrying number belongs to the National Reading Habits Survey that was get to known in the 14th international fair room of Bogota in the anteroom, performed from April 7 to May 25 of 2001.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The news is more discouraging considering that according to data from a study conducted by Fundalectura in 1992, in our country each person read 3.48 books a year.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In nations of similar conditions to ours , like Argentina, the average is 14 books per year per person. In Europe , in high development regions like Germany , are read between 30 and 35 books.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This the most ambitious reading study that has ever been made in Colombia and it\'s included, by the first time, in the National Home Survey , that is made periodically the National Administrative Department of Statistics (NADS)</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The work was carried out in 20,000 homes in Bogotá, Cali, Medellín, Barranquilla, Bucaramanga, Manizales, Pasto, Pereira, Ibagué, Cúcuta and Montería, among people of working age, 12 years old and older.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The survey was designed in April 2000 and implemented in June 2000. It combined the efforts of NADS, the Ministry of Education, Culture, Fundalectura, the Colombian Book Chamber and the Regional Centre for Book Promotion in Latin America and the Caribbean.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The 45 percent of readers do it because they like it and enjoy it, the 37 percent read for study, the 25 percent for personal development the 22 percent read for general culture; 10 percent for work and 4 percent for other interests.</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Colombians that don\'t read books do it because they are not get use to it or for lack of interest, in a 40.1 percent , a 22.6 percent says that they don\'t have time, the 16.7 percent claim lack of money; 6.3 percent say they do not read due to lack of employment; 3.5 percent prefer newspapers; 2, 7 percent, the magazines; 1.3 percent choose the Internet and 5.1 percent have other preferences.</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the surveyed homes , the 6.18 percent had less of 25 book and 9.2 percent don\'t have.</span></p>','Number of households surveyed:','40.000','50.000','30.000','20.000','10.000',0,0,1,0,0,'The average number of books read by people annually in Argentina is:','20','14','25','15','30',0,0,0,0,1,'Three of the cities that participated in the survey were:','Bogota, Cartagena and Armenia','Cali, Santa Marta and Bucaramanga','Pasto, Manizales and Cúcuta','Pereira, San Andrés and Monteria','Medellin, Barranquilla and Cartagena',0,0,0,1,0,'According to the survey conducted: What percentage of Colombians read by studies?:','45%','25%','22%','37%','10%',0,0,1,0,0,'Name of the entity in charge of conducting the national household survey:','Education Ministry','Culture Ministry','Fundalectura','Colombian book chamber ','National Administrative Department of Statistics',0,1,0,0,0,'351','21060',NULL),(64,'11','COMPREHENSION TEST A','<h3 style=\"text-align: center;\"><strong>ESCALANDO EL ACONCAGUA</strong></h3>\r\n<h4 style=\"text-align: center; color:#b86125; text-align:center;\"><strong>Climbing The Aconcagua</strong></h4><p><strong><br></strong></p>\r\n\r\n\r\n<table>\r\n	<tbody style=\"text-align:center\"><tr><td>\r\n		Estaban al pie del Cristo Redentor,<br>\r\n<span style=\"color:#b86125; text-align:center;\">They were at the foot of the Cristo Redentor,</span> <br>\r\nen plena cordillera<br>\r\n<span style=\"color:#b86125; text-align:center;\">right in the Range</span> <br>\r\nde los Andes, sobre la ladera Argentina y cerca del<br>\r\n<span style=\"color:#b86125; text-align:center;\">of the Andes, on the Argentine slope and near the</span> <br>\r\nlímite con Chile<br>\r\n<span style=\"color:#b86125; text-align:center;\">Chilean border.</span> <br><br>Llevaban palas, picos, escalas, sogas y<br>\r\n<span style=\"color:#b86125; text-align:center;\">They carried spades, picks, ladders, ropes and</span> <br>\r\ntodo el equipo requerido para<br>\r\n<span style=\"color:#b86125; text-align:center;\">all the necessary equipment to</span> <br>\r\nser un buen alpinista.<br>\r\n<span style=\"color:#b86125; text-align:center;\">be good muntaineers.</span> <br><br>Pero no había guía que les<br>\r\n<span style=\"color:#b86125; text-align:center;\">But there was no guide</span> <br>\r\nseñalara el camino…<br>\r\n<span style=\"color:#b86125; text-align:center;\">to show them the way…</span> <br><br>&nbsp;De todos modos, comenzeron a