</span> <br>\r\ninmóviles, casi a punto de<br>\r\n<span style=\"color:#b86125; text-align:center;\">motionless, nearly about to</span> <br>\r\ncongelarse<br>\r\n<span style=\"color:#b86125; text-align:center;\">become frozen.</span> <br><br>&nbsp;- ¡Hunch! ¡Hunch! ¡Hunch!<br>\r\n<span style=\"color:#b86125; text-align:center;\">- Pant! Pant!</span> <br>\r\nvenía diciendo el perro Bunker,<br>\r\n<span style=\"color:#b86125; text-align:center;\">was saying Bunker the dog,</span> <br>\r\nmientras ascendía la<br>\r\n<span style=\"color:#b86125; text-align:center;\">as he went up the</span> <br>\r\nmontaña con gran destreza,<br>\r\n<span style=\"color:#b86125; text-align:center;\">mountain with great skill</span> <br>\r\nhasta que llegó y… - Guaug! Guaug! Guaug!<br>\r\n<span style=\"color:#b86125; text-align:center;\">until he arrived and… - Bark! Bark! Bark!</span> <br>\r\nTaquito entreabrió apenas los ojos y exclamó, desfalleciente:<br>\r\n<span style=\"color:#b86125; text-align:center;\">Taquito half-opened his eyes and exclaimed faintly:</span> <br>\r\n- ¡Bunker! ¡Mi Viejo y querido Bunker…!<br>\r\n<span style=\"color:#b86125; text-align:center;\">- Bunker dear old Bunker!</span> <br><br>El fiel animal enviado por Tony Chaleco como única<br>\r\n<span style=\"color:#b86125; text-align:center;\">The faithful animal, sent over by Tony Chaleco as his only</span> <br>\r\ncondición para autorizar la aventura,<br>\r\n<span style=\"color:#b86125; text-align:center;\">condition to allow the undertaking,</span> <br>\r\nllevaba el clásico barrilito<br>\r\n<span style=\"color:#b86125; text-align:center;\">carried the traditional keg</span> <br>\r\nde coñac colgado<br>\r\n<span style=\"color:#b86125; text-align:center;\">of brandy hanging</span> <br>\r\ndel cuello y, al<br>\r\n<span style=\"color:#b86125; text-align:center;\">from his neck and in</span> <br>\r\ninstante, todos<br>\r\n<span style=\"color:#b86125; text-align:center;\">no time, they all</span> <br>\r\nestaban<br>\r\