 eyes and exclaimed faintly:</span> <br>\r\n- ¡Bunker! ¡Mi Viejo y querido Bunker…!<br>\r\n<span style=\"color:#b86125; text-align:center;\">- Bunker dear old Bunker!</span> <br><br>El fiel animal enviado por Tony Chaleco como única<br>\r\n<span style=\"color:#b86125; text-align:center;\">The faithful animal, sent over by Tony Chaleco as his only</span> <br>\r\ncondición para autorizar la aventura,<br>\r\n<span style=\"color:#b86125; text-align:center;\">condition to allow the undertaking,</span> <br>\r\nllevaba el clásico barrilito<br>\r\n<span style=\"color:#b86125; text-align:center;\">carried the traditional keg</span> <br>\r\nde coñac colgado<br>\r\n<span style=\"color:#b86125; text-align:center;\">of brandy hanging</span> <br>\r\ndel cuello y, al<br>\r\n<span style=\"color:#b86125; text-align:center;\">from his neck and in</span> <br>\r\ninstante, todos<br>\r\n<span style=\"color:#b86125; text-align:center;\">no time, they all</span> <br>\r\nestaban<br>\r\n<span style=\"color:#b86125; text-align:center;\">were</span> <br>\r\nreconfortándose<br>\r\n<span style=\"color:#b86125; text-align:center;\">fortifying themselves</span> <br>\r\ncon aquella<br>\r\n<span style=\"color:#b86125; text-align:center;\">with the</span> <br>\r\nbebida: el perro<br>\r\n<span style=\"color:#b86125; text-align:center;\">drink: the Boxer</span> <br>\r\nBóxer les<br>\r\n<span style=\"color:#b86125; text-align:center;\">dog had</span> <br>\r\nhabía salvado la vida<br>\r\n<span style=\"color:#b86125; text-align:center;\">saved their lives</span> <br>\r\nmilagrosamente.<br>\r\n<span style=\"color:#b86125; text-align:center;\">miraculously.</span> <br>\r\n\r\n	</td>\r\n</tr></tbody></table>','In the narrative who is authorizing the adventure:','Victor el Escalador','Bunker','Tony Chaleco','The guide','The narrator',0,0,1,0,0,'The breed of the dog that saved the hikers:','German shepherd','Collie Sheperd','Saint Bernard','Boxer','Fila Brasilero',0,0,0,1,0,'Drink the dog was carrying inside the barrel:','Wine','Cognac','Whisky','Rum','Gin',0,1,0,0,0,'What country does Aconcagua border with','Brazil','Peru','Argentina','Chile','Uruguay',0,0,0,1,0,'What did the hikers do to comfort themselves: ','They warm up with the whisky','They build up a bonfire','They drunk up the cognac','They wrapped themselves up in bushes','The drunk up the wine',0,0,1,0,0,'431','25860',NULL),(66,'12','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE POWER OF THE PRINTER</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Inventor Johann Guitenberg dies in poverty while the printing press changed the world&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In 15th century Europe was longing for change. For more than 1000 years it was under the rule of the Church and a society that appreciated traditional knowledge. Now there were new ideas in the air. But with only pen and parchment to spread the message, that was probably where they would stay.&nbsp;&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the German city of Strasbourg, a young jeweler named Johann Gutenberg was acting very strangely. He asked his friends for money to buy materials that had nothing to do with jewelry. He didn\'t say why he needed them, or why they were so expensive. In the end, his friends refused to lend him any more until he cleared it up. His secret surprised them. He was working on an invention that would allow books to be mass-produced rather than copied by hand.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The new movable types, oil-based ink and Gutenberg\'s press seemed to have a future, and in 1438 his friends formed a partnership. But things began to go wrong. A partner died and his children wanted their share. They took Gutenberg to court. They lost, but the secret of Gutenberg\'s work came out, and the dispute to print books began.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Gutenberg returned to his home town of Mainz to perfect his invention. Still desperate for money, he persuaded the merchant Johann Fust to give him two large loans. Gutenberg\'s first book was ready in 1455. He presented it at the trade fair in nearby Frankfurt, where visitors commented on the book\'s clarity.&nbsp;</span></p><p><strong><br><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">That\'s when Fust hinted that it was time for him to get his money back. But Gutenberg couldn\'t or wouldn\'t pay. Once again he was faced with a trial in court, this time he did not win. Fust took control of everything. Stopping only to steal Gutenberg\'s best assistant, he emerged as the world\'s first successful printer.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">But he didn\'t hold on to his leadership for long. In 25 years there were already printers all over Europe. By 1500, they had printed 30,000 books, spreading new ideas far and wide and helping to usher in the era we call the Renaissance.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">And Johann Gutenberg? continued to print, but he didn\'t earn much. The Archbishop of Mainz provided him with food and clothing, but by 1468, Gutenberg had died. The future he\'d helped create was underway without him. </span></p>','Profession of Johann Gutenberg:','Merchant','Writer','Printer','Jeweler','Judge',0,0,0,1,0,'How traditional knowledge was disseminated before the 15th century:','Through tradition','Verbally from fathers to their sons','From quill and parchment','Through printing','With oil-based ink and pressed',0,0,1,0,0,'Number of times Gutenberg was brought to trial:','Five','Four','Three','Two','One',0,0,0,1,0,'In 1455, the first Gutenberg book was brought to the trade fair held in:','Maguncia','Strasbourg','Europe','Germany','Frankfurt',0,0,0,0,0,'What was the reason that Gutenberg was turned in the first trial?:','A partner’s dead','A partner’s dead','Not wanting to pay a debt','Claim of rights','Not agreeing with the church',0,0,0,1,0,'397','23820',NULL),(67,'12','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE POWER OF THE PRINTER</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Inventor Johann Guitenberg dies in poverty while the printing press changed the world&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In 15th century Europe was longing for change. For more than 1000 years it was under the rule of the Church and a society that appreciated traditional knowledge. Now there were new ideas in the air. But with only pen and parchment to spread the message, that was probably where they would stay.&nbsp;&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In the German city of Strasbourg, a young jeweler named Johann Gutenberg was acting very strangely. He asked his friends for money to buy materials that had nothing to do with jewelry. He didn\'t say why he needed them, or why they were so expensive. In the end, his friends refused to lend him any more until he cleared it up. His secret surprised them. He was working on an invention that would allow books to be mass-produced rather than copied by hand.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The new movable types, oil-based ink and Gutenberg\'s press seemed to have a future, and in 1438 his friends formed a partnership. But things began to go wrong. A partner died and his children wanted their share. They took Gutenberg to court. They lost, but the secret of Gutenberg\'s work came out, and the dispute to print books began.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Gutenberg returned to his home town of Mainz to perfect his invention. Still desperate for money, he persuaded the merchant Johann Fust to give him two large loans. Gutenberg\'s first book was ready in 1455. He presented it at the trade fair in nearby Frankfurt, where visitors commented on the book\'s clarity.&nbsp;</span></p><p><strong><br><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">That\'s when Fust hinted that it was time for him to get his money back. But Gutenberg couldn\'t or wouldn\'t pay. Once again he was faced with a trial in court, this time he did not win. Fust took control of everything. Stopping only to steal Gutenberg\'s best assistant, he emerged as the world\'s first successful printer.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">But he didn\'t hold on to his leadership for long. In 25 years there were already printers all over Europe. By 1500, they had printed 30,000 books, spreading new ideas far and wide and helping to usher in the era we call the Renaissance.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#0e101a;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">And Johann Gutenberg? continued to print, but he didn\'t earn much. The Archbishop of Mainz provided him with food and clothing, but by 1468, Gutenberg had died. The future he\'d helped create was underway without him. </span></p>','Johann Gutenberg hometown:','Strasburgo','Frankfurt','Germany','Mangucia','Europe',0,0,0,1,0,'Date in which Gutenberg died:','1428','1438','1448','1458','1468',0,0,0,0,1,'Number of printed books in 1500','20.000','30.000','40.000','50.000','60.000',0,1,0,0,0,'Name of the person that called himself the first successful printer:','Johann Gutenberg','Gabriel Gutenberg','Javier Fust','Cristian Gutenberg','Johann Fust',0,0,0,0,0,'The invention the Gutenberg was working on will allow: ','That clock didn’t work weird','That the printer would photocopy books faster','That the new types of ink were movable','That books were massively produced','That clocks where precise',0,0,0,1,0,'397','23820',NULL),(68,'13','COMPREHENSION TEST A','<h3 style=\"text-align: center;\"><strong>JUGANDO A LA PELOTA</strong></h3>\r\n\r\n<p style=\"text-align: center;\"><span style=\"text-align: center;\"><br></span></p><p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">En el Club de Barrio Tejada había un campeonato de fútbol y Beto regalaba una\r\npelota No. 5, de cuero, al equipo ganador.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">The Barrio Tejada Club has organized a football championship and Beto would give a\r\nbig leather ball No. 5 to the wining team.</span> </p> <br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Nosotros tenemos que intervenir…! ¡Como sea! – dijo Julio y cuando llegó la fecha:</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We have to take a part in it! No matter now! – said Julio and when the day came:</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">-Logramos organizar un buen equipo… ¡Hasta tenemos al comisario Adán de arquero…!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We´ve managed to organized a good team… We even have Police Superintendent Adan\r\nas a goalkeeper!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Pero…¿Y tú Monito,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">But, what about you, Monito,</span><br>\r\n<span style=\"text-align: center;\">por qué no trajiste la ropa reglamentaria? Y bueno…miren…yo traje un pito quisiera…yo…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Why haven’t you brought your pertaining clothes? Well, look…I’ve brought a whistle\r\nand I…would like to…</span><br>\r\n<span style=\"text-align: center;\">murmuró Monito, con una timidez que no le permitía explicar las cosas.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">murmured Monito so timidly that he couldn’t explain things clearly.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡El quisiera ser el árbitro! ¿No se dan cuenta? – dijo Rubencho, que los había acompañado.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He’d like to be the referee! Can’t you see? – said _Rubencho who had gone with them.</span><br>\r\n<span style=\"text-align: center;\">- De acuerdo – aprobaron todos. Pero no sabían que Monito</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We all agree – they said. But they didn’t know that Monito</span><br>\r\n<span style=\"text-align: center;\">podía llegar a ser muy severo.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">could be a very strict referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Eh tú! ¡Flaco! ¡Tienes las medias caídas…! – decía el Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Eh You! Flaco! Pull up your socks! –said Monito.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Y tú Chiquito!¿Piensas jugar con guantes de box? Tendré que echarte…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And you, Chiquito! Do you think you will play wearing boxing gloves? I´ll have to send\r\nyou out…</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Y así con todos. Al fin empezó el partido. ¡Y a cumplir las reglas al dedillo!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And he did the same to everyone. Finally the match started –you must stick to the rules!</span><br>\r\n<span style=\"text-align: center;\">¿Me han oído? – agregó el árbitro.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Did you hear me? – added the referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Je! ¡Je! Pensó entonces Loco Darío, del equipo contrario,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He! He! Thought then Loco-Darío, a member of the other team,</span><br>\r\n<span style=\"text-align: center;\">fastidiado con tanta corrección. ¡Éste piensa que somos unos angelitos!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">annoyed because of so much properness. This man thinks we are little angels!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Loco, aprovechando una distracción de Julio, lo durmió de un golpe</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Loco, seeing that Julio wasn´t paying attention, knocked him out</span><br>\r\n<span style=\"text-align: center;\">y le sacó la pelota. Luego se dispuso a tirar para hacer un gol, pero…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">and got hold of the ball. He got ready to kick it to score a goal, but…</span><br>\r\n<span style=\"text-align: center;\">¡Hurra! La pelota fue a parar a la platea y le arrancó el sombrero a Pepe…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Hurray! The ball went right up into the grandstand and knocked off Pepe’s hat…</span><br>\r\n<span style=\"text-align: center;\">¡Fuera! ¡Estás inhabilitado! – gritó Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Out you’re out! – shouted Monito.</span><br>\r\n<span style=\"text-align: center;\">¡Muy bien, pequeño! ¡Has estado brillante! –dijeron todos.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Well done, Little one! That was brilliant - everybody said.</span><br></p>','What was the prize for the winner team?:','Soccer ball','A leather ball','A N.5 ball','A leather ball N.5 ','Soccer ball',0,0,0,1,0,'Who wasn’t part of the team but wsa with them?:','Comissioner Adam','Rubencho','Loco-Dario','Flaco','Beto',0,1,0,0,0,'Why didn’t Monito dressed the regulatory clothing?:','He wasn’t going to play on the first half','He was tired','He didn’t wanted to be part of the team','He was scared he was going to be hit','He wanted to be the referee',0,0,0,0,0,'Why were they going to take him off the team?:','He wore dirty socks','He wore long pants','He had no shoes needed','He didn’t have the proper gloves','He had the socks down',0,0,0,1,0,'Who was bothered with the referee’s correction?:','Julio','Flaco','Chiquito','Loco','Beto',0,0,0,1,0,'498','29880',NULL),(69,'13','COMPREHENSION TEST B','<h3 style=\"text-align: center;\"><strong>JUGANDO A LA PELOTA</strong></h3>\r\n\r\n<p style=\"text-align: center;\"><span style=\"text-align: center;\"><br></span></p><p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">En el Club de Barrio Tejada había un campeonato de fútbol y Beto regalaba una\r\npelota No. 5, de cuero, al equipo ganador.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">The Barrio Tejada Club has organized a football championship and Beto would give a\r\nbig leather ball No. 5 to the wining team.</span> </p> <br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Nosotros tenemos que intervenir…! ¡Como sea! – dijo Julio y cuando llegó la fecha:</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We have to take a part in it! No matter now! – said Julio and when the day came:</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">-Logramos organizar un buen equipo… ¡Hasta tenemos al comisario Adán de arquero…!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We´ve managed to organized a good team… We even have Police Superintendent Adan\r\nas a goalkeeper!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Pero…¿Y tú Monito,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">But, what about you, Monito,</span><br>\r\n<span style=\"text-align: center;\">por qué no trajiste la ropa reglamentaria? Y bueno…miren…yo traje un pito quisiera…yo…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Why haven’t you brought your pertaining clothes? Well, look…I’ve brought a whistle\r\nand I…would like to…</span><br>\r\n<span style=\"text-align: center;\">murmuró Monito, con una timidez que no le permitía explicar las cosas.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">murmured Monito so timidly that he couldn’t explain things clearly.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡El quisiera ser el árbitro! ¿No se dan cuenta? – dijo Rubencho, que los había acompañado.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He’d like to be the referee! Can’t you see? – said _Rubencho who had gone with them.</span><br>\r\n<span style=\"text-align: center;\">- De acuerdo – aprobaron todos. Pero no sabían que Monito</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">We all agree – they said. But they didn’t know that Monito</span><br>\r\n<span style=\"text-align: center;\">podía llegar a ser muy severo.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">could be a very strict referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Eh tú! ¡Flaco! ¡Tienes las medias caídas…! – decía el Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Eh You! Flaco! Pull up your socks! –said Monito.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Y tú Chiquito!¿Piensas jugar con guantes de box? Tendré que echarte…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And you, Chiquito! Do you think you will play wearing boxing gloves? I´ll have to send\r\nyou out…</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Y así con todos. Al fin empezó el partido. ¡Y a cumplir las reglas al dedillo!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">And he did the same to everyone. Finally the match started –you must stick to the rules!</span><br>\r\n<span style=\"text-align: center;\">¿Me han oído? – agregó el árbitro.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Did you hear me? – added the referee.</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">¡Je! ¡Je! Pensó entonces Loco Darío, del equipo contrario,</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">He! He! Thought then Loco-Darío, a member of the other team,</span><br>\r\n<span style=\"text-align: center;\">fastidiado con tanta corrección. ¡Éste piensa que somos unos angelitos!</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">annoyed because of so much properness. This man thinks we are little angels!</span></p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n<span style=\"text-align: center;\">Loco, aprovechando una distracción de Julio, lo durmió de un golpe</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Loco, seeing that Julio wasn´t paying attention, knocked him out</span><br>\r\n<span style=\"text-align: center;\">y le sacó la pelota. Luego se dispuso a tirar para hacer un gol, pero…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">and got hold of the ball. He got ready to kick it to score a goal, but…</span><br>\r\n<span style=\"text-align: center;\">¡Hurra! La pelota fue a parar a la platea y le arrancó el sombrero a Pepe…</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Hurray! The ball went right up into the grandstand and knocked off Pepe’s hat…</span><br>\r\n<span style=\"text-align: center;\">¡Fuera! ¡Estás inhabilitado! – gritó Monito.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Out you’re out! – shouted Monito.</span><br>\r\n<span style=\"text-align: center;\">¡Muy bien, pequeño! ¡Has estado brillante! –dijeron todos.</span><br>\r\n<span style=\"color:#00b74f; text-align:center;\">Well done, Little one! That was brilliant - everybody said.</span><br></p>','Why did they almost score a goal on Chiquito’s team ?:','Because Beto was out of place','Because Pepe wasn’t marking well','Because Flaco was adjusting his socks','Because Julio was distracted','Because Chiquito wasn’t covering up well',0,0,0,1,0,'Who was the team’s goalkeeper?:','Comissioner Adam','Pepe','Beto','Flaco','Chiquito',1,0,0,0,0,'What happened to Pepe?:','His feathers were removed','Hi was punched','Hi got red card','Hi hat was tore off','His uniform was ruined',0,0,0,1,0,'What did the referee received for following the rules to the letter?:','A new uniform','Insults from players','A medal of honor','A trophy','Congratulations',0,0,0,0,0,'Why was Loco kick out of the game?:','For being a bad goalkeeper','For not following the rules','For committing a foul','Because he 