ran tan fuertes que... ¡pum! ¡pum! ¡pum!, unos<br>\r\n<span style=\"color:#ffcd00\">She screamed so loud that bang! bang! bang!</span><br>\r\ngritos terribles y verdaderos derribaron la puerta de la casa de<br>\r\n<span style=\"color:#ffcd00\">truly frightful knocks battered down the door of</span><br>\r\nTaquito y Medialuna y...<br>\r\n<span style=\"color:#ffcd00\">Taquito´s y Medialuna´s house and...</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n¿Qué pasa aquí? ¿Quién pide ayuda? -gritó valientemente el<br>\r\n<span style=\"color:#ffcd00\">What’s going on here? Who’s asking for help? -bravely demanded</span><br>\r\ncomisario Piñón, entrando en la casa revolver en mano…<br>\r\n<span style=\"color:#ffcd00\">superintendent Piñón, going into the house with his gun in his hand…</span><br>\r\n¡Ja! ¡Ja! ¡Ja! –se rió Taquito-.<br>\r\n<span style=\"color:#ffcd00\">Ha! Ha! Ha!- laughed Taquito-.</span><br>\r\n¿No ves que esto es una función de títeres?<br>\r\n<span style=\"color:#ffcd00\">Can’t you see this is a puppet show?</span><br>\r\ny Pájaro Pinto, el titiritero,<br>\r\n<span style=\"color:#ffcd00\">and Pájaro Pinto, the puppeteer,</span><br>\r\nsaliendo de atrás del pequeño telón<br>\r\n<span style=\"color:#ffcd00\">coming out front behind the small curtain</span><br>\r\ncon el muñeco del ladrón en la mano, explicó:<br>\r\n<span style=\"color:#ffcd00\">with the puppet thief in his hand, explained:</span><br>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\n-Perdón, señor… Yo… en<br>\r\n<span style=\"color:#ffcd00\">-I’m sorry, sir… I… in</span><br>\r\nrealidad lo que estaba haciendo con las marionetas<br>\r\n<span style=\"color:#ffcd00\">fact what I was doing with the puppets</span><br>\r\nera… ¡Todo esto de mentiritas…!<br>\r\n<span style=\"color:#ffcd00\">was… all this is make-believe!</span><br>\r\n¿Se da cuenta?<br>\r\n<span style=\"color:#ffcd00\">You see?</span><br>\r\n</p><br>','What were the criminal’s plans that he wanted to accomplished?:','To marry and have many kids','To marry the Queen','To marry the King’s daughter','To marry the jeweler’s daughter','To marry his girlfriend',0,0,1,0,0,'Who did the criminal robbed?:','The bank','The cashier','The commissioner','The shopkeeper','The jeweler',0,0,0,0,1,'Which were the criminals words?','Hands up','The money or life','This is a robbery','The bag or life','Shut up and don’t scream',0,0,0,1,1,'What did the criminal asked to the princess?:','Do you like jewels?','Do you like flowers?','Do you like money?','Do you like apples?','Do you like gold?',0,0,0,0,0,'The princess’s scream was so loud that:','That the king woke up','The thief run away','The glasses broke','The tore down the house','Confused the Sheriff',0,0,0,0,0,'377','22620',NULL),(71,'14','COMPREHENSION TEST B','<h3 style=\"text-align: center;\"><strong>LA FUNCIÓN DE TÍTERES</strong></h3>\r\n<h4 style=\"text-align: center; color:#ffcd00; text-align:center;\"><strong>A Puppet Show</strong></h4>\r\n\r\n<p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\">\r\n¡Toma! ¡Toma! -le decía el malvado a un joyero que acababa de<br>\r\n<span style=\"color:#ffcd00\">Take that! And that! -said the villain to a jeweler who had just</span><br>\r\nsalir del banco-. ¡la bolsa o la vida! ¡Toma!<br>\r\n<span style=\"color:#ffcd00\">come out of the bank-. Your money or your life! Take that!</span><br>\r\n¡Je! ¡Je! ¡Je! –reía ahora el facineroso- ¡Con este oro podré<br>\r\n<span style=\"color:#ffcd00\">Ha! Ha! Ha! now laughed the criminal. With this gold I shall be able to</span><br>\r\ncumplir mis planes y casarme con la hija del rey…!<br>\r\n<span style=\"color:#ffcd00\">carry out my plans and marry the king’s daughter!</span>\r\n</p><br>\r\n\r\n<p style=\"text-align: center;\">\r\nLa hija del rey aparecía en escena justamente en ese momento,<br>\r\n<span style=\"color:#ffcd00\">Precisely at that moment the king’s daughter came on the scene,</span><br>\r\ndelante del telón decorado q