ransparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The terrorist objective was condundent : The twin towers of New York and the Pentagon of Washington, the more spectacular buildings of US.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The Twin Towers of 110 floors of the World Trade Center were located in the south of the Manhattan island,&nbsp; heart of the New york business neighborhood . This financial complex is home to 450 businesses and 50,000 workers, including the New York and New Jersey state customs offices.&nbsp;</span></p><p><strong><br><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The huge weight of each building was held by an inner iron mesh, that deprived the World Trade Center workers of large windows. Only from the top of each building, from 410 meters high, could you see a spectacular view. The elevator took 58 seconds to reach the 107th floor.&nbsp;&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Designed by the japanese architect&nbsp; Minuro 