:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">One of the great observer astronomers was Tycho Brache (1540-1601), a Dane. In 1599 he had a dispute with the King of Denmark and moved to Prague, where he established an observatory. There he took a young German, Johannes Kepler, as his assistant. When Brahe died, he left to his assistant the records of the observations he had made throughout his life.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Taking these observations into consideration, Kepler became convinced that Copernicus\' theory of the movement of the earth and the planets around the sun was correct.&nbsp; But he found that he could not make his observations if he considered the old criterion that celestial bodies turned in perfect circles or combinations of circles.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">So he concluded that the planets moved in an oval orbit. He tested his theory by making observations on the planet Mars, according to the criterion of the simplest of oval orbits - an ellipse - and found it to be correct.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Starting from the fact that the planetary orbits are elliptical, he estimated that from time to time the planets should meet closer to the sun. Kepler showed that the planets moved faster when they were closer to the sun than when they were farther away. Ten years later he discovered the relationship between the time it takes for the planets to go around the sun and the distance they are from it. These rules are known as Kepler\'s laws of motion.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p><span id=\"docs-internal-guid-aac72366-7fff-869f-3e7d-d3fb27dd3764\"></span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Kepler was the first to trace the orbits of the planets. Kepler\'s studies definitively ruled out the theory of the Earth as the centre of the universe.</span></p>','He is considered one of the most observer astronomers:','Ptolemy','Nicolaus Copernicus','Kepler Johannes','Newton Isaac','Tycho Brahe',0,0,0,0,1,'Kepler proved his theory doing observations about the planet:','Earth','Venus','Mars','Jupiter','Mercury',0,0,1,0,0,'The studies of Kepler made ruled out the theory of: ','Celestial bodies didn’t turned in circles','The earth turns around the sun','Planetary orbits are elliptical','That earth is the center of the universe','The sun and stars move',0,0,0,1,0,'He was the first to map the orbits of the planets ','Galileo Galilei','Sir Isaac newton','Tycho Brahe','Kepler Johannes','Copernicus Nicolaus',0,0,0,1,0,'Based on the fact that elliptical planetary orbits, Kepler estimated that: ','The planets should meet closer to the sun from time to time','The planets took one day to go around the sun','The heavenly bodies were spinning in perfect circles','The heavenly bodies were spinning in combinations of circles ','The planets were moving faster because they were closer to the moon ',1,0,0,0,0,'264','15840',NULL),(75,'16','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;text-align: center;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">KEPLER, JOHANNES - 1571 - 1630</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">