oncluded that the planets moved in an oval orbit. He tested his theory by making observations on the planet Mars, according to the criterion of the simplest of oval orbits - an ellipse - and found it to be correct.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Starting from the fact that the planetary orbits are elliptical, he estimated that from time to time the planets should meet closer to the sun. Kepler showed that the planets moved faster when they were closer to the sun than when they were farther away. Ten years later he discovered the relationship between the time it takes for the planets to go around the sun and the distance they are from it. These rules are known as Kepler\'s laws of motion.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><p><span id=\"docs-internal-guid-309de7ed-7fff-56c9-6aa2-1cf3952b1955\"></span></p><p dir=\"ltr\" style=\"line-height:1.54;margin-left: -12pt;margin-right: -12pt;background-color:#f8f9fa;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Kepler was the first to trace the orbits of the planets. Kepler\'s studies definitively ruled out the theory of the Earth as the centre of the universe.</span></p>','Kepler proved that:','Copernicus was wrong when he said that the earth moves around the sun ','Galileo was wrong to say that the moon has no light of its own','The planets were moving faster because they were closer to the sun','Newton was right to say that the moon turns around the earth','Tycho was right to say that the planets turns around the sun ',0,0,1,0,0,'Tycho Brahe nationality: ','German','Irish','Danish','Italian','Greek',0,0,1,0,0,'Which is the main lesson that Kepler left:','The earth turns around the sun','That planets don’t turn around the moon','That earth is not the center of the universe','That planets have no movement','That planets used to moved by tracing an oval orbit',0,0,0,0,0,'The basic rules of the solar system are known as:','Gravity laws','The laws of planetary movement ','the law of free fall','The law of solar movement ','the laws of gravitational motion',0,1,0,0,0,'Kepler was convinced of Copernicus\' theory by:','His studies at the university ','Newton\'s discoveries','The advances made by Galileo','The observations made by Tycho','Ptolemy\'s research ',0,0,0,1,0,'264','15840',NULL),(76,'17','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE HUMAN BRAIN, MIND ORGAN</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The human brain, home of the intelligence, creativity and memory, consists of about one trillion cells of which about one hundred billion are neurons, connected in networks .&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The large anatomical subdivisions of the brain provide a rudimentary map of its capabilities&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">At a superficial level, the brain seems to show bilateral symmetry, with its right and left hemispheres connected by the corpus callosum and other axonal bridges.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Its base consists of structures such as the medulla, which regulates autonomous functions (e.g. breathing, circulation and digestion), and the cerebellum, which is responsible for coordinating movements.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Between the two is the limbic system (blue), a collection of structures involved in emotional behavior, long-term memory and other functions.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The surface layer of both hemispheres is a couple of millimeters thick and is called the cortex. Its total area is 1.5 square meters. The oldest evolutionary portion of the crust is part of the limbic system. The younger neocortex is divided into lobes, frontal, temporal, parietal and occipital, separated by grooves or deep folds.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Almost every thinking and perspective phenomenon are translated into electric nerve impulses , called action potentials, that are moved over the cortex and through it.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Some brain regions with specialized functions have been studied in detail, such as the motor cortex (pink), the somatic-sensorial cortex (yellow) and the optical pathway (purple).&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The mind emerges from the collective activity of all brain regions.</span></p>','Collection of structures involved in emotional behavior, long-term memory and other functions. ','Limbic System','Motor Cortex','Somatosensory Cortex','Optical Path','Cortical Crust',1,0,0,0,0,'He is in charge of coordinating the movements','The Bark','The Neocortex','The Core','The Cerebellum','The Brain',0,0,0,1,0,'Almost all thought and perception phenomena are translated into electrical nerve impulses, called','Empowerment Actions','Action Potentials','Neural Regions','Reaction Potentials','Reaction Actions',0,1,0,0,0,'The bark is said to have a total area of:','1.3 square meters ','1.5 square meters','1.6 square meters','1.2 square meters','1.4 square meters',0,1,0,0,0,'The human brain consists of about a trillion cells, of which there are about a hundred billion: ','Dendrites','Neurons','Receiving cells','Axons ','Somas',0,1,0,0,0,'233','13980',NULL),(77,'17','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE HUMAN BRAIN, MIND ORGAN</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The human brain, home of the intelligence, creativity and memory, consists of about one trillion cells of which about one hundred billion are neurons, connected in networks .&nbsp;</span></p><p><strong><br></str