g></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The surface layer of both hemispheres is a couple of millimeters thick and is called the cortex. Its total area is 1.5 square meters. The oldest evolutionary portion of the crust is part of the limbic system. The younger neocortex is divided into lobes, frontal, temporal, parietal and occipital, separated by grooves or deep folds.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Almost every thinking and perspective phenomenon are translated into electric nerve impulses , called action potentials, that are moved over the cortex and through it.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Some brain regions with specialized functions have been studied in detail, such as the motor cortex (pink), the somatic-sensorial cortex (yellow) and the optical pathway (purple).&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The mind emerges from the collective activity of all brain regions.</span></p>','It is known as the seat of intelligence, creativity and memory:','Nucleus','Cerebellum','Marrow','Neuron','Brain',0,0,0,0,1,'This is what regulates the autonomous functions','Neuron','Cell','Left Hemisphere','Right Hemisphere','Marrow',0,0,0,0,1,'The youngest neocortex is divided into frontal, temporal, parietal and occipital lobes separated by: ','Corpus Callosum','Deep Grooves Or Folds','Axonal Bridges','The Hemispheres','Brain Regions ',0,1,0,0,0,'It\'s called bark:','The outer layer of the lobes','The inner layer of the marrow','The surface layer of the hemispheres','The hard layer that protects the cerebellum','The elementary layer of the brain',0,0,1,0,0,'They are connected by the corpus callosum and other axonal bridges:','The lobes','Neurons','The hemispheres','The medulla and cerebellum','The cerebellum and neurons ',0,0,1,0,0,'233','13980',NULL),(78,'18','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">NEURONAL COMMUNICATION</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">An excited neuron (turquoise) provides information to other neurons (violet) generating action potentials&nbsp; These signals propagate along the single axon of the cell, like waves, and are converted into chemical signals at the synapse.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When a neuron is at rest, its outer membrane maintains a potential difference of one 70 millivolt (the inner surface is negative with respect to the outer surface). The resting membrane is more permeable to potassium ions than to sodium ions, as indicated by the lengths of the black arrows on the insert in the upper right corner.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">By stimulating the cell, permeability to sodium increases, which causes positive charges to pass to the interior (a).&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This charge input triggers an impulse, i.e. a momentary inversion of the membrane potential (b). The impulse is initiated at the junction of the cell body with the axon and moves away from the cell soma (red arrows).&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When the impulse reaches the axonal terminals of the presynaptic neuron it induces the release of neurotransmitters (bottom left), which diffuse through a narrow interstitium and bind to receptors on the postsynaptic membrane.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This leads to the opening of ion channels and often also to the generation of action potentials in the post-synaptic neuron.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">For clarity, the size of various elements does not correspond to their true scale. </span></p>','An excited neuron provides information to:','Potassium ions','Sodium ions','Other neurons','Other nerves','Other ions',0,0,1,0,0,'Action potentials are signals that propagate in the form of: ','Airwaves','Waves','Particles','Electrick shock','Unions',0,1,0,0,0,'When a neuron is at rest, the inner surface of the membrane with respect to the outer surface is:','Positive','Neutral','Indifferent','Negative','Ianal',0,0,0,1,0,'The entry of positive charges triggers an impulse that induces:','The release of neurotransmitters','The rest of neurotransmitters','The elimination of neurotransmitters','The contamination of neurotransmitters','The reject of neurotransmitters',1,0,0,0,0,'The release of neurotransmitters diffuse and bind the post-synaptic membrane receptors causing ','The opening of ion channels and often the generation of action potentials','Closing of ion channels and action potentials','Exhaustion of the presynaptic membrane','The strengthening of the presynaptic membrane ','None of the above',1,0,0,0,0,'216','12960',NULL),(79,'18','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.54;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">NEURONAL COMMUNICATION</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">An excited neuron (turquoise) provides information to other neurons (violet) generating action potentials&nbsp; These signals propagate along the single axon of the cell, like waves, and are converted into chemical signals at the synapse.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When a neuron is at rest, its outer membrane maintains a potential difference of one 70 millivolt (the inner surface is negative with respect to the outer surface). The resting membrane is more permeable to potassium ions than to sodium ions, as indicated by the lengths of the black arrows on the insert in the upper right corner.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">By stimulating the cell, permeability to sodium increases, which causes positive charges to pass to the interior (a).&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This charge input triggers an impulse, i.e. a momentary inversion of the membrane potential (b). The impulse is initiated at the junction of the cell body with the axon and moves away from the cell soma (red arrows).&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When the impulse reaches the axonal terminals of the presynaptic neuron it induces the release of neurotransmitters (bottom left), which diffuse through a narrow interstitium and bind to receptors on the postsynaptic membrane.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This leads to the opening of ion channels and often also to the generation of action potentials in the post-synaptic neuron.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.54;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">For clarity, the size of various elements does not correspond to their true scale. </span></p>','An excited neuron provides information to other neurons generating:','Action Potentials','Reaction Potentials','Action Rest','Resting Reaction','Potential Actions',1,0,0,0,0,'The action potentials are propagated in the form of waves and are converted in the synapse into:','Electrical Signals','Alternate Signals','Continuous Signals','Physical Signs','Chemical Signals',0,0,0,0,1,'The membrane at rest is more permeable to','Potassium than sodium','Sodium than potassium','It\'s just as permeable','Not permeable','Rejects ions',1,0,0,0,0,'When the cell is stimulated at rest, it increases the permeability to sodium and causes the passage of:','Negative charges to the interior','Negative charges to the outside','Positive loads to the outside','Positive charges to the interior','No load transfer',0,0,0,1,0,'The entry of positive charges produces an impulse that induces:','The release of neurotransmitters','The rest of neurotransmitters','The elimination of neurotransmitters','Neurotransmitter contamination','Neurotransmitter rejection',1,0,0,0,0,'216','12960',NULL),(80,'19','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE CREATIVITY</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Creativity is one of the psychic functions of a higher order; it is one of the functions that most differentiates man from the rest of living beings. To create means to elaborate something new, different and of certain value. There are people who are more creative than others, some of whom we even say are great, due to the great value of what they create within the field of art, cinema, etc. Sometimes it seems that some creative processes have something incomprehensible, magical or supernatural. It is difficult to understand how it is possible that some men are capable of creating such extraordinary things.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The Greeks attributed the ability to create great works to the inspiration of the muses or the gods themselves. For a long time, creation was related to divine inspiration or a gift from God. During Romanticism the concept of \"genius\" was fully developed; great artists were superior \"genius\" beings, endowed with a special gift. More so, and in the light of the knowledge of modern psychology, various theories were developed that attempted to explain creative phenomena from other points of view, moving away from the mythical atmosphere that surrounded creativity.&nbsp;</span></p><p><strong><br><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">With the introduction of the concept of the unconscious, that is to say, of the coexistence within the individual psychic life of processes that escape to the conscience of the one who possesses them, theories were developed that understood that in the creative process unconscious mechanisms intervened by means of which, a person accumulated within himself a series of experiences and knowledge that, at a given moment, were associated in a suitable form, giving rise to the creation, of more or less sudden form, as in the called \"phenomena eureka\" in a species of illumination arises as a solution to a problem without deciphering. Many times these solutions arise after a period of rest, or after a time of thinking about the problem; at other times one has the impression that it has been resolved after sleep or even during sleep. For example, F.A. Von Kekulé said he discovered the ring structure of benzene while dreaming. There are many examples of creativity in the world of art. This creative activity during sleep would reinforce the role of unconscious processes within the creative ones.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Behavioral psychology, developed primarily by J. Watson, has taken little interest in creativity. From his point of view, the presumably creative responses offered to new solutions are a replica of similar ones previously experienced; and when they are really new in all their components, they are solved by random combinations, that is, combining all the possible responses in different ways.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Cognitive psychology, finally, is trying to explain creative phenomena from a new perspective. Weisberg, for example, argues that the concept of \"creative genius\" is purely mythical. According to his theory, creativity is nothing more than an activity resulting from ordinary thought processes of absolutely normal individuals, which would emerge in a progressive (\"incremental\") way from the initial attempts to solve the problem. Therefore, creativity would arise in relation to a series of knowledge that these people have of the problem they are trying to solve, so that they would progressively approach the solution.&nbsp;</span></p><p><br><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Which of these theories is the most accurate? Maybe they\'re all partly right. Perhaps there are no \"geniuses\", understood as such, but there is no doubt that there are people who are more gifted than others from the point of view of creativity. Sometimes, unconscious processes intervene at the time of creating, although it is also necessary a certain previous preparation in which they tell similar experiences lived or resulted previously and the same chance. Nevertheless, creativity continues to have a certain supernatural character and there are many who continue to believe in the power of inspiration.</span></p>','According to the author to create means:','Develop something new and of some value','Develop something new and different','Develop something new, different and of some value','Elaborate something new within the artistic, scientific field of.','Elaborate something of great value within the artistic and scientific field of',0,0,1,0,0,'That they attributed to the muses or to the gods themselves the ability to create great things?:','The Romans','The Greeks','The Wise Men','The Egyptians','The geniuses',0,1,0,0,0,'The so-called \"eureka phenomena\" are:','Creative processes that only come to geniuses','Expressions of the geniuses and wise men','Processes developed during the Romantic period','Wise men\'s awesome manifestations','A kind of illumination that emerges as a solution to a deep undeciphered',0,0,0,0,0,'Weisberg defends the concept of \"creative genius\" is something ','Purely mystical','Purely mythical','Purely divine','Purely human','Purely wise',0,1,0,0,0,'Creative responses to new solutions are a replica of others or random combinations of various forms; it is a theory of ','Cognitive psychology','Costumbrist psychology','Behavioral Psychology','Romantic Psychology','Modern Psychology',0,0,1,0,0,'627','37620',NULL),(81,'19','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">THE CREATIVITY</span></p><p><strong><br></strong></p><p dir=\"lt