ame chance. Nevertheless, creativity continues to have a certain supernatural character and there are many who continue to believe in the power of inspiration.</span></p>','According to the author creativity a one of the functions: ','Of The Brain','Psychics Of All Living Beings','Lower Order Psychics ','Higher Order Psychics','Of The Brain ',0,0,0,1,0,'When the concept of genius was fully developed:','In ancient times','During the Middle Ages','During the Romantic period','During the Renaissance','During Modernism',0,0,1,0,0,'Creativity as a result of a series of experiences and knowledge associated in an appropriate way that escape the conscience of those who possess them, is a theory: ','Of behavioral psychology','From the psychology of manners','From cognitive psychology ','From the psychology of the unconscious','From the psychology of the conscience',0,0,0,1,0,'According to the author, which of all the theories of creativity is the most accurate?','Possibly the behavioral one','Possibly the costumbrist','Possibly the cognitive','Possibly she\'s consenting to it','They may all be partially right',0,0,0,1,0,'What is the title of the reading?','Theory of creativity','Creativity... psychic function','Psychology of creativity','Creativity','Creativity ',0,0,0,1,0,'62','37620',NULL),(82,'20','COMPREHENSION TEST A','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">COMMON USES FOR THE E-MAIL</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Some resources help to speed up the most frequent uses of e-mail. When using the mail, there are always people with whom the exchange of messages is frequent. To avoid typing the entire address at any given time, we can use a pseudonym.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">When assigning a pseudonym, try to follow a rule so that it is easy to remember the one assigned to a person at any time. The pseudonym can also be used to send the same mail to a list of addresses. To do this, we only have to create a pseudonym that refers to the addresses we want.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">If you use e-mail on a daily basis, it is possible that a user will receive several received and deleted e-mails. However, the user can define as many folders or subfolders as they wish. In this way, you will be able to have the messages available according to the subject, the sender, the date ,etc.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Message filters.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In order to avoid the bombardment of advertising messages - a well-known phenomenon, such as spam - and to avoid receiving messages from people we don\'t want to know about, in most e-mail programs or we can use message filters. This tool is just a sieve, through which only messages that really interest us pass.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In this way, we can delete directly from our server those e-mails that come from a certain address, or those that contain certain words within the body of the message itself.&nbsp;</span></p><p><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: justify;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The response. The quickest and most comfortable way to respond to a message, after reading it, is to click on the Reply or Replan button. The program will create a new message with the sender\'s address and with the same subject, usually preceded by the indication Re: This option usually includes the text of the received message in the reply.&nbsp;</span></p><p><br></p><p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">This allows the recipient to know exactly what text the reply refers to, its origin and date. The replied message can also be used to insert the desired reply between its lines. In this way we will answer the recipient in parts.</span></p>','To avoid typing the whole address every time you are going to send an e-mail is necessary to create: ','An specific address','A voice mail','An unique address','A copy of the address','A pseudonym',0,0,0,0,1,'To facilitate the handling of received messages there is the possibility of:','Grouping the e-mails in a single folder ','Converting emails into text documents ','Delete the emails once they have been read','Group the e-mails in different folders','Delete received e-mails daily',0,0,0,1,0,'To avoid the same e-mail to different addresses we must create a pseudonym that:','Be known in all directions','Continually driving all the directions','Refer to all the addresses we want','When sending the message, please confirm receipt of the message','-',0,0,1,0,1,'E-mail programs are commonly divided into','Deleted, deleted, received','Deleted, sent, saved','Sent, saved, deleted','Received, sent, deleted','Sent, removed, deleted ',0,0,0,1,0,'The user is limited to defining','A single folder ','Three folders','Five folders ','Two folders','As many, as you wish',0,0,0,0,0,'346','20760',NULL),(83,'20','COMPREHENSION TEST B','<p dir=\"ltr\" style=\"line-height:1.3800000000000001;text-align: center;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;fon