INSERT INTO `noticias` VALUES (2,'Cuando la pobreza también se refleja en el aprendizaje','12/08/2020','evento,ayuda, solidaridad','<center><img src=\"//www.elcolombiano.com/documents/10157/0/626x365/23c0/580d365/none/11101/HNXC/image_content_35005797_20200120160434.jpg\"></center>\r\n<br>\r\n<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">En los países de ingresos medios y bajos hay más pobreza de aprendizaje. Es decir, las capacidades académicas y de comprensión, por ejemplo, de un texto sencillo, son más limitadas. Tanto que el Banco Mundial pronostica que en el mundo, a 2030, el 43 % de los niños “seguirán sin entender lo suficiente”.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">“La escolarización sin aprendizaje no es solo una oportunidad desaprovechada, también una gran injusticia”, plantea el informe&nbsp;<em>“Fin de la pobreza de aprendizaje: ¿qué se necesitará?”</em>, publicado a finales del año pasado por el banco.<b style=\"font-weight: bold !important; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\"></b></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">La evidencia resulta preocupante. El informe sostiene que en Kenya, Tanzania y Uganda, cuando les pidieron a los niños de tercer grado que leyeran una frase sencilla como “el perro se llama Fido”, el 75 % de los evaluados no entendió, es decir, solo 25 de cada 100 niños tenía claro qué estaba leyendo.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">Los peores indicadores de aprendizaje los tienen Nigeria (98,7 %), Chad (97,7 %), Yemen (94,7 ) y Afganistán (93,4 %); mientras que los mejores resultados están en Holanda (1,6 %), Vietnam (1,7 %), Suecia (2,3 %) y Finlandia (2,6 %). “La nueva medición tiene como objetivo revelar los déficit en alfabetización y estimular las acciones para garantizar que todos los niños puedan adquirir alfabetización y habilidades básicas”, como leer o escribir.</p><h5 class=\"entretitulo\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 20px; font-family: robotoregular; padding: 10px 0px 0px; border: 0px; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal;\">Realidad mundial</h5><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">En Nigeria uno de cada tres niños no va a la escuela y una de cada dos niñas tampoco lo hace, según el informe. “En un país donde las mujeres están condenadas al analfabetismo, la educación es clave para romper el círculo vicioso de la pobreza”, señala Unicef que, poniendo como ejemplo el modelo educativo de ese país, señala que allí se vive bajo el flagelo de la pobreza y solo se invierte el 3,1 % del Producto Interno Bruto (PIB) en este sector, según el Banco, mientras que Finlandia destina el 6,9 %.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><em>Wilson Bolívar</em>, decano de la Facultad de Educación de la Universidad de Antioquia, sostiene que los sistemas educativos, en especial en los países con ingresos medios y bajos, deben adaptarse a los requerimientos actuales, “caracterizados por una sociedad con altos flujos de información a la cual las personas pueden acceder de manera instantánea y sin intermediarios”, aunque sin ignorar las condiciones sociales y económicas que, como lo plantea el Banco, son las que más influyen en las capacidades educativas.</p><div id=\"vidoomy\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"></div><div class=\"admanplayer\" style=\"margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"></div><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">El informe resalta que la educación es un derecho humano básico y fundamental para desbloquear las capacidades humanas, por lo que es esencial “garantizar que se cumpla de manera significativa para todos”. Aunque resulta lógico, en la práctica no se da.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">El Banco, en el capítulo de desafíos, señala que los modelos educativos deben enfocarse en el fortalecimiento de la labor docente, es decir, que el profesor sea un elemento clave en la sociedad y que sea “práctico, enfocado en el desarrollo profesional y que realice seguimiento” a sus labores.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><em>Jhon Alexander Echeverri</em>, profesor de Envigado, que fue finalista del&nbsp;<em>“Global Teacher Prize”</em>&nbsp;en 2018, pone el dedo en la llaga y menciona que las proyecciones del Banco son “lamentables”, pero explica que aunque los modelos funcionen, “muchas veces los bienes y el dinero se pierden en corrupción y en políticas que no benefician a las comunidades más vulnerables, impidiendo educación de calidad”.</p><h5 class=\"entretitulo\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 20px; font-family: robotoregular; padding: 10px 0px 0px; border: 0px; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal;\">¿Y Colombia?</h5><div class=\"text\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: &quot;Times New Roman&quot;; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">El país, de acuerdo con el reporte, tiene un 48,6 % de dificultades de aprendizaje, y aparece en el cuarto lugar en Sudamérica, donde el mejor educado es Chile, que tiene un 36,8 %.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><em>Cecilia Dimaté</em>, decana de la Facultad de Ciencias de la Educación de la Universidad Externado de Colombia, señala que el problema, sobre todo en países como el nuestro y los que nos rodean, se basa en un factor común: inversión.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">“Todavía nos falta en invertir al sistema”, dice la experta, aunque reconoce que los dos últimos gobiernos han intentado hacer la tarea. Por ejemplo, la educación este año en Colombia cuenta con un presupuesto de $44,1 billones, lo que lo ubica como el sector con más recursos este año.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">Sin embargo, de acuerdo con el Ministerio de Educación, solo el 9,2 % del presupuesto se destina en inversión ($4 billones), mientras que en funcionamiento se destina el 90,8 % del presupuesto, equivalente a $40,1 billones.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">“En muchos casos las instituciones, incluso en otros países, siguen instaladas en el paradigma tradicional de la “enseñanza” basado en lo memorístico, privilegiando la acumulación de saberes y se privilegian prácticas centradas en llenar al estudiante de información que no transciende los contextos o no ayuda a resolver problemas”, dice Bolívar.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">Tanto Dimaté como Bolívar señalan que es clave la infraestructura, los servicios tecnológicos y, en el caso de Colombia, la Jornada Única, que busca una formación integral. Ambos precisan que hay un trecho en materia de alimentación escolar y transporte. Dimaté explica que “se necesita que los niños puedan estar cómodamente en la escuela y no como ahora, con paños de agua cubriendo las necesidades que implica tenerlos todo el día en la escuela”.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">También hay que mencionar que el país tiene un antecedente por mejorar, enfocado en los resultados de las Pruebas Pisa en el indicador de lectura, el cual bajó de 425 puntos en la medición de 2015 a 412 en 2018, según los resultados que fueron publicados en diciembre del año pasado.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">Sobre esto, la ministra de Educación,&nbsp;<em>María Victoria Angulo</em>, indicó que para mejorar los resultados y sobre todo la comprensión lectora, el país empezó a implementar la estrategia&nbsp;<em>“Evaluar para avanzar”,</em>&nbsp;que tiene como fin generar información sobre los factores más débiles de la educación que se ofrece y, de esa manera, diseñar estrategias que permitan mejorarlos. “Es importante que los resultados se utilicen como una herramienta que se suma a la información de las pruebas nacionales y la evaluación en cada una de las instituciones, para orientar los esfuerzos de los actores involucrados en el proceso educativo”, acota Angulo.</p></div><h5 class=\"entretitulo\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 20px; font-family: robotoregular; padding: 10px 0px 0px; border: 0px; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal;\">¿Qué ejemplo seguir?</h5><div class=\"text\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: medium; line-height: inherit; font-family: &quot;Times New Roman&quot;; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: normal;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">Los consultados coinciden en que no la solución no es seguir un ejemplo tal como se aplica en otros países. Por ejemplo, citan a Finlandia, que en diversos informes del Banco o de la Unesco lo muestran como el país en el que la educación es modelo, pero tiene un contexto diferente.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">No obstante, en este informe del Banco, Vietnam es el que aparece con menores problemas de aprendizaje en su población. El Banco plantea que los países con problemas de aprendizaje deben cambiar los planes de estudio y los sistemas de evaluación, “con exámenes que se centren en la adquisición de habilidades y los maestros reciban credenciales de formación y aprendizaje entre pares”. Además, asegura que deben aumentar los presupuestos para obtener una educación de calidad desde la primera infancia.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">“No me atrevería a decir que nos debemos inclinar por este o por aquel, porque hemos intentado con el modelo finlandés o el brasileño, pero son países que tienen contextos diferentes al nuestro”, señala Dimaté. El caso de Finlandia, agrega la experta, implicó una transformación sobre el sistema y cómo miran al maestro, además de la inversión.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">Bolívar, Dimaté y el informe, apuntan a la importancia de la educación básica, y la necesidad de tener educadores mejores en la etapa inicial, pues es fundamental para que los estudiantes comprendan más su mundo y su contexto y lleguen bien preparados a la formación en bachiller, técnica, tecnológica o profesional (ver Radiografía).</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\">“La educación en los primeros años todavía es muy débil”, comenta Dimaté, quien dice que unas bases sólidas, como todo en la vida, le darán estabilidad al futuro, ya sea en educación o en la construcción de una casa.</p></div>','//www.elcolombiano.com/documents/10157/0/626x365/23c0/580d365/none/11101/HNXC/image_content_35005797_20200120160434.jpg','En los países de ingresos medios y bajos hay más pobreza de aprendizaje. Es decir, las capacidades académicas y de comprensión, por ejemplo, de un texto sencillo, son más limitadas.'),(7,'Pruebas Pisa: Colombia obtuvo puntajes más bajos que el promedio de la OCDE','27/08/2020','evento,ayuda, solidaridad','<p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\">El 40% de los estudiantes colombianos obtuvieron bajos resultados en las tres pruebas centrales: lectura, ciencias y matemáticas.</p><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\"><img src=\"https://www.elespectador.com/resizer/-110pdW6DeM3h8vUq0C_rPiBAP0=/657x0/cloudfront-us-east-1.images.arcpublishing.com/elespectador/GBN5XKRM7NBCXPTBZ67VZBP3ZI.jpg\" alt=\"En Colombia, las niñas superaron a los niños en lectura en 10 puntos, la brecha de género más pequeña en todos los países. / Archivo\" height=\"655\" width=\"984\" style=\"color: rgb(255, 255, 255); font-size: 0.875rem; width: 656.656px;\"></p><figure class=\"Article-Image\" style=\"margin-bottom: 20px; background: rgb(29, 29, 29); color: rgb(255, 255, 255); font-size: 0.875rem; line-height: 1.3rem; font-family: Merriweather, serif; letter-spacing: normal;\"><figcaption style=\"padding: 10px;\">En Colombia, las niñas superaron a los niños en lectura en 10 puntos, la brecha de género más pequeña en todos los países. / Archivo</figcaption></figure><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\">Los resultados de las&nbsp;<span style=\"font-weight: bolder;\">pruebas Pisa</span>, que evalúa los conocimientos de los estudiantes de 15 años en 79 países del mundo, salieron a la luz este martes. Después de poner a prueba a 8.500 alumnos&nbsp; de 250 colegios públicos y privados a principio del año pasado, las cifras reportadas para Colombia no son muy alentadoras. La cifra nacional obtuvo&nbsp;puntajes más bajos que el promedio de la OCDE en lectura (412 puntos), matemáticas (391) y ciencias (413), y sus puntajes fueron más similares a los de los estudiantes en Albania, México, la República del Norte de Macedonia y Qatar.<a href=\"https://www.elespectador.com/noticias/educacion/minimo-por-gratitud-la-actitud-frente-venezuela-tendria-que-ser-diferente-articulo-893898\" style=\"color: rgb(234, 10, 10); transition: all 0.3s cubic-bezier(0.55, 0, 0.1, 1) 0s;\">&nbsp;(Lea:&nbsp;“Por gratitud, la actitud frente a Venezuela tendría que ser diferente”: Socorro Ramírez)&nbsp;</a></p><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\">En comparación con los resultados de 2015, las calificaciones de PISA 2018 (al considerarse un período más largo) apuntan a que \"el rendimiento promedio mejoró en todos asignaturas, incluida la lectura, desde que el país participó por primera vez en PISA en 2006\". Sin embargo, este año se evidencia que el&nbsp;<span style=\"font-weight: bolder;\">desempeño de lectura,</span>&nbsp;que fue la asignatura principal,&nbsp;está por debajo al registrado en la anterior evaluación.&nbsp;</p><p style=\"text-align: center;\"><img alt=\"\" data-picture-align=\"left\" data-picture-mapping=\"main\" src=\"https://www.elespectador.com/sites/default/files/pruebas_pisa_2018.png?timestamp=1575378295\" width=\"700\"></p><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\">En el panorama actual, la mitad de los estudiantes evaluados alcanzó el nivel 2 de competencia en lectura y ciencias mientras que, solo un 35 % obtuvo el mismo nivel en matermáticas. Casi el 40 % de los alumnos colombianos obtuvo bajos resultados en las tres materias.&nbsp;Una explicación de ello es el estado socioeconómico. Este indicador explica el 14 % de la variación en el rendimiento de la lectura, una cifra mayor al promedio de la OCDE que es de 12 %. Sin embargo, esta realidad ubica al país más abajo que naciones como Francia (18%), Hungría (19%), Perú (21). %) y Uruguay (16%).</p>','https://www.elespectador.com/resizer/-110pdW6DeM3h8vUq0C_rPiBAP0=/657x0/cloudfront-us-east-1.images.arcpublishing.com/elespectador/GBN5XKRM7NBCXPTBZ67VZBP3ZI.jpg','El 40% de los estudiantes colombianos obtuvieron bajos resultados en las tres pruebas centrales: lectura, ciencias y matemáticas.'),(3,'Pruebas PISA: los estudiantes latinoamericanos reprueban en lectura y matemáticas','14/08/2020','evento,ayuda, solidaridad','<center><img src=\"https://s.france24.com/media/display/fbd56e2e-8972-11e9-bd51-005056bf87d6/w:980/p:16x9/escuela-peruana-agencia-andina.webp\" /></center>\r\n<p class=\"t-content__chapo\" style=\"margin-right: auto; margin-bottom: 28px; margin-left: auto; padding: 0px; border: none; font-size: 1.9rem; font-weight: 700; line-height: 1.5; max-width: 850px; color: rgb(0, 0, 0); font-family: Roboto, Arial, sans-serif; letter-spacing: normal;\">La prueba PISA de 2018 deja unos datos académicos muy regulares para la región que ve cómo la brecha respecto a los resultados de los alumnos europeos o asiáticos se mantiene...o incluso aumenta.</p><p class=\"t-content__body u-clearfix\" style=\"margin: 0px auto 20px; padding: 0px; border: none; max-width: 850px; color: rgb(0, 0, 0); font-family: Roboto, Arial, sans-serif; letter-spacing: normal;\"><p class=\"m-interstitial\" style=\"margin: 0px; padding: 0px; border: none; position: relative; display: flex; -webkit-box-pack: center; justify-content: center; float: right;\"><div data-readmore-target=\"\" class=\"m-interstitial__ad\" style=\"margin: 0px; padding: 0px 0px 0px 30px; box-sizing: content-box; border: none; -webkit-box-pack: center; justify-content: center; flex-wrap: wrap; display: flex; width: 300px;\"></div></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">El 80% de los alumnos de Latinoamérica reprobó en las pruebas de compresión lectora y matemáticas recogidas por el Informe PISA. Este documento, realizado por la Organización para la Cooperación y el Desarrollo Económicos (OCDE), reflejó una mejor preparación de los países asiáticos y unos datos malos para toda la región latinoamericana.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Los jóvenes latinos están en el nivel mínimo de competencia en estos aspectos académicos que permiten tener un buen desempeño escolar y generar habilidades para la vida laboral. Es más, nueve países latinoamericanos incluidos en el estudio tienen alrededor de la mitad de sus estudiantes en los niveles más bajos de rendimiento, mientras que en República Dominicana prácticamente todos los alumnos están en esos niveles.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">\"Es extremadamente preocupante porque sin competencias básicas nuestros chicos se van a quedar al margen en muchos aspectos de la economía global y de lo que pueden hacer respecto de los retos de la agenda internacional\", consideró la directora de la OCDE, Gabriela Ramos.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">La prueba se llevó a cabo el año pasado para evaluar a unos 600.000 estudiantes de 15 años de edad, que representan a 32 millones de alumnos en 79 países y economías, quienes respondieron a un examen de dos horas con preguntas de lectura, ciencias y matemáticas realizado por primera vez de manera electrónica.</p><div class=\"tms-ad\" id=\"tms-ad-inread-8200046185279379\" data-tms-ad-type=\"inread\" data-tms-ad-provider=\"teads\" data-tms-ad-status=\"idle\" style=\"margin: 0px auto; padding: 0px; border: none; max-width: 530px; line-height: 0; font-size: 0px; overflow: hidden;\"><div class=\"teads\" style=\"margin: 0px; padding: 0px; border: none;\"></div></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Argentina, Brasil, Chile, Colombia, Costa Rica, República Dominicana, México, Panamá, Perú y Uruguay participaron en esta prueba que también midió cómo ha evolucionado este desempeño desde el año 2000 y la manera en que los adolescentes afrontan los retos de su educación de manera personal y familiar.</p><div id=\"em-WBMZ1593-F24-ES-20191203\" class=\"m-em-flash\" style=\"margin: 0px auto 28px; padding: 0px; border: none; display: flex; -webkit-box-pack: center; justify-content: center; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; -webkit-box-align: center; align-items: center; clear: both;\"><div class=\"twitter-tweet twitter-tweet-rendered\" style=\"margin: 10px 0px; padding: 0px; border: none; max-width: 550px; display: flex; width: 550px;\"><iframe id=\"twitter-widget-0\" scrolling=\"no\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/index.html?dnt=false&amp;embedId=twitter-widget-0&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1201807712822210561&amp;lang=es&amp;origin=https%3A%2F%2Fwww.france24.com%2Fes%2F20191203-pruebas-pisa-los-estudiantes-latinoamericanos-reprueban-en-lectura-y-matem%25C3%25A1ticas&amp;siteScreenName=France24_es&amp;theme=light&amp;widgetsVersion=223fc1c4%3A1596143124634&amp;width=550px\" data-tweet-id=\"1201807712822210561\" style=\"position: static; visibility: visible; width: 550px; height: 564px; display: block; flex-grow: 1;\"></iframe></div></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Ramos recalcó que América Latina es la región con los resultados más desiguales, en los que la variante socioeconómica tiene \"un impacto muy negativo\" en los jóvenes que se encuentran en los niveles más bajos y en donde \"es más complicado\" ascender en la escala social.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Los estudiantes chilenos son los que mayores calificaciones obtuvieron en la prueba al sumar poco más de 450 puntos, seguidos por los de Costa Rica y Uruguay con poco menos de 430, México con cerca de 420, Colombia y Brasil con poco más de 410, Argentina y Perú con poco más de 400, y Panamá y República Dominicana por debajo de los 400.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Aun así, a nivel global los datos entre los jóvenes examinados no son muy buenos ya que uno de cada cuatro pierde en estas materias. Los mejor posicionados siguen siendo los asiáticos, pero países europeos como España o Italia tienen grandes déficits.</p><div id=\"em-WBMZ1591-F24-ES-20191203\" class=\"m-em-flash\" style=\"margin: 0px auto 28px; padding: 0px; border: none; display: flex; -webkit-box-pack: center; justify-content: center; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; -webkit-box-align: center; align-items: center; clear: both;\"><div class=\"twitter-tweet twitter-tweet-rendered\" style=\"margin: 10px 0px; padding: 0px; border: none; max-width: 550px; display: flex; width: 550px;\"><iframe id=\"twitter-widget-1\" scrolling=\"no\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/index.html?dnt=false&amp;embedId=twitter-widget-1&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1201864220956151808&amp;lang=es&amp;origin=https%3A%2F%2Fwww.france24.com%2Fes%2F20191203-pruebas-pisa-los-estudiantes-latinoamericanos-reprueban-en-lectura-y-matem%25C3%25A1ticas&amp;siteScreenName=France24_es&amp;theme=light&amp;widgetsVersion=223fc1c4%3A1596143124634&amp;width=550px\" data-tweet-id=\"1201864220956151808\" style=\"position: static; visibility: visible; width: 550px; height: 797px; display: block; flex-grow: 1;\"></iframe></div></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span style=\"font-weight: 700;\">Aunque hay un aumento de la escolaridad la brecha sigue siendo amplia</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Lo más positivo que se puede reflejar es que respecto a los resultados obtenidos desde hace casi 20 años con la primera prueba, en los países latinoamericanos ha habido un aumento en la escolaridad y una cobertura más alta para los jóvenes que cursan el último año de educación básica y los primeros de media superior.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Ahora, el reto de los países de la región es incrementar la calidad educativa y destinar más recursos económicos y humanos a las escuelas más desfavorecidas para tratar de erradicar la desigualdad.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">En México, estos datos se han celebrado como una victoria por parte del Ejecutivo de Andrés Manuel López Obrador. Ese país ha logrado avanzar en la cobertura de la escolarización media superior al avanzar 15 puntos porcentuales en tres lustros.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">No obstante, de acuerdo con los datos dados a conocer, en México solo el 1 % de los estudiantes obtuvieron un logro en los niveles de competencia más altos en lectura, matemáticas y ciencias, y el 35 % no consiguieron un nivel mínimo de competencia.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">El 55 % de los estudiantes alcanzaron al menos un nivel 2 de competencia en lectura, en una escala de 5, en tanto que un 44 % llegaron a ese nivel en la prueba de matemáticas y alrededor del 53 % registraron un nivel 2 o superior en ciencias, según afirma el estudio.&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span style=\"font-weight: 700;\">El informe arrojó datos preocupantes para Colombia</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Colombia participaba por quinta vez en estos estudios de la OCDE y tras las mejoras experimentadas desde 2015, había mucha expectativa respecto a los resultados, sin embargo, los datos fueron preocupantes para el Ejecutivo. Se empeoró significativamente los resultados en lectura y ciencias y apenas se mejoró en matemáticas, algo que mantiene la brecha con los países más avanzados.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Colombia&nbsp;obtuvo los resultados más bajos de los países que pertenecen a la OCDE, y según el informe PISA, sus resultados se equiparan a los obtenidos por países no miembros como Albania, Macedonia del Norte y Qatar.</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span style=\"font-weight: 700;\">Diferencias de género en los resultados del informe</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">El informe desgrana una realidad interesante al colocar a las mujeres casi 30 puntos por encima de sus compañeros hombres en comprensión lectora, mientras que los resultados en matemáticas son muy similares.</p><div id=\"em-WBMZ1592-F24-ES-20191203\" class=\"m-em-flash\" style=\"margin: 0px auto 28px; padding: 0px; border: none; display: flex; -webkit-box-pack: center; justify-content: center; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; -webkit-box-align: center; align-items: center; clear: both;\"><div class=\"twitter-tweet twitter-tweet-rendered\" style=\"margin: 10px 0px; padding: 0px; border: none; max-width: 550px; display: flex; width: 550px;\"><iframe id=\"twitter-widget-2\" scrolling=\"no\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/index.html?dnt=false&amp;embedId=twitter-widget-2&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1201828802906742784&amp;lang=es&amp;origin=https%3A%2F%2Fwww.france24.com%2Fes%2F20191203-pruebas-pisa-los-estudiantes-latinoamericanos-reprueban-en-lectura-y-matem%25C3%25A1ticas&amp;siteScreenName=France24_es&amp;theme=light&amp;widgetsVersion=223fc1c4%3A1596143124634&amp;width=550px\" data-tweet-id=\"1201828802906742784\" style=\"position: static; visibility: visible; width: 550px; height: 462px; display: block; flex-grow: 1;\"></iframe></div></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">En países de Latinoamérica&nbsp;parece que esa brecha es inferior al situarse en tan solo 10 puntos en la comprensión lectora y cinco en las matemáticas.<br>&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\">Con EFE y medios locales&nbsp;</p></p>','https://s.france24.com/media/display/fbd56e2e-8972-11e9-bd51-005056bf87d6/w:980/p:16x9/escuela-peruana-agencia-andina.webp','La prueba PISA de 2018 deja unos datos académicos muy regulares para la región que ve cómo la brecha respecto a los resultados de los alumnos europeos o asiáticos se mantiene...o incluso aumenta.'),(4,'América Latina lleva 10 años estancada en el mismo nivel académico, muestra la prueba PISA','16/08/2020','evento,ayuda, solidaridad','<p><span style=\"color: rgb(65, 65, 65); font-family: Georgia, serif; font-size: 18px; letter-spacing: normal;\">Perú es la única economía latinoamericana que registró un avance importante a lo largo de los tests PISA; de la aplicación del 2015 a la del 2018 logró incrementar en 13 puntos el desempeño de sus alumnos en el área de matemáticas. México apenas pudo aumentar el índice en 3 puntos.</span><br></p><p><span style=\"color: rgb(65, 65, 65); font-family: Georgia, serif; font-size: 18px; letter-spacing: normal;\"><br></span></p>\r\n<img src=\"https://www.eleconomista.com.mx/__export/1556476380200/sites/eleconomista/img/2018/07/10/maestro--alumnos-3_jpg.jpg_1348255499.jpg\"><br>\r\n\r\n<p><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">Las economías más grandes de&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">América Latina</strong>, que participan en la prueba PISA, muestran no sólo un desempeño académico bajo de la región en comparación con el resto de los países evaluados, también reflejan un lentísimo avance de la región en términos de incrementar la&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">calidad educativa</strong>.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">México, Costa Rica, Panamá, República Dominicana, Colombia, Perú, Chile, Argentina, Uruguay y Brasil son las naciones latinoamericanas que han participado en la&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">prueba educativa PISA</strong>&nbsp;(Programa Internacional de Evaluación de los Alumnos por sus siglas en inglés) a cargo de la&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">OCDE</strong>&nbsp;(Organización para la Cooperación y el Desarrollo Económicos).</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">Las primeras tres ediciones de la prueba (2000, 2003 y 2006) se enfocaron en un área de estudio cada una, la primera en compresión lectora, la segunda en matemáticas y la tercera en ciencias; a partir de la aplicación del 2009 la prueba se realiza evaluando las tres áreas de estudio de los alumnos.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">Con un umbral de 500 puntos, la&nbsp;<a href=\"https://www.eleconomista.com.mx/politica/Prueba-PISA-2018-Mexico-mantiene-los-mismos-bajos-niveles-en-aprendizaje--20191203-0048.html\" target=\"_blank\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; color: rgb(0, 101, 149); transition:  cursor: pointer; text-rendering: optimizelegibility !important; -webkit-font-smoothing: antialiased !important;\">prueba PISA</a>&nbsp;identifica a los países cuyo promedio resulta superior o inferior al mínimo esperado en estudiantes menores de 15 años.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\">Los países latinoamericanos participantes, incluyendo a México, no han logrado el&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">puntaje aprobatorio de 500 puntos</strong>&nbsp;en ninguna de las áreas de estudio y en ninguna de las ediciones de PISA.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">En casi todas las ediciones de la prueba destacan Uruguay y Chile por obtener las mejores puntuaciones de la región, aunque por debajo de la media. Esto también refleja otra tendencia: la lista de las naciones con las mejores notas sigue teniendo a los mismos protagonistas.</p><h2 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 24px; line-height: 32px; font-family: Georgia, serif; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; color: rgb(65, 65, 65); width: 760px; cursor: initial; clear: both; letter-spacing: normal; \">Algunos resultados</h2><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">En el 2000 se llevó a cabo la&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">primera prueba PISA</strong>, participaron México y Brasil y destacaron por registrar una media de puntuación significativamente inferior al promedio de la OCDE.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">Sólo el 6% de los alumnos mexicanos y el 3% de los brasileños alcanzaron el nivel de excelencia académica (niveles 5 y 6).&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">Nueva Zelanda</strong>,<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">&nbsp;Finlandia</strong>&nbsp;y&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">Canadá</strong>&nbsp;los superaron de manera importante con casi el 20% de sus alumnos en excelencia académica.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">La OCDE señaló en la primera edición de la prueba PISA la importancia del entorno socioeconómico en el desempeño de los alumnos. Los estudiantes privilegiados en promedio muestran mejores resultados, especialmente en los países como México y Brasil, que tienen niveles altos de desigualdad. En los países con mejor distribución del ingreso,&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">la condición socioeconómica tiende a influir menos en el desempeño de los estudiantes</strong>.&nbsp;</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">En la aplicación siguiente, tres años después, cerca del 65% de los alumnos mexicanos y poco más del 75% de los brasileños no alcanzaron el nivel 2 de desempeño y la mayoría se ubicó por debajo del nivel 1. Finlandia, Corea y Canadá tienen sólo a 1 alumno de cada 10 por debajo del nivel 2.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">En la prueba realizada en el 2006, que se enfocó en las habilidades científicas, se integró la participación de Argentina, Chile, Colombia y Uruguay.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">América Latina</strong>&nbsp;volvió a ocupar los sitios más bajos junto con países asiáticos. El mejor desempeño lo obtuvo Chile, por encima de Uruguay, México, Argentina y Brasil, que obtuvieron puntuaciones similares a las de Jordania, Azerbaiyán o Túnez.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">Aunque no existe una regla general que explique por qué el desempeño académico en la región es tan bajo respecto de otros países, las cifras sugieren que el uso de los recursos escolares, la profesionalización de los docentes y la pedagogía en las escuelas son factores que pueden afectar el nivel académico de los alumnos.</p><h2 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 24px; line-height: 32px; font-family: Georgia, serif; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; color: rgb(65, 65, 65); width: 760px; cursor: initial; clear: both; letter-spacing: normal; \">PISA 2015 y 2018: sin avances</h2><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">La más reciente aplicación de la prueba de evaluación académica fue en 2018. Tres sexenios después de la primera aplicación de&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">PISA, México</strong>&nbsp;no ha logrado incrementar el nivel educativo de sus alumnos de educación básica. La tendencia es similar para el resto de los países latinoamericanos.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">En la edición de 2015 participaron México, Costa Rica, República Dominicana, Colombia, Perú, Chile, Argentina (sus resultados no son representativos porque sólo se aplicó en la Ciudad Autónoma de Buenos Aires), Uruguay y Brasil. En la aplicación del 2018 se incorporó Panamá.</p><figure class=\"image\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; display: inline-block; margin-top: 20px; margin-bottom: 50px; position: relative;\"><img alt=\"Prueba PISA 2018\" data-height=\"650\" data-size=\"w:760,h:650\" data-width=\"760\" hspace=\"5\" src=\"https://www.eleconomista.com.mx/export/sites/eleconomista/img/2019/12/03/poli_princi_pisa_2018_031219_1.png_2127055041.png\" title=\"Prueba PISA 2018\" vspace=\"5\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; border: 0px; vertical-align: top; width: 760px; margin: 0px;\"><figcaption style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: 16px; color: rgb(255, 255, 255); position: absolute; left: 20px; bottom: 20px; right: 20px; max-width: 603px;  padding: 12px 18px; text-align: left;\">Prueba PISA 2018</figcaption></figure><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">La única nación que mostró un avance significativo en alguna de las materias del 2015 al 2018 fue&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">Perú</strong>. Su desempeño en matemáticas incrementó 13 puntos, en ciencias creció 6 puntos y puntos y en comprensión lectora se movió 4 puntos. El resto de las naciones no movió significativamente su desempeño académico, incluso en algunas áreas lo redujeron.&nbsp;</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\">La&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">excelencia académica</strong>&nbsp;es casi inexistente en los países latinoamericanos. Uruguay logró colocar al 3.6% de sus alumnos en este nivel al menos en una materia, Chile al 3.3%, Brasil al 2.2%, Colombia al 1.2%, Costa Rica al 0.9%, México y Perú al 0.6% y República Dominicana sólo al 0.1 por ciento.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">Los casos de&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">México</strong>&nbsp;y&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">Brasil</strong>&nbsp;son especialmente particulares: Brasil fue la novena economía más grande del mundo en 2018 y México ocupó la posición número 15, pero en casi veinte años no han logrado mejorar el&nbsp;<strong style=\"font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit; font-weight: bold !important;\">nivel educativo</strong>&nbsp;de sus habitantes.</p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \">“El problema para México no sólo son los malos resultados, sino la poca claridad de las medidas de política pública y desde la sociedad, que permitan frenar el deterioro y empezar a corregir en la dirección correcta”, dijo&nbsp;<a href=\"https://www.eleconomista.com.mx/opinion/Resultados-de-la-prueba-PISA-en-Mexico-20191205-0090.html\" target=\"_blank\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 28px; color: rgb(0, 101, 149); transition: background 0.4s ease 0s; cursor: pointer; text-rendering: optimizelegibility !important; -webkit-font-smoothing: antialiased !important;\">Raúl Martínez Solares en su columna para&nbsp;<em style=\"font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; color: inherit;\">El Economista</em></a>, especialista en economía conductual y educación.</p><p class=\"ck-youtube\" id=\"youtube-10\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; width: 760px; max-width: 100%; display: inline-block; margin: 0px 0px 30px !important;\"><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/-j0-BUMIeJE\" width=\"560\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; width: 760px; height: 371px; max-width: 100%;\"></iframe><span class=\"item first\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px;\"></span><span class=\"item second\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px;\"></span><span class=\"item third\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px;\"></span></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\">ana.garcia@eleconomista.mx</p>','https://www.eleconomista.com.mx/__export/1556476380200/sites/eleconomista/img/2018/07/10/maestro--alumnos-3_jpg.jpg_1348255499.jpg','Perú es la única economía latinoamericana que registró un avance importante a lo largo de los tests PISA; de la aplicación del 2015 a la del 2018 logró incrementar en 13 puntos el desempeño de sus alumnos en el área de matemáticas. México apenas pudo aumentar el índice en 3 puntos.'),(5,'La mayoría de latinoamericanos culminan la secundaria sin saber leer bien','18/08/2020','evento,ayuda, solidaridad','<center><img src=\"https://mindstothe2.com/img/blog/1.jpg\"> </center>\r\n<br>\r\n<p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 6pt 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 6pt 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Un estudio del Instituto de Estadística de la Unesco revela que los niños y adolescentes escolarizados en América Latina carecen de competencias básicas de comprensión lectora.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">En América Latina, un joven requiere de más de una década de estudios formales para culminar la educación secundaria. En muchos países de la región se trata de un paso importante que los jóvenes y sus padres celebran como un gran logro familiar. Sin embargo, los miles de días levantándose temprano, los desvelos de padres y niños, los innumerables gastos y sacrificios no parecen estar dando el resultado esperado.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">De acuerdo con un informe que acaba de publicar el Instituto de Estadísticas de la UNESCO, más de la mitad de los jóvenes en América Latina y el Caribe no alcanzan los niveles de suficiencia requerida en capacidad lectora para el momento en el que concluyen la educación secundaria. En total, hay 19 millones de adolescentes en esta situación.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Según el estudio, 36% de los niños y adolescentes de la región no cuentan con los niveles de lectura adecuados. El balance es un poco mejor cuando se toma en cuenta solo a los niños en edad para cursar la educación primaria: 26% no alcanzan la suficiencia. Los resultados no son más favorables cuando son evaluados en matemáticas. 52% de los niños y jóvenes de América Latina y el Caribe no alcanzan las competencias básicas. La situación es peor en secundaria (62%) que en primaria (46%).</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Estudiantes con problemas de comprensión lectora</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 14%: Norteamérica y Europa</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 31%: Este y sudeste asiático</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 36%: América Latina y el Caribe</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 57%: Asia occidental y norte de África</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 88%: África subsahariana</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Estos indicadores, en los que paradójicamente América Latina y el Caribe aparecen como una de las regiones del mundo mejor posicionadas, revelan grandes desafíos para el futuro.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Nuevo analfabetismo</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Silvia Montoya, directora del Instituto de Estadísticas de la Unesco, considera que los problemas que tienen los jóvenes en comprensión lectora plantean una situación \"dramática\". \"Que haya niños que no tengan las competencias básicas cuando se trata de leer párrafos muy sencillos y extraer información de los mismos yo lo consideraría como una nueva definición de analfabetismo. En el mundo de hoy tener un nivel mínimo de alfabetización ya no es poder leer tu nombre y poder escribir algún hecho de la vida cotidiana\", dijo Montoya en una conversación con BBC Mundo.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"Carecer de comprensión lectora es una especie de discapacidad o de incapacidad para poder insertarse en la sociedad, poder votar y entender las propuestas de los candidatos, poder tener entendimiento de los propios derechos y deberes como ciudadano. Me parece que afecta todas las dimensiones\", agregó. La experta considera la lectura como la habilidad básica, el cimiento sobre el cual se siguen construyendo las demás habilidades.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"El leer para aprender es algo indispensable porque a partir de allí puedes desde ser autodidacta hasta insertarte en el sistema. Sin esa competencia, creo que estamos generando muchos niños y adolescentes que van derecho a muchas frustraciones personales y de integración social y laboral. Sin leer ni entender textos es muy difícil progresar en ningún área\", señaló.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Montoya destacó que en el mundo actual hay una sobreexposición a información presentada en distintas formas y que tiene distintos grados de calidad y confiabilidad, por lo que las personas deben ser capaces de extraer la información y juzgarla por si mismos. \"Ser capaz de leer un aviso de trabajo y entender qué competencias se piden es, por ejemplo, algo básico para cualquier adolescente que está comenzando la vida laboral o que quiera seguir formándose\", dijo.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Una escuela que no funciona</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Pero, ¿dónde está la falla? Hubo una época en la que se pensaba que el problema de la educación en América Latina era que no era inclusiva, que dejaba a muchos niños por fuera.&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Según Montoya, ese es un tema en el que la región ha mejorado de forma rotunda y ahora incluso tienen ventajas comparativas en ese aspecto en relación con otras regiones del mundo. \"Ahora la realidad es que los niños están en el sistema educativo pero hay una incapacidad de la escuela para dotarles con un nivel de aprendizaje que sea razonable y mínimo para las circunstancias que demanda el mundo de hoy y de mañana\", dijo.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Por qué no se logra dar a los estudiantes la formación adecuada obedecen, según explicó, a una combinación de factores. Entre estos menciona la falta de capacitación de los maestros para ocuparse de niños con determinadas características, problemas de infraestructura, pérdidas de días de clase por paros u otras causas, así como elementos relacionados con los propia situación socioeconómica de los estudiantes, \"que pueden venir de hogares con menores ingresos o contar con un menor apoyo familiar. Hay una combinación de factores que pueden variar en cada lugar, pero evidentemente hay una falta de políticas específicas para ocuparse de esta problemática\", indicó Montoya.</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Agregó que hace falta mirar los currículos educativos, la formación de los docentes para asegurarse de que sean capaces de trabajar con niños que vienen de contextos sociales complicados, contar con un ambiente y una infraestructura adecuada, así como políticas sociales que adecuadas. \"No hay manera de resolverlo si no hay una visión integral del sistema educativo\", aseguró.</span></p><p><span id=\"docs-internal-guid-a7fdb88f-7fff-1981-94fa-0a55fcdf5b73\"></span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">En ese esfuerzo advirtió que también hace falta la aplicación de pruebas de evaluación de la calidad educativa, que no se aplican en la mitad de los países del mundo. \"Si no tenemos un sistema de evaluación de los aprendizajes serio, con credibilidad, tampoco se puede hacer mucho porque la única manera que tienen los padres para reclamar es tener información\", advirtió.</span></p>','https://mindstothe2.com/img/blog/1.jpg','Un estudio del Instituto de Estadística de la Unesco revela que los niños y adolescentes escolarizados en América Latina carecen de competencias básicas de comprensión lectora.'),(6,'Mala comprensión lectora tiene a Colombia en el fondo de las pruebas Pisa: ¿Qué hacer?','22/08/2020','evento,ayuda, solidaridad','<p class=\"row\" style=\"margin: 0px -0.75rem; padding: 0px; width: auto; max-width: none; color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\"><p class=\"small-12 columns\" style=\"margin: 0px; padding: 0px 0.75rem; width: 987.188px; float: left; position: relative;\"><p class=\"titleContainer\" style=\"margin: 0px; padding: 0px; width: 963.188px;\"><p class=\"row\" style=\"margin: 0px -0.75rem; padding: 0px; width: auto; max-width: none;\"><p class=\"small-12 columns\" style=\"margin: 0px; padding: 0px 0.75rem; width: 987.188px; float: left; position: relative; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><p itemprop=\"description\" class=\"intro\" style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 0.5rem; margin-left: 0px; padding: 0px 0px 0rem; font-family: &quot;Open Sans&quot;, sans-serif; position: relative; line-height: 2rem !important; font-size: 1.25rem !important;\">Los resultados de las pruebas Pisa 2018 evidenciaron algunas falencias del sistema educativo colombiano, principalmente en el tema de lectura crítica y comprensión donde Colombia desmejoró significativamente. Varios expertos y académicos opinan en qué ha fallado el país y qué se debe hacer para mejorar.</p></p></p></p></p></p><p class=\"row\" style=\"margin: 0px -0.75rem; padding: 0px; width: auto; max-width: none; color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\"><p class=\"large-12 columns\" style=\"margin: 0px; padding: 0px 0.75rem; width: 987.188px; float: left; position: relative;\"><a class=\"th related-news-th\" href=\"https://static.iris.net.co/semana/upload/images/2015/5/26/429078_9339_1.jpg\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(233, 27, 30); line-height: 0; border: 1px solid rgb(255, 255, 255); outline: 0px; display: inline-block; max-width: 100%; box-shadow: none; transition: all 0.2s ease-out 0s; position: relative; padding-bottom: 508.563px; max-height: 0px; overflow: hidden; width: 963.188px; margin-bottom: 0rem;\"><img loading=\"lazy\" class=\"article-image\" src=\"https://static.iris.net.co/semana/upload/images/2015/5/26/429078_9339_1.jpg\" title=\"En 2015 Colombia obtuvo 425 puntos en la prueba de lectura, sin embargo 2018 se evidenció un retroceso importante al obtener 412 puntos.\" alt=\"Mala comprensión lectora tiene a Colombia al fondo de las pruebas PISA: ¿Qué hacer para mejorar?\" style=\"border-width: initial; border-color: initial; border-image: initial; display: block; box-shadow: rgb(233, 27, 30) 0px -2px 0px; padding-top: 2px; margin: 0px; width: 963.188px;\"></a>&nbsp;<small class=\"article-img-caption\" style=\"font-size: 0.8125rem; line-height: 1.5; margin: 0px 0px 8px; display: inline-block; color: rgb(181, 181, 181); bottom: 0px; width: 963.188px; padding: 1rem 1.75rem 1rem 0px; font-family: &quot;Open Sans&quot;, sans-serif;\"><span class=\"icon-camera\" style=\"font-family: semana;\"></span>&nbsp;En 2015 Colombia obtuvo 425 puntos en la prueba de lectura, sin embargo 2018 se evidenció un retroceso importante al obtener 412 puntos.&nbsp;<span style=\"line-height: inherit;\">Foto: cc</span></small></p></p><p class=\"row\" style=\"margin: 0px -0.75rem; padding: 0px; width: auto; max-width: none; color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; font-size: 16px; letter-spacing: normal;\"><p class=\"small-12 medium-8 large-8 columns ContentArticuloOpinion\" style=\"margin: 0px; padding: 0px 0.75rem; width: 658.125px; float: left; position: relative;\"><p class=\"theiaStickySidebar\" style=\"margin: 0px; padding: 0px;\"><div class=\"divAudioPlayerMobile-643045 s-audioplayer\" style=\"margin: 0px; padding: 0px;\"></div><div id=\"contentItem\" style=\"margin: 0px; padding: 0px;\"><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Este martes la Organización para la Cooperación y el Desarrollo Económico (Ocde) entregó los resultados de las pruebas PISA 2018, los cuales generaban mucha expectativa pues en la pasada edición, de 2015, Colombia registró una mejora importante en cada una de las competencias evaluadas (matemáticas, ciencias y lectura).</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Los cerca de 8.000 estudiantes colombianos de 15 años que presentaron la prueba entre abril y mayo de 2018<span style=\"font-weight: 700; line-height: inherit;\">&nbsp;obtuvieron un rendimiento menor que la media de la Ocde, al igual que en 2015, pero disminuyeron su puntaje de lectura (412 puntos frente a 425 de 2015) y ciencias (413 puntos frente a 415 de 2015). Entre tanto, en matemáticas hubo un avance apenas mínimo al pasar de 390 puntos en la pasada edición a 391 en la más reciente.&nbsp;</span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Entre los 37 países miembros, Colombia se ubicó como el de los resultados más bajos, y según el informe presentado el rendimiento de los estudiantes colombianos solo se equipara a los obtenidos por Albania, Macedonia del Norte y Qatar, naciones que no pertenecen a la Ocde.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Este panorama ha suscitado diferentes reacciones e interpretaciones por parte de expertos y académicos, mientras algunos como la directora de posgrados en Economía de la Javeriana, Luz Karime Abadía señalan que<span style=\"font-weight: 700; line-height: inherit;\">&nbsp;“no se puede desconocer la tendencia positiva desde que Colombia presentó por primera vez las pruebas Pisa en 2006 a pesar de los últimos resultados donde no se pudo seguir avanzando”; otros como el pedagogo Julián de Zubiría consideran que los resultados son muy malos.</span></p><ul style=\"list-style-position: outside; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; font-size: 1rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; margin-block-start: 0em; margin-block-end: 0em; padding-inline-start: 0px;\"><li style=\"margin: 0px 0px 1.25rem 20px; padding: 0px; font-size: 1rem; line-height: 1.6; list-style-position: outside;\"><span style=\"font-weight: 700; line-height: inherit;\"><a class=\"article-h-link \" href=\"https://www.semana.com/educacion/articulo/fractales-que-son-esos-patrones-matematicos-infinitos-a-los-que-se-les-llama-la-huella-digital-de-dios/643039\" target=\"_blank\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); line-height: inherit; border: none; outline: 0px; transition: all 0.3s ease 0s;\">Fractales: qué son esos patrones matemáticos infinitos a los que se les llama \"la huella digital de Dios\"</a></span></li></ul><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span style=\"font-weight: 700; line-height: inherit;\">“A Colombia le fue muy mal en las pruebas porque está en la cola y no avanza y peor aún, en el caso de lectura, una competencia fundamental, se retrocede a los niveles de 2006. La situación sigue siendo realmente preocupante, porque además nos estancamos en ciencias y matemáticas”, señaló el experto.</span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">De Zubiría considera que el mal rendimiento de Colombia se puede explicar de forma fácil y es que en el país seguimos con una educación memorística y con un currículo impertinente y fragmentado. Por tal razón considera que la enseñanza del lenguaje debe ser el eje transversal de la educación básica y media en el país.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span style=\"font-weight: 700; line-height: inherit;\">“El Gobierno no ha entendido que para mejorar la lectura crítica el país tiene que pasar de trabajar en lenguaje a trabajar en competencia lectora, en vez de enfatizar en gramática y ortografía como hasta ahora, se debe pasar a competencias comunicativas. En lugar de creer que el lenguaje se mejora con una clase, se debe pasar a entenderlo como una competencia transversal que tenga en cuenta todas las materias”, agregó De Zubiría.</span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">En ese sentido, el reconocido pedagogo precisó que el estancamiento en ciencias y matemáticas también está relacionado con la competencia lectora, pues señala que estas falencias hacen que los estudiantes no entiendas los problemas de otras áreas: “Quien lee muy mal, entiende muy mal un problema en matemática o en otra materia. Seguimos con un currículum fragmentado que se limita a lo informativo”.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">La experta de la Javeriana coincidió en que el modelo educativo no es acorde a las necesidades actuales, enfatizando en que se debe aprovechar el auge de las nuevas tecnologías para atrapar la atención de los estudiantes: “Uno de los factores que hace falta en el sistema educativo es que se tiene una metodología de enseñanza&nbsp; y aprendizaje muy tradicional, cuando los retos contemporáneos y las formas de aprendizaje de los estudiantes han cambiado mucho. No podemos seguir con esa clase magistral donde el profesor enseña y sigue sin importar si hay estudiantes que no entienden”.</p><div id=\"In_Text\" class=\"in_text_articulo\" style=\"margin: 0px; padding: 0px;\"></div><div id=\"Link_In_Text\" class=\"link_in_text_articulo\" style=\"margin: 0px; padding: 0px;\"></div><center></center><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Abadía sostuvo que en Colombia no se ha apostado por la innovación educativa haciendo uso de las facilidades que ofrecen las TIC, con excepción de algunas iniciativas privadas, pero que se necesita que las instituciones oficiales le apuesten a eso, pues el 80% de estudiantes del país asisten a colegios de este tipo.</p><ul style=\"list-style-position: outside; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; font-size: 1rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; margin-block-start: 0em; margin-block-end: 0em; padding-inline-start: 0px;\"><li style=\"margin: 0px 0px 1.25rem 20px; padding: 0px; font-size: 1rem; line-height: 1.6; list-style-position: outside;\"><span style=\"font-weight: 700; line-height: inherit;\"><a href=\"https://www.semana.com/educacion/articulo/al-menos-8-universidades-publicas-estan-en-riesgo-de-no-terminar-el-semestre-que-esta-pasando/642271\" class=\"article-h-link \" target=\"_blank\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); line-height: inherit; border: none; outline: 0px; transition: all 0.3s ease 0s;\">Al menos ocho universidades públicas están en riesgo de no terminar el semestre: ¿Qué está pasando?</a></span></li></ul><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Por su parte, la ministra de Educación, María Victoria Angulo, señaló que los resultados de Colombia en Pisa son un insumo que se deben tener en cuenta para trabajar en la mejora de la educación.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span style=\"font-weight: 700; line-height: inherit;\">“Es importante que los resultados de las Pisa se utilicen como una herramienta que se suma a la información de las pruebas nacionales y de la evaluación en cada una de las instituciones educativas, para orientar los esfuerzos de los distintos actores involucrados en el proceso educativo en beneficio del mejoramiento constante de la educación en el país”, señaló Angulo.</span></p><h3 style=\"text-rendering: optimizelegibility; margin-top: 0.2rem; margin-right: 0px; margin-left: 0px; padding: 0px; font-weight: 700; font-family: Merriweather, Georgia, Times, &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); line-height: 1.4; font-size: 1.3rem;\"><span style=\"line-height: inherit;\">¿Qué hacer para mejorar?</span></h3><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">El gran interrogante que surge después de los desalentadores resultados de las Pisa 2018 es qué se debe hacer en el sistema educativo para mejorar el rendimiento del país en las pruebas que realizarán los estudiantes colombianos en el primer semestre de 2020 y cuyos resultados se entregarán en 2021.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">En ese sentido, Félix Antonio Gómez, decano de la Facultad de Educación en la Universidad Javeriana, señaló que un aspecto fundamental en el que se debe centrar el Gobierno es en la formación docente.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span style=\"font-weight: 700; line-height: inherit;\">“La formación docente en el país tiene que seguirse fortaleciendo unida a las condiciones laborales. Necesitamos, tal como sucede en Finlandia y otros países, atraer a los mejores egresados de los colegios para que ellos se formen y se conviertan en formadores, pero tenemos que volver esta una profesión atractiva, no solamente desde lo académico, sino también desde las condiciones económicas”, señaló.</span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Julián de Zubiría concuerda con el planteamiento de Gómez, pues asegura que “de no formar a los maestros, ellos no tendrán las competencias ni conocimientos para transmitir a los alumnos. Si los maestros no leen críticamente, los alumnos tampoco lo harán”.</p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Además de esto el pedagogo agrega que se debe apostar a la inversión en educación inicial y en la mejora del entorno en los salones de clase: “En contra de lo que se cree los resultados están muy asociados al clima del aula y un país que aún vive en guerra, tan intolerante como el nuestro, tiene un clima de aula muy negativo”.&nbsp;</p><ul style=\"list-style-position: outside; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; font-size: 1rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; margin-block-start: 0em; margin-block-end: 0em; padding-inline-start: 0px;\"><li style=\"margin: 0px 0px 1.25rem 20px; padding: 0px; font-size: 1rem; line-height: 1.6; list-style-position: outside;\"><span style=\"font-weight: 700; line-height: inherit;\"><a href=\"https://www.dinero.com/pais/articulo/colombia-68-entre-100-en-dominio-del-ingles/278728\" class=\"article-h-link \" target=\"_blank\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 0, 0); line-height: inherit; border: none; outline: 0px; transition: all 0.3s ease 0s;\">Colombianos siguen rajados en bilingüismo</a></span></li></ul><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Sobre la posibilidad de adoptar los modelos educativos de países con mejores resultados, el decano de la Facultad de Educación de la Javeriana explicó que si bien pueden ser exitosos en un sitio no garantizan que lo sea en otro país:&nbsp;<span style=\"font-weight: 700; line-height: inherit;\">“Hay que tener en cuenta que cualquier mecanismo de mejoramiento del conocimiento o de las habilidades de la persona debe tener en cuenta el contexto en el que se va a aplicar; no podemos copiar otro modelo de manera exacta, pero sí hay generalidades que se pueden adaptar (...) Hay cosas interesantes en el modelo matemático de Singapur, también en lo que está aplicando Finlandia y otros países, y otras que no serían deseables ni aplicables para Colombia”.</span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\">Finalmente, la ministra de Educación aseguró que para mejorar “es clave hacer equipo con las entidades territoriales, directivos docentes, docentes, estudiantes, familias, comunidad educativa en general y los demás sectores de la sociedad para continuar aportando al cierre de brechas y a la construcción de un modelo educativo basado en la calidad y en los aprendizajes de nuestros niños, niñas y jóvenes\".</p></div></p></p></p>','https://static.iris.net.co/semana/upload/images/2015/5/26/429078_9339_1.jpg','Los resultados de las pruebas Pisa 2018 evidenciaron algunas falencias del sistema educativo colombiano.'),(8,'Los beneficios de la lectura','25/09/2020','leer, ','<p style=\"-webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; color: rgb(0, 0, 0); font-size: 18px; line-height: 26px; overflow-wrap: break-word; font-family: TiemposText-Regular, serif; letter-spacing: normal;\"><a href=\"https://images.app.goo.gl/yVPD25A7RCUHVJCo6\">https://images.app.goo.gl/yVPD25A7RCUHVJCo6</a>Dicen que a la lectura sólo hay que dedicarle los ratos perdidos, que se pierde vida mientras se lee. Lo cierto es que, agradable&nbsp;<span style=\"-webkit-font-smoothing: antialiased; font-family: TiemposText-Semibold, serif;\">pasatiempo</span>&nbsp;para muchos,&nbsp;<span style=\"-webkit-font-smoothing: antialiased; font-family: TiemposText-Semibold, serif;\">obligación</span>&nbsp;para otros, leer es un beneficioso ejercicio mental. Rendir culto al cuerpo está en boga, pero ¿y dedicar tiempo al cultivo de la mente? “Al igual que nos cuidamos y vamos cada vez más al gimnasio, deberíamos dedicar media hora diaria a la lectura”, sostiene el escritor catalán Emili Teixidor, autor de&nbsp;<em>La lectura y la vida</em>&nbsp;(Columna) y de la exitosa novela que inspiró la película&nbsp;<em>Pa negre</em>.</p><p style=\"-webkit-font-smoothing: antialiased; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; color: rgb(0, 0, 0); font-size: 18px; line-height: 26px; overflow-wrap: break-word; font-family: TiemposText-Regular, serif; letter-spacing: normal;\"><br style=\"-webkit-font-smoothing: antialiased;\">Favorecer la concentración y la empatía, prevenir la&nbsp;<span style=\"-webkit-font-smoothing: antialiased; font-family: TiemposText-Semibold, serif;\">degeneración cognitiva</span>&nbsp;y hasta predecir el éxito profesional son sólo algunos de los beneficios encubiertos de la lectura. Sin contar que “el acto de leer forma parte del acto de vivir”, dice el ex ministro Ángel Gabilondo, catedrático de Filosofía en la Universidad Autónoma de Madrid y autor del reciente ensayo&nbsp;<em>Darse a la lectura</em>&nbsp;(RBA). Para Gabilondo, la lectura “crea, recrea y transforma. Una buena selección de libros es como una buena selección de alimentos: nutre”.<img src=\"https://images.app.goo.gl/yVPD25A7RCUHVJCo6\" style=\"font-family: Roboto, sans-serif, serif; font-size: 14px; letter-spacing: 0.2px;\" alt=\"\"></p>',NULL,NULL);
