INSERT INTO `noticiasen` VALUES (2,'When poverty is also reflected in learning','12/08/2020','evento,ayuda, solidaridad','<center><img src=\"//www.elcolombiano.com/documents/10157/0/626x365/23c0/580d365/none/11101/HNXC/image_content_35005797_20200120160434.jpg\"></center>\r\n<br>\r\n<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In low- and middle-income countries, there is more learning poverty. in other words, the academic and comprehension capacities, for example, of a simple text, are more limited.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"Schooling without learning is not just a missed opportunity, it is also a great injustice,\" says the report \"End of learning poverty: what will it take?\", Published late last year by the bank.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The evidence is troubling. The report argues that in Kenya, Tanzania and Uganda, when third graders were asked to read a simple phrase such as “the dog\'s name is Fido,” 75% of those tested did not understand, that is, only 25 out of each 100 children knew what he was reading.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The worst learning indicators are in Nigeria (98.7%), Chad (97.7%), Yemen (94.7) and Afghanistan (93.4%); while the best results are in the Netherlands (1.6%), Vietnam (1.7%), Sweden (2.3%) and Finland (2.6%). \"The new measurement aims to reveal literacy deficits and stimulate actions to ensure that all children can acquire literacy and basic skills,\" such as reading or writing.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">World reality</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In Nigeria, one in three boys does not go to school and one in two girls does not, according to the report. \"In a country where women are condemned to illiteracy, education is key to breaking the vicious cycle of poverty,\" says Unicef ​​who, using the educational model of that country as an example, points out that people live there under the scourge of poverty. poverty and only 3.1% of Gross Domestic Product (GDP) is invested in this sector, according to the Bank, while Finland allocates 6.9%.</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Wilson Bolívar, dean of the Faculty of Education at the University of Antioquia, argues that educational systems, especially in low- and middle-income countries, must adapt to current requirements, “characterized by a society with high flows of information to which people can access instantly and without intermediaries ”, although without ignoring the social and economic conditions that, as stated by the Bank, are the ones that most influence educational capacities.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The report highlights that education is a basic and fundamental human right to unlock human capacities, so it is essential to \"ensure that it is fulfilled in a meaningful way for all.\" Although it is logical, in practice it does not happen.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The Bank, in the chapter on challenges, indicates that educational models should focus on strengthening the teaching work, that is, that the teacher is a key element in society and that it is “practical, focused on professional development and that follow up ”on your work.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Jhon Alexander Echeverri, a professor from Envigado, who was a finalist for the “Global Teacher Prize” in 2018, puts his finger on the spot and mentions that the Bank\'s projections are “regrettable”, but explains that although the models work, “many times the goods and money are lost in corruption and in policies that do not benefit the most vulnerable communities, preventing quality education ”.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">And Colombia?</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The country, according to the report, has 48.6% learning difficulties, and appears in fourth place in South America, where the best educated is Chile, which has 36.8%.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Cecilia Dimaté, dean of the Faculty of Educational Sciences of the Externado de Colombia University, points out that the problem, especially in countries like ours and those around us, is based on a common factor: investment.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"We still need to invest in the system,\" says the expert, although she acknowledges that the last two governments have tried to do the job. For example, education this year in Colombia has a budget of $ 44.1 billion, which places it as the sector with the most resources this year.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">However, according to the Ministry of Education, only 9.2% of the budget is spent on investment ($ 4 billion), while 90.8% of the budget is spent on operations, equivalent to $ 40.1 billion.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"In many cases, institutions, even in other countries, are still installed in the traditional paradigm of\" teaching \"based on memory, favoring the accumulation of knowledge and favoring practices focused on filling the student with information that does not transcend contexts or it doesn\'t help solve problems, ”says Bolívar.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Both Dimaté and Bolívar point out that infrastructure, technological services and, in the case of Colombia, the One Day, which seeks comprehensive training, is key. Both specify that there is a stretch in terms of school meals and transport. Dimaté explains that \"children need to be able to be comfortably at school and not like now, with cloths of water covering the needs of having them all day at school\".</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">It should also be mentioned that the country has a history to improve, focused on the results of the Pisa Tests in the reading indicator, which fell from 425 points in the measurement of 2015 to 412 in 2018, according to the results that were published in December of last year.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Regarding this, the Minister of Education, María Victoria Angulo, indicated that in order to improve the results and especially reading comprehension, the country began to implement the strategy \"Evaluate to advance\", which aims to generate information on the weakest factors of the education offered and, in this way, design strategies to improve them. \"It is important that the results are used as a tool that is added to the information from the national tests and the evaluation in each of the institutions, to guide the efforts of the actors involved in the educational process,\" Angulo notes.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">What example to follow?</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Those consulted agree that the solution is not to follow an example as applied in other countries. For example, they cite Finland, which in various Bank or Unesco reports show it as the country in which education is a model, but has a different context.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">However, in this Bank report, Vietnam is the one that appears with the least learning disabilities in its population. The Bank argues that countries with learning disabilities should change curricula and assessment systems, \"with exams that focus on the acquisition of skills and teachers receive training and peer learning credentials.\" In addition, it ensures that budgets must increase to obtain quality education from early childhood.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"I would not dare to say that we should lean towards this or that one, because we have tried with the Finnish or the Brazilian model, but they are countries that have different contexts from ours,\" says Dimaté. The case of Finland, adds the expert, implied a transformation about the system and how they look at the teacher, in addition to the investment.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><strong><br></strong></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Bolívar, Dimaté and the report point to the importance of basic education, and the need to have better educators in the initial stage, as it is essential for students to understand more about their world and its context and to arrive well prepared for training in bachelor, technical, technological or professional (see Radiography).</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 7px 0px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 17px; font-family: robotoregular; vertical-align: baseline; color: rgb(57, 57, 57); overflow-wrap: break-word;\"><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">\"Education in the early years is still very weak,\" says Dimaté, who says that a solid foundation, like everything in life, will give stability to the future, whether in education or in the construction of a house.</span></p>','//www.elcolombiano.com/documents/10157/0/626x365/23c0/580d365/none/11101/HNXC/image_content_35005797_20200120160434.jpg','In low- and middle-income countries, there is more learning poverty. in other words, the academic and comprehension capacities, for example, of a simple text, are more limited.'),(7,'PISA Tests: Colombia obtained scores lower than the OECD','27/08/2020','evento,ayuda, solidaridad','<p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Average </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">40% of Colombian students obtained low results on the three core tests: reading, science and mathematics.</span></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\"><br></span></p><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\"><img src=\"https://www.elespectador.com/resizer/-110pdW6DeM3h8vUq0C_rPiBAP0=/657x0/cloudfront-us-east-1.images.arcpublishing.com/elespectador/GBN5XKRM7NBCXPTBZ67VZBP3ZI.jpg\" alt=\"En Colombia, las niñas superaron a los niños en lectura en 10 puntos, la brecha de género más pequeña en todos los países. / Archivo\" height=\"655\" width=\"984\" style=\"color: rgb(255, 255, 255); font-size: 0.875rem; width: 656.656px;\"></p><figure class=\"Article-Image\" style=\"margin-bottom: 20px; background: rgb(29, 29, 29); color: rgb(255, 255, 255); font-size: 0.875rem; line-height: 1.3rem; font-family: Merriweather, serif; letter-spacing: normal;\"><figcaption style=\"padding: 10px;\"><span id=\"docs-internal-guid-10642298-7fff-120b-c9aa-c9772640e7b7\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In Colombia, girls outperformed boys in reading by 10 points, the smallest gender gap in all countries. / Archive</span></span><br></figcaption></figure><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\"><span id=\"docs-internal-guid-6c2c8fe9-7fff-a0c6-e4cc-b5b77ed063ef\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The results of the Pisa tests, which assesses the knowledge of 15-year-old students in 79 countries around the world, were released on Tuesday. After testing 8,500 students from 250 public and private schools at the beginning of last year, the figures reported for Colombia are not very encouraging. The national figure scored lower than the OECD average in reading (412 points), mathematics (391) and science (413), and its scores were more similar to those of students in Albania, Mexico, the Republic of the North from Macedonia and Qatar. <a href=\"https://www.elespectador.com/noticias/educacion/por-gratitud-la-actitud-frente-a-venezuela-tendria-que-ser-diferente-socorro-ramirez/\">(Read: “Out of gratitude, the attitude towards Venezuela should be different”: Socorro Ramírez).</a></span></span><br></p><p class=\"font--secondary\" style=\"color: rgb(33, 37, 41); font-family: Merriweather, serif; font-size: 18px; letter-spacing: normal;\"><span id=\"docs-internal-guid-6de7e6d4-7fff-9df8-ad3e-0f27aaba9848\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Compared to the 2015 results, the PISA 2018 scores (considering a longer period) suggest that \"average performance has improved in all subjects, including reading, since the country first participated in PISA in 2006.\" . However, this year it is evident that reading performance, which was the main subject, is below that registered in the previous evaluation.</span></span></p><p style=\"text-align: left;\"><img alt=\"\" data-picture-align=\"left\" data-picture-mapping=\"main\" src=\"https://www.elespectador.com/sites/default/files/pruebas_pisa_2018.png?timestamp=1575378295\" width=\"700\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">In the current scenario, half of the evaluated students reached level 2 of proficiency in reading and science, while only 35% obtained the same level in mathematics. Almost 40% of Colombian students obtained low results in all three subjects. One explanation for this is socioeconomic status. This indicator explains 14% of the variation in reading performance, a figure higher than the OECD average of 12%. However, this reality places the country lower than nations such as France (18%), Hungary (19%), Peru (21). %) and Uruguay (16%).</span></p>','https://www.elespectador.com/resizer/-110pdW6DeM3h8vUq0C_rPiBAP0=/657x0/cloudfront-us-east-1.images.arcpublishing.com/elespectador/GBN5XKRM7NBCXPTBZ67VZBP3ZI.jpg','Average 40% of Colombian students obtained low results on the three core tests: reading, science and mathematics.'),(3,'PISA Tests: Latin American students test in reading and math','14/08/2020','evento,ayuda, solidaridad','<center><img src=\"https://s.france24.com/media/display/fbd56e2e-8972-11e9-bd51-005056bf87d6/w:980/p:16x9/escuela-peruana-agencia-andina.webp\"></center>\r\n<p class=\"t-content__chapo\" style=\"margin-right: auto; margin-bottom: 28px; margin-left: auto; padding: 0px; border: none; font-size: 1.9rem; font-weight: 700; line-height: 1.5; max-width: 850px; color: rgb(0, 0, 0); font-family: Roboto, Arial, sans-serif; letter-spacing: normal;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-54fe4c5a-7fff-f857-9f99-6293e5c8a4ba\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The 2018 PISA Test leaves some very regular academic data for the region that sees how the gap regarding the results of european or asian students remains ... or even increases.</span></span><br></p><div data-readmore-target=\"\" class=\"m-interstitial__ad\" style=\"margin: 0px; padding: 0px 0px 0px 30px; box-sizing: content-box; border: none; -webkit-box-pack: center; justify-content: center; flex-wrap: wrap; display: flex; width: 300px;\"></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-448e478d-7fff-d948-2625-f7e859dad19e\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">80% of Latin American students failed the reading comprehension and mathematics tests collected by the PISA Report. This document, produced by the Organization for Economic Cooperation and Development (OECD), reflected better preparation for Asian countries and poor data for the entire Latin American region.</span></span><br></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-7dd03510-7fff-0ba7-dbd6-170fbfc6f542\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Young Latinos are at the minimum level of competence in these academic aspects that allow them to have a good school performance and generate skills for working life. Furthermore, nine Latin American countries included in the study have about half of their students at the lowest levels of achievement, while in the Dominican Republic practically all students are at those levels.</span></span><br></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-9d669149-7fff-4cae-a829-0715060be385\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\"It is extremely worrying because without basic skills our boys are going to be left out in many aspects of the global economy and what they can do with regard to the challenges of the international agenda,\" said the director of the OECD, Gabriela Ramos.</span></span><br></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-7dfed7fd-7fff-77c6-c3c5-429ac2a28d2f\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The test was conducted last year to assess some 600,000 15-year-old students, representing 32 million students in 79 countries and economies, who responded to a two-hour test with questions in reading, science and math. performed electronically for the first time.</span></span><br></p><div class=\"tms-ad\" id=\"tms-ad-inread-8200046185279379\" data-tms-ad-type=\"inread\" data-tms-ad-provider=\"teads\" data-tms-ad-status=\"idle\" style=\"margin: 0px auto; padding: 0px; border: none; max-width: 530px; line-height: 0; font-size: 0px; overflow: hidden;\"><div class=\"teads\" style=\"margin: 0px; padding: 0px; border: none;\"></div></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-40e6ae4e-7fff-abc3-635f-c2e538bd30ea\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Argentina, Brazil, Chile, Colombia, Costa Rica, the Dominican Republic, Mexico, Panama, Peru and Uruguay participated in this test, which also measured how this performance has evolved since 2000 and the way adolescents face the challenges of their education in a personal and family way.</span></span><br></p><div id=\"em-WBMZ1593-F24-ES-20191203\" class=\"m-em-flash\" style=\"margin: 0px auto 28px; padding: 0px; border: none; display: flex; -webkit-box-pack: center; justify-content: center; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; -webkit-box-align: center; align-items: center; clear: both;\"><div class=\"twitter-tweet twitter-tweet-rendered\" style=\"margin: 10px 0px; padding: 0px; border: none; max-width: 550px; display: flex; width: 550px;\"><iframe id=\"twitter-widget-0\" scrolling=\"no\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/index.html?dnt=false&amp;embedId=twitter-widget-0&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1201807712822210561&amp;lang=es&amp;origin=https%3A%2F%2Fwww.france24.com%2Fes%2F20191203-pruebas-pisa-los-estudiantes-latinoamericanos-reprueban-en-lectura-y-matem%25C3%25A1ticas&amp;siteScreenName=France24_es&amp;theme=light&amp;widgetsVersion=223fc1c4%3A1596143124634&amp;width=550px\" data-tweet-id=\"1201807712822210561\" style=\"position: static; visibility: visible; width: 550px; height: 564px; display: block; flex-grow: 1;\"></iframe></div></div><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Ramos stressed that Latin America is the region with the most unequal results, in which the socioeconomic variant has \"a very negative impact\" on young people who are at the lowest levels and where it is \"more difficult\" to move up the ladder. Social.</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><strong><br></strong></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Chilean students are the ones with the highest grades in the test, adding just over 450 points, followed by those from Costa Rica and Uruguay with just under 430, Mexico with about 420, Colombia and Brazil with just over 410, Argentina and Peru with just over 400, and Panama and the Dominican Republic below 400.</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><br></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Even so, globally, the data among the young people examined is not very good since one in four loses in these subjects. The best positioned are still Asians, but European countries such as Spain or Italy have large deficits.</span></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><div id=\"em-WBMZ1591-F24-ES-20191203\" class=\"m-em-flash\" style=\"margin: 0px auto 28px; padding: 0px; border: none; display: flex; -webkit-box-pack: center; justify-content: center; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; -webkit-box-align: center; align-items: center; clear: both;\"><div class=\"twitter-tweet twitter-tweet-rendered\" style=\"margin: 10px 0px; padding: 0px; border: none; max-width: 550px; display: flex; width: 550px;\"><iframe id=\"twitter-widget-1\" scrolling=\"no\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/index.html?dnt=false&amp;embedId=twitter-widget-1&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1201864220956151808&amp;lang=es&amp;origin=https%3A%2F%2Fwww.france24.com%2Fes%2F20191203-pruebas-pisa-los-estudiantes-latinoamericanos-reprueban-en-lectura-y-matem%25C3%25A1ticas&amp;siteScreenName=France24_es&amp;theme=light&amp;widgetsVersion=223fc1c4%3A1596143124634&amp;width=550px\" data-tweet-id=\"1201864220956151808\" style=\"position: static; visibility: visible; width: 550px; height: 797px; display: block; flex-grow: 1;\"></iframe></div></div><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">Although there is an increase in schooling, the gap is still wide</span></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">The most positive thing that can be reflected is that with respect to the results obtained for almost 20 years with the first test, in Latin American countries there has been an increase in schooling and a higher coverage for young people who are in the last year of education basic and the first ones of upper average.</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><strong><br></strong></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Now, the challenge for the countries of the region is to increase the quality of education and allocate more economic and human resources to the most disadvantaged schools to try to eradicate inequality.</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><strong><br></strong></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">In Mexico, these data have been celebrated as a victory by the Executive of Andrés Manuel López Obrador. That country has managed to advance in the coverage of upper secondary schooling by advancing 15 percentage points in three decades.</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><strong><br></strong></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">However, according to the data released, in Mexico only 1% of students achieved an achievement at the highest proficiency levels in reading, mathematics, and science, and 35% did not achieve a minimum proficiency level.</span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><br></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Fifty-five percent of the students achieved at least level 2 proficiency in reading, on a scale of 5, while 44% achieved that level on the math test and about 53% achieved level 2 or higher in science, the study claims.</span></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"text-align: left; line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-d6c7771e-7fff-99ec-5715-eeac65425dbe\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The report produced worrying data for Colombia</span></span><br></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Colombia participated for the fifth time in these OECD studies and after the improvements experienced since 2015, there was a lot of expectation regarding the results, however, the data was worrying for the Executive. The results in reading and science were significantly worse and hardly improved in mathematics, something that maintains the gap with the most advanced countries.</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; letter-spacing: 0.2px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; letter-spacing: 0.2px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; letter-spacing: 0.2px; white-space: pre-wrap;\">Colombia obtained the lowest results of the countries that belong to the OECD, and according to the PISA report, its results are equal to those obtained by non-member countries such as Albania, North Macedonia and Qatar.</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; letter-spacing: 0.2px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; letter-spacing: 0.2px; white-space: pre-wrap;\"><br></span></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span id=\"docs-internal-guid-28b1b567-7fff-44f4-2489-c09f706dd2e9\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Gender differences in report results</span></span><br></p><p style=\"margin-right: 0px; margin-bottom: 28px; margin-left: 0px; padding: 0px; border: none; font-size: 1.7rem; line-height: 1.5;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">The report reveals an interesting reality by placing women almost 30 points above their male peers in reading comprehension, while the results in mathematics are very similar.</span></p><div id=\"em-WBMZ1592-F24-ES-20191203\" class=\"m-em-flash\" style=\"margin: 0px auto 28px; padding: 0px; border: none; display: flex; -webkit-box-pack: center; justify-content: center; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; -webkit-box-align: center; align-items: center; clear: both;\"><div class=\"twitter-tweet twitter-tweet-rendered\" style=\"margin: 10px 0px; padding: 0px; border: none; max-width: 550px; display: flex; width: 550px;\"><iframe id=\"twitter-widget-2\" scrolling=\"no\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/index.html?dnt=false&amp;embedId=twitter-widget-2&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1201828802906742784&amp;lang=es&amp;origin=https%3A%2F%2Fwww.france24.com%2Fes%2F20191203-pruebas-pisa-los-estudiantes-latinoamericanos-reprueban-en-lectura-y-matem%25C3%25A1ticas&amp;siteScreenName=France24_es&amp;theme=light&amp;widgetsVersion=223fc1c4%3A1596143124634&amp;width=550px\" data-tweet-id=\"1201828802906742784\" style=\"position: static; visibility: visible; width: 550px; height: 462px; display: block; flex-grow: 1;\"></iframe></div></div><p><span id=\"docs-internal-guid-e7f72c5e-7fff-c82a-210f-c13cf8dea4c2\"><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In Latin American countries it seems that this gap is lower, standing at only 10 points in reading comprehension and five in mathematics.</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">With EFE and local media</span><span style=\"font-size: 1.7rem; letter-spacing: 0.2px;\">&nbsp;</span></p></span></p>','https://s.france24.com/media/display/fbd56e2e-8972-11e9-bd51-005056bf87d6/w:980/p:16x9/escuela-peruana-agencia-andina.webp','The 2018 PISA Test leaves some very regular academic data for the region that sees how the gap regarding the results of european or asian students remains'),(4,'Latin America has been stagnated at the same academic level for 10 years, the PISA Test shows','16/08/2020','evento,ayuda, solidaridad','<p><span id=\"docs-internal-guid-a788506f-7fff-2996-a7b9-21ca3841f794\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"></span></span><br></p>\r\n<img src=\"https://www.eleconomista.com.mx/__export/1556476380200/sites/eleconomista/img/2018/07/10/maestro--alumnos-3_jpg.jpg_1348255499.jpg\"><br>\r\n\r\n<p><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-ab5b3b16-7fff-ba21-6ffe-94dcef3978fc\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The largest economies in Latin America, which participate in the PISA test, show not only a low academic performance in the region compared to the rest of the countries evaluated, they also reflect a very slow progress in the region in terms of increasing educational quality .</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-bebefd85-7fff-0571-193e-ac966ada2fd1\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Mexico, Costa Rica, Panama, Dominican Republic, Colombia, Peru, Chile, Argentina, Uruguay and Brazil are the Latin American nations that have participated in the PISA (Program International Student Assessment) educational test conducted by the OECD (Organization for Economic Cooperation and Development).</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-f0f929f4-7fff-35b1-f5a9-c0026e5676af\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The first three editions of the test (2000, 2003 and 2006) focused on one area of ​​study each, the first in reading comprehension, the second in mathematics and the third in science; As of the 2009 application, the test is performed evaluating the three areas of study of the students.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-d3fcc72b-7fff-d8b2-49e5-874a985772fb\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">With a threshold of 500 points, the PISA test identifies the countries whose average is higher or lower than the expected minimum in students under 15 years of age.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\"><span id=\"docs-internal-guid-982dbeb7-7fff-1223-edb8-ea34edf36b5c\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The participating Latin American countries, including Mexico, have not achieved the passing score of 500 points in any of the study areas and in any of the PISA editions.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-05e84054-7fff-3f03-6481-2d5c11d77435\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In almost all editions of the test, Uruguay and Chile stand out for obtaining the best scores in the region, although below the average. This also reflects another trend: the list of nations with the best marks continues to have the same protagonists.</span></span><br></p><h2 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 24px; line-height: 32px; font-family: Georgia, serif; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; color: rgb(65, 65, 65); width: 760px; cursor: initial; clear: both; letter-spacing: normal; \">Some results</h2><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-6566597f-7fff-1f05-4f40-ee51a62c1389\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In 2000, the first PISA test was carried out, Mexico and Brazil participated and stood out for registering an average score significantly lower than the OECD average.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-1ffb35b0-7fff-66bf-c7e9-6f40b3ece6a9\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Only 6% of the Mexican students and 3% of the Brazilian students reached the level of academic excellence (levels 5 and 6). New Zealand, Finland, and Canada significantly outperformed them with almost 20% of their students in academic excellence.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-414a403f-7fff-a1a7-971b-91d5fb6e5581\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The OECD pointed out in the first edition of the PISA test the importance of the socio-economic environment in the performance of students. On average, privileged students show better results, especially in countries like Mexico and Brazil, which have high levels of inequality. In countries with better income distribution, socioeconomic status tends to influence student performance less.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-9db76de6-7fff-d846-9f1b-dc82d02e308b\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In the following application, three years later, about 65% of Mexican students and slightly more than 75% of Brazilians did not reach level 2 of performance and the majority were below level 1. Finland, Korea and Canada have only 1 student in 10 below level 2.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-1c277c4b-7fff-000b-d0e3-0e05fc08e5e0\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In the test carried out in 2006, which focused on scientific skills, the participation of Argentina, Chile, Colombia and Uruguay was integrated. </span></span></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: center;\">Latin America once again occupied the lowest places along with Asian countries. The best performance was obtained by Chile, above Uruguay, Mexico, Argentina and Brazil, which obtained scores similar to those of Jordan, Azerbaijan or Tunisia. </span></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: center;\">Although there is no general rule that explains why academic performance in the region is so low compared to other countries, the figures suggest that the use of school resources, the professionalization of teachers and pedagogy in schools are factors that can affect the academic level of students.</span></p><h2 style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: bold; font-stretch: normal; font-size: 24px; line-height: 32px; font-family: Georgia, serif; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; color: rgb(65, 65, 65); width: 760px; cursor: initial; clear: both; letter-spacing: normal; \">PISA 2015 and 2018: no progress</h2><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-9ed8358b-7fff-bd87-0d68-fbdcb706103e\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The most recent application of the academic assessment test was in 2018. Three six-year terms after the first application of PISA, Mexico has not managed to increase the educational level of its basic education students. The trend is similar for the rest of the Latin American countries.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-f160ef41-7fff-ed60-2d45-d000366206f7\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Mexico, Costa Rica, the Dominican Republic, Colombia, Peru, Chile, Argentina participated in the 2015 edition (its results are not representative because it was only applied in the Autonomous City of Buenos Aires), Uruguay and Brazil. In the 2018 application, Panama was incorporated.</span></span><br></p><figure class=\"image\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; display: inline-block; margin-top: 20px; margin-bottom: 50px; position: relative;\"><img alt=\"Prueba PISA 2018\" data-height=\"650\" data-size=\"w:760,h:650\" data-width=\"760\" hspace=\"5\" src=\"https://www.eleconomista.com.mx/export/sites/eleconomista/img/2019/12/03/poli_princi_pisa_2018_031219_1.png_2127055041.png\" title=\"Prueba PISA 2018\" vspace=\"5\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; border: 0px; vertical-align: top; width: 760px; margin: 0px;\"><figcaption style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: 16px; color: rgb(255, 255, 255); position: absolute; left: 20px; bottom: 20px; right: 20px; max-width: 603px;  padding: 12px 18px; text-align: left;\">Prueba PISA 2018</figcaption></figure><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-622564c0-7fff-1055-acc8-ab5b9f445217\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The only nation that showed significant progress in any of the subjects from 2015 to 2018 was Peru. Their performance in mathematics increased 13 points, in science they increased 6 points and points, and in reading comprehension it moved 4 points. The rest of the nations did not significantly change their academic performance, even in some areas they reduced it.</span></span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\"><span id=\"docs-internal-guid-a8bd4f31-7fff-3fe0-1c7b-731b3ce1fd05\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Academic excellence is almost non-existent in Latin American countries. Uruguay managed to place 3.6% of its students at this level in at least one subject, Chile 3.3%, Brazil 2.2%, Colombia 1.2%, Costa Rica 0.9%, Mexico and Peru 0.6% and the Dominican Republic only at 0.1 percent. </span></span></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">The cases of Mexico and Brazil are especially particular: Brazil was the ninth largest economy in the world in 2018 and Mexico ranked 15th, but in almost twenty years they have not managed to improve the educational level of its inhabitants. </span><br></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal; \"><span id=\"docs-internal-guid-898436b1-7fff-25cb-217c-73ef12c1a14b\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\"The problem for Mexico is not only the bad results, but the lack of clarity of the public policy measures and from society, which allow to stop the deterioration and begin to correct in the right direction,\" said <a href=\"https://www.eleconomista.com.mx/opinion/Resultados-de-la-prueba-PISA-en-Mexico-20191205-0090.html\">Raúl Martínez Solares in his column for The Economist</a>, specialist in behavioral economics and education.</span></span><br></p><p class=\"ck-youtube\" id=\"youtube-10\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; width: 760px; max-width: 100%; display: inline-block; margin: 0px 0px 30px !important;\"><iframe allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/-j0-BUMIeJE\" width=\"560\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px; width: 760px; height: 371px; max-width: 100%;\"></iframe><span class=\"item first\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px;\"></span><span class=\"item second\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px;\"></span><span class=\"item third\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 14px;\"></span></p><p style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 28px; font-family: Georgia, serif; border: none; margin-right: 0px; margin-bottom: 30px; margin-left: 60px; padding: 0px; color: rgb(65, 65, 65); clear: both; letter-spacing: normal;\">ana.garcia@eleconomista.mx</p>','https://www.eleconomista.com.mx/__export/1556476380200/sites/eleconomista/img/2018/07/10/maestro--alumnos-3_jpg.jpg_1348255499.jpg','Peru is the only Latin American economy that registered significant progress in the pisa tests; from the 2015 application to the 2018 application, he managed to increase the performance of his students in the area of ​​mathematics by 13 points. Mexico could barely increase the index by 3 points.'),(5,'Most latin americans complete secondary school without knowing to read well','18/08/2020','evento,ayuda, solidaridad','<center><img src=\"https://mindstothe2.com/img/blog/1.jpg\"> </center>\r\n<br>\r\n<p dir=\"ltr\" style=\"line-height:1.38;text-align: justify;background-color:#ffffff;margin-top:0pt;margin-bottom:0pt;padding:0pt 0pt 6pt 0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#222222;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-234b8f47-7fff-dd34-82dd-71038ed06770\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In Latin America, a young person requires more than a decade of formal studies to complete secondary education. In many countries in the region it is an important step that young people and their parents celebrate as a great family achievement. However, the thousands of days getting up early, the sleeplessness of parents and children, the innumerable expenses and sacrifices do not seem to be giving the expected result.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-f05c1aa8-7fff-320d-b62e-96563c00b2be\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">According to a report just published by the UNESCO Institute for Statistics, more than half of young people in Latin America and the Caribbean do not reach the levels of proficiency required in reading ability by the time they complete secondary education . In total, there are 19 million adolescents in this situation.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-e8481111-7fff-5dd3-4e69-967c645429cd\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">According to the study, 36% of children and adolescents in the region do not have adequate reading levels. The balance is slightly better when only children of primary education age are taken into account: 26% are not sufficient. The results are not more favorable when they are evaluated in mathematics. 52% of children and youth in Latin America and the Caribbean do not reach basic skills. The situation is worse in secondary (62%) than in primary (46%).</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-022a29f9-7fff-98b3-511d-afd8a42e4730\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Students with reading comprehension problems</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 14%: </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: left;\">North America and Europe</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 31%: </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: left;\">East and Southeast Asia</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 36%: </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: left;\">Latin America and the Caribbean</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 57%: </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: left;\">West Asia and North Africa</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">- 88%: </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: left;\">Sub-Saharan Africa</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-6f935c04-7fff-8182-0400-12bbf34ac68f\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">These indicators, in which, paradoxically, Latin America and the Caribbean appear as one of the best-positioned regions of the world, reveal great challenges for the future.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><strong><span id=\"docs-internal-guid-ef611899-7fff-afa8-ae3f-abc8ccbab859\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">New illiteracy</span></span><br></strong></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-00a974ba-7fff-f591-9cc8-06ce0df7734f\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Silvia Montoya, director of the Unesco Institute of Statistics, considers that the problems that young people have in reading comprehension pose a \"dramatic\" situation. \"That there are children who do not have the basic skills when it comes to reading very simple paragraphs and extracting information from them, I would consider it a new definition of illiteracy. In today\'s world, having a minimum level of literacy is no longer being able to read your name and being able to write some fact of everyday life, \"said Montoya in a conversation with BBC Mundo.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-300e2691-7fff-26b5-7928-12447f0618bb\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\"Lacking reading comprehension is a kind of disability or incapacity to be able to insert oneself into society, to be able to vote and understand the candidates\' proposals, to be able to understand one\'s own rights and duties as a citizen. It seems to me that it affects all dimensions\" added. The expert considers reading as the basic skill, the foundation on which the other skills continue to be built.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-f940a12a-7fff-544e-b37b-bac2b0b4be57\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\"Reading to learn is essential because from there you can go from being self-taught to inserting yourself in the system. Without that competence, I think we are generating many children and adolescents who are entitled to many personal frustrations and social and work integration. reading or understanding texts is very difficult to progress in any area, \"he said.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-ccf6d33a-7fff-874c-6338-3e628184a906\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Montoya stressed that in today\'s world there is overexposure to information presented in different ways and that it has different degrees of quality and reliability, so people must be able to extract the information and judge it for themselves. \"Being able to read a job advertisement and understand what skills are required is, for example, something basic for any adolescent who is starting working life or who wants to continue training,\" he said.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><strong><span id=\"docs-internal-guid-34194213-7fff-b049-f62d-845327fcdb03\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">A school that doesn\'t work</span></span><br></strong></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#616161;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-size: 11pt; letter-spacing: 0.2px; text-align: left;\">But where is the fault? There was a time when it was thought that the problem with education in Latin America was that it was not inclusive, that it left many children out.</span>&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-6cb5030f-7fff-2195-e9e9-1eb761cd077a\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">According to Montoya, this is an issue in which the region has improved dramatically and now they even have comparative advantages in that regard in relation to other regions of the world. \"Now the reality is that children are in the educational system but there is an inability of the school to provide them with a level of learning that is reasonable and minimal for the circumstances that the world demands of today and tomorrow,\" he said.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-7c4ffb17-7fff-4de4-745a-16603e854526\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Why it is not possible to give the students adequate training is due, as he explained, to a combination of factors. Among these, he mentions the lack of training of teachers to deal with children with certain characteristics, infrastructure problems, loss of school days due to stoppages or other causes, as well as elements related to the students\' own socioeconomic situation, \"which may come of households with lower incomes or having less family support. There is a combination of factors that may vary in each place, but obviously there is a lack of specific policies to deal with this problem, \"said Montoya.</span></span><br></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-81f8f7ab-7fff-784c-acd6-8aa3cb874141\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">He added that it is necessary to look at the educational curricula, the training of teachers to ensure that they are able to work with children who come from complicated social contexts, have an adequate environment and infrastructure, as well as adequate social policies. \"There is no way to solve it if there is not a comprehensive vision of the educational system,\" he said.</span></span><br></p><p><span id=\"docs-internal-guid-a7fdb88f-7fff-1981-94fa-0a55fcdf5b73\"></span></p><p dir=\"ltr\" style=\"line-height:2.01;text-align: justify;margin-top:0pt;margin-bottom:15pt;\"><span id=\"docs-internal-guid-f31e24f8-7fff-b522-2bfc-ff4376b63bcb\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In this effort, he warned that the application of educational quality assessment tests is also necessary, which are not applied in half the countries of the world. \"If we do not have a serious, credible learning evaluation system, not much can be done either because the only way parents have to complain is to have information,\" he warned.</span></span><br></p>','https://mindstothe2.com/img/blog/1.jpg','A study by the UNESCO institute of statistics reveals that children and adolescents in school in Latin America lack basic reading comprehension skills.'),(6,'Misreading understanding has Colombia at the background of the PISA Tests: What to do?','22/08/2020','evento,ayuda, solidaridad','<p itemprop=\"description\" class=\"intro\" style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 0.5rem; margin-left: 0px; padding: 0px 0px 0rem; font-family: &quot;Open Sans&quot;, sans-serif; position: relative; line-height: 2rem !important; font-size: 1.25rem !important;\"><span id=\"docs-internal-guid-21b0e653-7fff-e559-5ebc-527826ea7406\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The results of the Pisa 2018 tests evidenced some shortcomings of the Colombian educational system, mainly in the area of ​​critical reading and comprehension, where Colombia deteriorated significantly. Several experts and academics give their opinion on what the country has failed and what must be done to improve.</span></span><br></p><p class=\"large-12 columns\" style=\"margin: 0px; padding: 0px 0.75rem; width: 987.188px; float: left; position: relative;\"><a class=\"th related-news-th\" href=\"https://static.iris.net.co/semana/upload/images/2015/5/26/429078_9339_1.jpg\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(233, 27, 30); line-height: 0; border: 1px solid rgb(255, 255, 255); outline: 0px; display: inline-block; max-width: 100%; box-shadow: none; transition: all 0.2s ease-out 0s; position: relative; padding-bottom: 508.563px; max-height: 0px; overflow: hidden; width: 963.188px; margin-bottom: 0rem;\"><img loading=\"lazy\" class=\"article-image\" src=\"https://static.iris.net.co/semana/upload/images/2015/5/26/429078_9339_1.jpg\" title=\"En 2015 Colombia obtuvo 425 puntos en la prueba de lectura, sin embargo 2018 se evidenció un retroceso importante al obtener 412 puntos.\" alt=\"Mala comprensión lectora tiene a Colombia al fondo de las pruebas PISA: ¿Qué hacer para mejorar?\" style=\"border-width: initial; border-color: initial; border-image: initial; display: block; box-shadow: rgb(233, 27, 30) 0px -2px 0px; padding-top: 2px; margin: 0px; width: 963.188px;\"></a>&nbsp;<span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">In 2015, Colombia obtained 425 points in the reading test, however, in 2018 there was a significant decline, obtaining 412 points. Photo: cc</span></p><p class=\"large-12 columns\" style=\"margin: 0px; padding: 0px 0.75rem; width: 987.188px; float: left; position: relative;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\"><br></span></p><div class=\"divAudioPlayerMobile-643045 s-audioplayer\" style=\"margin: 0px; padding: 0px;\"></div><div id=\"contentItem\" style=\"margin: 0px; padding: 0px;\"><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-6a417a32-7fff-73e4-f98a-051ecdfb60d2\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">This Tuesday the Organization for Economic Cooperation and Development (OECD) delivered the results of the PISA 2018 tests, which generated a lot of expectation because in the last edition, of 2015, Colombia registered a significant improvement in each of the evaluated competencies ( math, science, and reading).</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-76f4aa25-7fff-f519-f3b7-f00083b7a65b\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The nearly 8,000 15-year-old Colombian students who took the test between April and May 2018 obtained a lower performance than the OECD average, as in 2015, but their reading scores decreased (412 points compared to 425 in 2015 ) and science (413 points compared to 415 in 2015). Meanwhile, in mathematics there was a barely minimal advance, going from 390 points in the last edition to 391 in the most recent one.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-71c764fb-7fff-2bab-65ef-0db070628ca2\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Among the 37 member countries, Colombia ranked as the one with the lowest results, and according to the report presented, the performance of Colombian students is only equated with those obtained by Albania, North Macedonia and Qatar, nations that do not belong to the OECD.</span></span><br></p><p style=\"text-align: left; text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-1c249293-7fff-60e5-5f1a-a7de78bc8315\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">This panorama has elicited different reactions and interpretations from experts and academics, while some, such as the director of postgraduate courses in Economics from Javeriana, Luz Karime Abadía, point out that “the positive trend cannot be ignored since Colombia first presented the tests Pisa in 2006 despite the latest results where progress could not be continued ”; others like the pedagogue Julián de Zubiría consider that the results are very bad.</span></span></p><a href=\"https://www.semana.com/educacion/articulo/fractales-que-son-esos-patrones-matematicos-infinitos-a-los-que-se-les-llama-la-huella-digital-de-dios/643039/\"><p xmlns=\"http://www.w3.org/1999/xhtml\" style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 1.125rem;=\"\" color:=\"\" rgb(97,=\"\" 97,=\"\" 97);=\"\" width:=\"\" 634.125px;\"=\"\"><span id=\"docs-internal-guid-1c249293-7fff-60e5-5f1a-a7de78bc8315\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"></span></span></p><p xmlns=\"http://www.w3.org/1999/xhtml\" style=\"text-align: left; text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675;\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 1.125rem;=\"\" color:=\"\" rgb(97,=\"\" 97,=\"\" 97);=\"\" width:=\"\" 634.125px;\"=\"\"><ul><li><a href=\"https://www.semana.com/educacion/articulo/fractales-que-son-esos-patrones-matematicos-infinitos-a-los-que-se-les-llama-la-huella-digital-de-dios/643039/\"><p xmlns=\"http://www.w3.org/1999/xhtml\" style=\"text-align: left; text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675;\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 1.125rem;=\"\" color:=\"\" rgb(97,=\"\" 97,=\"\" 97);=\"\" width:=\"\" 634.125px;\"=\"\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\">Fractals: what are those infinite mathematical patterns that are called \"God\'s fingerprint\"</span></p></a></li></ul></p></a><p style=\"text-align: center; text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px;\"></span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-e3d870ae-7fff-00c9-1a57-4e1353d74d8f\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“Colombia did very badly in the tests because it is in the queue and does not advance and even worse, in the case of reading, a fundamental competition, it falls back to the levels of 2006. The situation continues to be really worrying, because we are also we stagnate in science and mathematics, \"said the expert.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-cef77904-7fff-45f8-c109-7519a16a31aa\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">De Zubiría believes that Colombia\'s poor performance can be easily explained, since in the country we continue with a memory education and an impertinent and fragmented curriculum. For this reason, it considers that language teaching should be the cross-cutting axis of basic and secondary education in the country.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-4d651e32-7fff-97e9-9b87-d36dfebf9990\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“The Government has not understood that in order to improve critical reading, the country has to go from working in language to working in reading skills, instead of emphasizing grammar and spelling as up to now, it must move to communicative skills. Instead of believing that language is improved with a class, it should be understood as a transversal competence that takes into account all subjects, ”added De Zubiría.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-8fd4cf1e-7fff-eb60-5f7e-225c5cefa3c8\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In this sense, the renowned pedagogue specified that the stagnation in science and mathematics is also related to reading competence, as he points out that these shortcomings make students not understand the problems in other areas: “Whoever reads very badly, misunderstands a problem in math or another subject. We continue with a fragmented curriculum that is limited to the informative ”.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-af7ba1ca-7fff-3bf1-208e-8ed15ee98dbb\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The Javeriana expert agreed that the educational model is not in accordance with current needs, emphasizing that the rise of new technologies should be taken advantage of to catch the attention of students: \"One of the factors that is lacking in the system educational is that you have a very traditional teaching and learning methodology, when contemporary challenges and the ways of student learning have changed a lot. We cannot continue with that master class where the teacher teaches and continues regardless of whether there are students who do not understand ”. </span></span></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap; letter-spacing: 0.2px; text-align: center;\">Abadía argued that Colombia has not opted for educational innovation making use of the facilities offered by ICT, with the exception of some private initiatives, but that official institutions need to bet on that, since 80% of students from the country attend schools of this type.</span><br></p><ul style=\"list-style-position: outside; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; font-size: 1rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; margin-block-start: 0em; margin-block-end: 0em; padding-inline-start: 0px;\"><li style=\"margin: 0px 0px 1.25rem 20px; padding: 0px; font-size: 1rem; line-height: 1.6; list-style-position: outside;\"><a href=\"https://www.semana.com/educacion/articulo/al-menos-8-universidades-publicas-estan-en-riesgo-de-no-terminar-el-semestre-que-esta-pasando/642271\" target=\"_blank\">At least eight public universities are at risk of not finishing the semester: What is happening?</a><br></li></ul><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-86fd17f3-7fff-736f-a516-79b0d3c06066\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">For her part, the Minister of Education, María Victoria Angulo, pointed out that the results of Colombia in Pisa are an input that must be taken into account in order to work on improving education.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-4143b859-7fff-e7b7-34b4-f27f13729d09\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">“It is important that the results of the Pisa are used as a tool that adds to the information of the national tests and the evaluation in each of the educational institutions, to guide the efforts of the different actors involved in the educational process in benefit from the constant improvement of education in the country, ”said Angulo.</span></span><br></p><h3 style=\"text-rendering: optimizelegibility; margin-top: 0.2rem; margin-right: 0px; margin-left: 0px; padding: 0px; font-weight: 700; font-family: Merriweather, Georgia, Times, &quot;Times New Roman&quot;, serif; color: rgb(34, 34, 34); line-height: 1.4; font-size: 1.3rem;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-2c45970b-7fff-22be-23bb-d51df4754bb3\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">What to do to improve?</span></span><br></h3><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-dfe5516e-7fff-63ac-4152-370745cb7e4b\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The big question that arises after the disappointing results of the Pisa 2018 is what should be done in the educational system to improve the country\'s performance in the tests that Colombian students will take in the first semester of 2020 and whose results will be delivered in 2021.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-260f5195-7fff-9a53-9612-9c086ce7a80c\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In that sense, Félix Antonio Gómez, dean of the Faculty of Education at the Javeriana University, pointed out that a fundamental aspect on which the Government should focus is on teacher training.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-bf49e06f-7fff-1bbc-1ed4-c3e67f91e9ca\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">\"Teacher training in the country has to continue to be strengthened together with working conditions. We need, as is the case in Finland and other countries, to attract the best graduates of the schools so that they are trained and become trainers, but we have to make this an attractive profession, not only from the academic point of view, but also from the conditions economic, \"he said.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-0cb4ff11-7fff-749e-1ada-eef8acd3ceb0\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Julián de Zubiría agrees with Gómez\'s approach, since he assures that “if the teachers are not trained, they will not have the skills or knowledge to transmit to the students. If teachers don\'t read critically, students won\'t read either.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-53e9c8f1-7fff-abe1-9291-942a07ab0d23\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">In addition to this, the pedagogue adds that it is necessary to bet on investment in initial education and in improving the environment in classrooms: “Contrary to what is believed, the results are closely associated with the classroom climate and a country that still he lives in war, as intolerant as ours, he has a very negative classroom climate ”.</span></span><br></p><ul style=\"list-style-position: outside; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 1.1rem; font-size: 1rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Helvetica, Arial, sans-serif; margin-block-start: 0em; margin-block-end: 0em; padding-inline-start: 0px;\"><li style=\"margin: 0px 0px 1.25rem 20px; padding: 0px; font-size: 1rem; line-height: 1.6; list-style-position: outside;\"><span style=\"font-weight: 700; line-height: inherit;\"><a href=\"https://www.dinero.com/pais/articulo/colombia-68-entre-100-en-dominio-del-ingles/278728\" target=\"_blank\">Colombians still cracked on bilingualism</a></span></li></ul><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-8fd469a1-7fff-4a7f-33d8-7a25aeed2289\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Regarding the possibility of adopting educational models from countries with better results, the dean of the Javeriana Faculty of Education explained that although they may be successful in one place, they do not guarantee that it will be successful in another country: “You have to take into account that Any mechanism for improving the knowledge or skills of the person must take into account the context in which it is to be applied; We cannot copy another model exactly, but there are generalities that can be adapted (...) There are interesting things in the mathematical model of Singapore, also in what Finland and other countries are applying, and others that would not be desirable or applicable for Colombia ”.</span></span><br></p><p style=\"text-rendering: optimizelegibility; margin-right: 0px; margin-bottom: 1.25rem; margin-left: 0px; padding: 0px; line-height: 1.675; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 1.125rem; color: rgb(97, 97, 97); width: 634.125px;\"><span id=\"docs-internal-guid-f78bce7a-7fff-80ea-c0da-692ed193e006\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Finally, the Minister of Education assured that to improve “it is key to team up with the territorial entities, educational directors, teachers, students, families, the educational community in general and other sectors of society to continue contributing to the closing of gaps and construction of an educational model based on quality and on the learning of our children and young people \".</span></span><br></p></div>','https://static.iris.net.co/semana/upload/images/2015/5/26/429078_9339_1.jpg','The results of the Pisa 2018 tests evidenced some shortcomings of the Colombian educational system');
